(604, 1, 'post', 'HỌC GÌ TỪ TÌNH TAY BA XANH ĐỎ TÍM', '', '<figure class=\"image\"><img src=\"/ckfinder/userfiles/302495885_5765670320119275_8036553513611951455_n.jpg\"></figure><p>1. Starbucks thả tim với Momo, Highlands trái tim tan vỡ, The Coffee House còm: “ngọt ngào đến mấy cũng tan thành mây” – Nhảm nhí, may be, nhưng vui</p><p>2. Vậy F&amp;B có thỉnh thoảng nên twist món một chút không? Có chứ!!! Như Pizza 4Ps làm Pizza Bún đậu mắm tôm vậy, hay mình từng làm Burger Corona vậy... có thể xàm, nhưng không nhàm</p><p>3. Có thể bạn sẽ nói: “Ko, tui phản đối! Mấy món vớ vẩn đó làm ra liệu có bán được ko? Cứ nên tập trung và sản phẩm cốt lõi cho chắc” – Nghe cũng có lý nhỉ? Biết làm sao bây giờ?</p><p>4. Thực ra phải làm cả 2 – Tập trung vào sản phẩm lõi và thỉnh thoảng tung ra sản phẩm vui vẻ fun fun dị dị một chút. Cụ David Ogilvy đã nói rồi: “Đừng làm mấy cái nhàm, thỉnh thoảng có thể xàm\" đấy là nói phét tán ra như thế chứ cụ chỉ nói nguyên văn là \"Don’t be bored” mà thui</p><p>5. Như Higland chẳng hạn, sản phẩm lõi tốt, mỗi nhóm sản phẩm từ café – trà – đá xay đều có sản phẩm key. Cơ mà hơi boring. Sau một thời gian cần có thêm các sản phẩm key nữa. Thỉnh thoảng twist ra sản phẩm mới nữa, chứ giờ Highland ổn định về món quá thành ra hơi bị cũ cũ …</p><p>6. Nhưng ra sản phẩm mới mà “phêu” thì sao? “Phêu” là chuyện thường. Có những món ăn dùng để tạo sự thú vị. Mình không nghĩ quá nhiều người ăn Pizza Bún đậu mắm tôm của 4Ps, giờ món cũng đã ngưng bán, anyway khách hàng nhắc đến, bởi vì nó thú vị…</p><p>7. Thương hiệu cần thỉnh thoảng được khách hàng gợi nhớ, kể cả thương hiệu mạnh đến mấy đi chăng nữa. Xa mặt cách lòng, lâu không hiện diện là quên. Ai cũng biết Coke nhưng Coke vẫn quảng cáo là vậy. Nhưng nếu bạn ít tiền, ko quảng cáo bom tấn như Coke được, thì sao? Thì cụ Ogilvy nói rồi đó, “Don’t be bored”</p><p>8. Hãy cứ học thử Starbucks, sản phẩm lõi là café nhưng nói mãi về café thì âu cũng sẽ nhàm. Thế nên thỉnh thoảng có những chiêu như Li-mít-tịt E-đi-sừn cái ly \'sầu riêng bạc hà\' để dân tình tranh nhau hít hà sưu tập là điều nên làm very rất, hay như mùa trung thu nào cũng thấy Starbucks bán thêm cả bánh trung thu. Guess why?</p><p>9. Vì khách hàng không thích sự nhàm chán nên tốt mấy sau một time sẽ bị nhàm. Viết tên lên ly, gọi tên đích danh khách hàng, OK, lúc đầu thì Wow đó, sau này dần bình thường. Mà khi đã bình thường thì khách hàng cũng không có nhu cầu nhắc đến thứ “bình thường” đâu… Vậy nên thỉnh thoảng nên làm một cú twist sản phẩm, kẻo không thì “ngọt ngào đến mấy cũng tan thành mây” là có thật…</p><p>Case này em Momo được lợi, ít nhất 500 a e chứng sĩ đều yêu màu tím về bờ</p><p style=\"text-align:right;\"><strong>Hoàng Tùng - Founder Chuỗi Pizza Home và Bếp trên mây Cloud Cook</strong></p><p>&nbsp;</p>', '\"{\\\"content\\\":{\\\"vi\\\":\\\"<figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"\\\\\\/ckfinder\\\\\\/userfiles\\\\\\/302495885_5765670320119275_8036553513611951455_n.jpg\\\\\\\"><\\\\\\/figure><p>1. Starbucks th\\\\u1ea3 tim v\\\\u1edbi Momo, Highlands tr\\\\u00e1i tim tan v\\\\u1ee1, The Coffee House c\\\\u00f2m: \\\\u201cng\\\\u1ecdt ng\\\\u00e0o \\\\u0111\\\\u1ebfn m\\\\u1ea5y c\\\\u0169ng tan th\\\\u00e0nh m\\\\u00e2y\\\\u201d \\\\u2013 Nh\\\\u1ea3m nh\\\\u00ed, may be, nh\\\\u01b0ng vui<\\\\\\/p><p>2. V\\\\u1eady F&amp;B c\\\\u00f3 th\\\\u1ec9nh tho\\\\u1ea3ng n\\\\u00ean twist m\\\\u00f3n m\\\\u1ed9t ch\\\\u00fat kh\\\\u00f4ng? C\\\\u00f3 ch\\\\u1ee9!!! Nh\\\\u01b0 Pizza 4Ps l\\\\u00e0m Pizza B\\\\u00fan \\\\u0111\\\\u1eadu m\\\\u1eafm t\\\\u00f4m v\\\\u1eady, hay m\\\\u00ecnh t\\\\u1eebng l\\\\u00e0m Burger Corona v\\\\u1eady... c\\\\u00f3 th\\\\u1ec3 x\\\\u00e0m, nh\\\\u01b0ng kh\\\\u00f4ng nh\\\\u00e0m<\\\\\\/p><p>3. C\\\\u00f3 th\\\\u1ec3 b\\\\u1ea1n s\\\\u1ebd n\\\\u00f3i: \\\\u201cKo, tui ph\\\\u1ea3n \\\\u0111\\\\u1ed1i! M\\\\u1ea5y m\\\\u00f3n v\\\\u1edb v\\\\u1ea9n \\\\u0111\\\\u00f3 l\\\\u00e0m ra li\\\\u1ec7u c\\\\u00f3 b\\\\u00e1n \\\\u0111\\\\u01b0\\\\u1ee3c ko? C\\\\u1ee9 n\\\\u00ean t\\\\u1eadp trung v\\\\u00e0 s\\\\u1ea3n ph\\\\u1ea9m c\\\\u1ed1t l\\\\u00f5i cho ch\\\\u1eafc\\\\u201d \\\\u2013 Nghe c\\\\u0169ng c\\\\u00f3 l\\\\u00fd nh\\\\u1ec9? Bi\\\\u1ebft l\\\\u00e0m sao b\\\\u00e2y gi\\\\u1edd?<\\\\\\/p><p>4. Th\\\\u1ef1c ra ph\\\\u1ea3i l\\\\u00e0m c\\\\u1ea3 2 \\\\u2013 T\\\\u1eadp trung v\\\\u00e0o s\\\\u1ea3n ph\\\\u1ea9m l\\\\u00f5i v\\\\u00e0 th\\\\u1ec9nh tho\\\\u1ea3ng tung ra s\\\\u1ea3n ph\\\\u1ea9m vui v\\\\u1ebb fun fun d\\\\u1ecb d\\\\u1ecb m\\\\u1ed9t ch\\\\u00fat. C\\\\u1ee5 David Ogilvy \\\\u0111\\\\u00e3 n\\\\u00f3i r\\\\u1ed3i: \\\\u201c\\\\u0110\\\\u1eebng l\\\\u00e0m m\\\\u1ea5y c\\\\u00e1i nh\\\\u00e0m, th\\\\u1ec9nh tho\\\\u1ea3ng c\\\\u00f3 th\\\\u1ec3 x\\\\u00e0m\\\\\\\" \\\\u0111\\\\u1ea5y l\\\\u00e0 n\\\\u00f3i ph\\\\u00e9t t\\\\u00e1n ra nh\\\\u01b0 th\\\\u1ebf ch\\\\u1ee9 c\\\\u1ee5 ch\\\\u1ec9 n\\\\u00f3i nguy\\\\u00ean v\\\\u0103n l\\\\u00e0 \\\\\\\"Don\\\\u2019t be bored\\\\u201d m\\\\u00e0 thui<\\\\\\/p><p>5. Nh\\\\u01b0 Higland ch\\\\u1eb3ng h\\\\u1ea1n, s\\\\u1ea3n ph\\\\u1ea9m l\\\\u00f5i t\\\\u1ed1t, m\\\\u1ed7i nh\\\\u00f3m s\\\\u1ea3n ph\\\\u1ea9m t\\\\u1eeb caf\\\\u00e9 \\\\u2013 tr\\\\u00e0 \\\\u2013 \\\\u0111\\\\u00e1 xay \\\\u0111\\\\u1ec1u c\\\\u00f3 s\\\\u1ea3n ph\\\\u1ea9m key. C\\\\u01a1 m\\\\u00e0 h\\\\u01a1i boring. Sau m\\\\u1ed9t th\\\\u1eddi gian c\\\\u1ea7n c\\\\u00f3 th\\\\u00eam c\\\\u00e1c s\\\\u1ea3n ph\\\\u1ea9m key n\\\\u1eefa. Th\\\\u1ec9nh tho\\\\u1ea3ng twist ra s\\\\u1ea3n ph\\\\u1ea9m m\\\\u1edbi n\\\\u1eefa, ch\\\\u1ee9 gi\\\\u1edd Highland \\\\u1ed5n \\\\u0111\\\\u1ecbnh v\\\\u1ec1 m\\\\u00f3n qu\\\\u00e1 th\\\\u00e0nh ra h\\\\u01a1i b\\\\u1ecb c\\\\u0169 c\\\\u0169 \\\\u2026<\\\\\\/p><p>6. Nh\\\\u01b0ng ra s\\\\u1ea3n ph\\\\u1ea9m m\\\\u1edbi m\\\\u00e0 \\\\u201cph\\\\u00eau\\\\u201d th\\\\u00ec sao? \\\\u201cPh\\\\u00eau\\\\u201d l\\\\u00e0 chuy\\\\u1ec7n th\\\\u01b0\\\\u1eddng. C\\\\u00f3 nh\\\\u1eefng m\\\\u00f3n \\\\u0103n d\\\\u00f9ng \\\\u0111\\\\u1ec3 t\\\\u1ea1o s\\\\u1ef1 th\\\\u00fa v\\\\u1ecb. M\\\\u00ecnh kh\\\\u00f4ng ngh\\\\u0129 qu\\\\u00e1 nhi\\\\u1ec1u ng\\\\u01b0\\\\u1eddi \\\\u0103n Pizza B\\\\u00fan \\\\u0111\\\\u1eadu m\\\\u1eafm t\\\\u00f4m c\\\\u1ee7a 4Ps, gi\\\\u1edd m\\\\u00f3n c\\\\u0169ng \\\\u0111\\\\u00e3 ng\\\\u01b0ng b\\\\u00e1n, anyway kh\\\\u00e1ch h\\\\u00e0ng nh\\\\u1eafc \\\\u0111\\\\u1ebfn, b\\\\u1edfi v\\\\u00ec n\\\\u00f3 th\\\\u00fa v\\\\u1ecb\\\\u2026<\\\\\\/p><p>7. Th\\\\u01b0\\\\u01a1ng hi\\\\u1ec7u c\\\\u1ea7n th\\\\u1ec9nh tho\\\\u1ea3ng \\\\u0111\\\\u01b0\\\\u1ee3c kh\\\\u00e1ch h\\\\u00e0ng g\\\\u1ee3i nh\\\\u1edb, k\\\\u1ec3 c\\\\u1ea3 th\\\\u01b0\\\\u01a1ng hi\\\\u1ec7u m\\\\u1ea1nh \\\\u0111\\\\u1ebfn m\\\\u1ea5y \\\\u0111i ch\\\\u0103ng n\\\\u1eefa. Xa m\\\\u1eb7t c\\\\u00e1ch l\\\\u00f2ng, l\\\\u00e2u kh\\\\u00f4ng hi\\\\u1ec7n di\\\\u1ec7n l\\\\u00e0 qu\\\\u00ean. Ai c\\\\u0169ng bi\\\\u1ebft Coke nh\\\\u01b0ng Coke v\\\\u1eabn qu\\\\u1ea3ng c\\\\u00e1o l\\\\u00e0 v\\\\u1eady. Nh\\\\u01b0ng n\\\\u1ebfu b\\\\u1ea1n \\\\u00edt ti\\\\u1ec1n, ko qu\\\\u1ea3ng c\\\\u00e1o bom t\\\\u1ea5n nh\\\\u01b0 Coke \\\\u0111\\\\u01b0\\\\u1ee3c, th\\\\u00ec sao? Th\\\\u00ec c\\\\u1ee5 Ogilvy n\\\\u00f3i r\\\\u1ed3i \\\\u0111\\\\u00f3, \\\\u201cDon\\\\u2019t be bored\\\\u201d<\\\\\\/p><p>8. H\\\\u00e3y c\\\\u1ee9 h\\\\u1ecdc th\\\\u1eed Starbucks, s\\\\u1ea3n ph\\\\u1ea9m l\\\\u00f5i l\\\\u00e0 caf\\\\u00e9 nh\\\\u01b0ng n\\\\u00f3i m\\\\u00e3i v\\\\u1ec1 caf\\\\u00e9 th\\\\u00ec \\\\u00e2u c\\\\u0169ng s\\\\u1ebd nh\\\\u00e0m. Th\\\\u1ebf n\\\\u00ean th\\\\u1ec9nh tho\\\\u1ea3ng c\\\\u00f3 nh\\\\u1eefng chi\\\\u00eau nh\\\\u01b0 Li-m\\\\u00edt-t\\\\u1ecbt E-\\\\u0111i-s\\\\u1eebn c\\\\u00e1i ly \'s\\\\u1ea7u ri\\\\u00eang b\\\\u1ea1c h\\\\u00e0\' \\\\u0111\\\\u1ec3 d\\\\u00e2n t\\\\u00ecnh tranh nhau h\\\\u00edt h\\\\u00e0 s\\\\u01b0u t\\\\u1eadp l\\\\u00e0 \\\\u0111i\\\\u1ec1u n\\\\u00ean l\\\\u00e0m very r\\\\u1ea5t, hay nh\\\\u01b0 m\\\\u00f9a trung thu n\\\\u00e0o c\\\\u0169ng th\\\\u1ea5y Starbucks b\\\\u00e1n th\\\\u00eam c\\\\u1ea3 b\\\\u00e1nh trung thu. Guess why?<\\\\\\/p><p>9. V\\\\u00ec kh\\\\u00e1ch h\\\\u00e0ng kh\\\\u00f4ng th\\\\u00edch s\\\\u1ef1 nh\\\\u00e0m ch\\\\u00e1n n\\\\u00ean t\\\\u1ed1t m\\\\u1ea5y sau m\\\\u1ed9t time s\\\\u1ebd b\\\\u1ecb nh\\\\u00e0m. Vi\\\\u1ebft t\\\\u00ean l\\\\u00ean ly, g\\\\u1ecdi t\\\\u00ean \\\\u0111\\\\u00edch danh kh\\\\u00e1ch h\\\\u00e0ng, OK, l\\\\u00fac \\\\u0111\\\\u1ea7u th\\\\u00ec Wow \\\\u0111\\\\u00f3, sau n\\\\u00e0y d\\\\u1ea7n b\\\\u00ecnh th\\\\u01b0\\\\u1eddng. M\\\\u00e0 khi \\\\u0111\\\\u00e3 b\\\\u00ecnh th\\\\u01b0\\\\u1eddng th\\\\u00ec kh\\\\u00e1ch h\\\\u00e0ng c\\\\u0169ng kh\\\\u00f4ng c\\\\u00f3 nhu c\\\\u1ea7u nh\\\\u1eafc \\\\u0111\\\\u1ebfn th\\\\u1ee9 \\\\u201cb\\\\u00ecnh th\\\\u01b0\\\\u1eddng\\\\u201d \\\\u0111\\\\u00e2u\\\\u2026 V\\\\u1eady n\\\\u00ean th\\\\u1ec9nh tho\\\\u1ea3ng n\\\\u00ean l\\\\u00e0m m\\\\u1ed9t c\\\\u00fa twist s\\\\u1ea3n ph\\\\u1ea9m, k\\\\u1ebbo kh\\\\u00f4ng th\\\\u00ec \\\\u201cng\\\\u1ecdt ng\\\\u00e0o \\\\u0111\\\\u1ebfn m\\\\u1ea5y c\\\\u0169ng tan th\\\\u00e0nh m\\\\u00e2y\\\\u201d l\\\\u00e0 c\\\\u00f3 th\\\\u1eadt\\\\u2026<\\\\\\/p><p>Case n\\\\u00e0y em Momo \\\\u0111\\\\u01b0\\\\u1ee3c l\\\\u1ee3i, \\\\u00edt nh\\\\u1ea5t 500 a e ch\\\\u1ee9ng s\\\\u0129 \\\\u0111\\\\u1ec1u y\\\\u00eau m\\\\u00e0u t\\\\u00edm v\\\\u1ec1 b\\\\u1edd<\\\\\\/p><p style=\\\\\\\"text-align:right;\\\\\\\"><strong>Ho\\\\u00e0ng T\\\\u00f9ng - Founder Chu\\\\u1ed7i Pizza Home v\\\\u00e0 B\\\\u1ebfp tr\\\\u00ean m\\\\u00e2y Cloud Cook<\\\\\\/strong><\\\\\\/p><p>&nbsp;<\\\\\\/p>\\\"},\\\"brief\\\":{\\\"vi\\\":\\\"\\\"},\\\"seo_title\\\":\\\"\\\",\\\"seo_keyword\\\":\\\"\\\",\\\"seo_description\\\":\\\"\\\",\\\"refer\\\":null}\"', 'https://biz9.vn/upload/advertisement/302495885_5765670320119275_8036553513611951455_n.jpg', '', 'active', 'Hoàng Thùy Trang ', '', 'hoc-gi-tu-tinh-tay-ba-xanh-do-tim', 0, 0, 0, 1, 0, 10, 0, '2022-10-03 15:41:58', NULL, ',1,', NULL, NULL, 'open', '', '', '', NULL, 3, 1, '2022-09-29 08:21:29', '2022-10-13 11:17:29'),
(606, 1, 'post', 'Taseco Airs của doanh nhân Phạm Ngọc Thanh đứng trước nguy cơ hủy niêm yết', 'Từng là \"con gà đẻ trứng vàng\" của Tập đoàn Taseco, Taseco Airs hiện đang đứng trươc nguy cơ hủy niêm yết vì thua lỗ 3 năm liên tiếp.', '<figure class=\"image\"><img src=\"https://image.theleader.vn/thumbs/788x0/upload/minhan/2022/9/7/Tasecoair.jpg\" alt=\"Taseco Airs của doanh nhân Phạm Ngọc Thanh đứng trước nguy cơ hủy niêm yết\"></figure><p><i>Ông Phạm Ngọc Thanh, Chủ tịch HĐQT của Taseco Airs</i></p><p>Sở Giao dịch Chứng khoán Thành phố Hồ Chí Minh (HOSE) thông báo về việc lưu ý Công ty Cổ phần Dịch vụ Hàng không Taseco (Taseco Airs) về khả năng hủy niêm yết. Trước đó, từ ngày 14/4/2022, HOSE đã chuyển cổ phiếu AST của Taseco Airs từ diện cảnh báo sang diện kiểm soát.</p><p>Nguyên nhân là do Taseco Airs liên tục thua lỗ trong 3 năm gần đây. Báo cáo tài chính hợp nhất kiểm toán năm 2020 và 2021 ghi nhận lợi nhuận sau thuế cổ đông công ty mẹ lần lượt là âm 118 tỷ đồng và 49 tỷ đồng, thuộc trường họp chứng khoán bị kiểm soát theo quy định.&nbsp;</p><p>Nửa đầu năm nay, lợi nhuận sau thuế của cổ đông công ty mẹ tiếp tục âm 7,5 tỷ đồng và lỗ lũy kế đến ngày 30/06/2022 là 84,35 tỷ đồng. Căn cứ theo quy định, cổ phiếu công ty đại chúng có thể hủy niêm yết nếu thua lỗ 3 năm liên tiếp. Do đó, HOSE lưu ý công ty về khả năng Taseco Airs bị hủy niêm yết nếu báo cáo tài chính kiểm toán năm 2022 tiếp tục có lợi nhuận sau thuế âm.</p><p>Công ty Taseco Airs là một thành viên của Tập đoàn Taseco, hoạt động chính là bán lẻ tại sân bay với các cửa hàng lưu niệm, nhà hàng, quán ăn nhanh và café dưới thương hiệu “Lucky” tại nhiều sân bay đông nhất tại Việt Nam và điều hành khách sạn với một khách sạn 4 sao tại Đà Nẵng. Ngoài ra, công ty còn có công ty liên kết là CTCP Dịch vụ suất ăn Hàng không Việt Nam (VINACS) hoạt động tai sân bay Nội Bài và Cam Ranh.</p><figure class=\"image\"><img src=\"https://image.theleader.vn/upload/quocdung/2022/9/7/DH899818.jpg\" alt=\"Taseco Airs của doanh nhân Phạm Ngọc Thanh đứng trước nguy cơ hủy niêm yết\"></figure><p style=\"text-align:center;\"><i>Cửa hàng Lucky của Taseco Airs tại sân bay.</i></p><p>&nbsp;</p><p>Với lợi thế độc quyền cung cấp dịch vụ trong các cảng hàng không, lợi nhuận Taseco Airs từng rất tốt. Giai đoạn 2017 – 2019, công ty ghi nhận lợi nhuận đều đặn hàng trăm tỷ đồng mỗi năm. Tuy nhiên, đại dịch Covid-19 khiến ngành hàng không bị đình trệ và hoạt động của Taseco Airs bị ảnh hưởng nghiêm trọng.<br>&nbsp;</p><p>Các cửa hàng của Taseco Airs hoạt động cầm chừng trong suốt thời gian xảy ra dịch bệnh Covid-19, đặc biệt là vào quý 3 năm 2021, gần như tất cả các cửa hàng phải tạm thời đóng cửa. Đến cuối quý II/2022, tất cả các cửa hàng trong nước đã hoạt động trở lại, trong khi một số cửa hàng ở các nhà ga quốc tế vẫn đóng cửa.</p><p>Taseco Airs cho biết dù lỗ quý II/2022, công ty đã bắt đầu có lãi trở lại trong tháng 5. Kế hoạch lợi nhuận năm 2022 đặt ra là 23,5 tỷ đồng.</p><p>Năm 2022, <strong>Taseco Airs</strong> cho biết sẽ mua lại 51% cổ phần của Công ty Dịch vụ Hà Linh với giá chỉ 25 tỷ đồng. Công ty Dịch vụ Hà Linh đang quản lý 10 cửa hàng tại Sân bay Nội Bài, Đà Nẵng và Phú Quốc, và các cửa hàng này sẽ được hợp nhất vào Taseco Airs trong 6 tháng cuối năm 2022.&nbsp;</p><p>Trong các năm tới, Taseco Airs đặt mục tiêu tiếp tục mở rộng hoạt động kinh doanh với việc mở thêm cửa hàng mới tại các sân bay hiện có và sân bay mới (nhà ga quốc tế Phú Bài, sân bay quốc tế Long Thành).</p><p>Công ty chứng khoán SSI đánh giá, bất chấp sự phục hồi mạnh mẽ của thị trường nội địa, các công ty dịch vụ sân bay vẫn phải lưu tâm đến thị trường quốc tế, vì hành khách quốc tế thường mang lại đa số doanh thu và lợi nhuận. Những rủi ro quốc tế ảnh hưởng đến hoạt động của ngành hàng không bao gồm chính sách Zero-Covid của Trung Quốc, chiến tranh Ukraina và rủi ro giảm hoạt động du lịch do suy thoái kinh tế.</p><p>Khi mảng dịch vụ hàng không - \"con gà đẻ trứng vàng\" một thời gặp khó khăn, Tập đoàn Taseco chuyển hướng rất mạnh sang lĩnh vực bất động sản với Taseco Land. Đơn vị này “bành trướng” mạnh mẽ ở thị trường bất động sản phía Tây Hồ Tây với các dự án tại Khu đô thị Đoàn Ngoại Giao.</p><p>Tại ĐHCĐ năm 2022 vừa diễn ra hồi tháng 6, Ban lãnh đạo Taseco Land cho biết công ty đang ưu tiên tập trung nghiên cứu các dự án mới, đưa tổng số dự án lên hơn 40 dự án tại trên 10 tỉnh thành với tổng quỹ đất nghiên cứu hơn 2.000 ha nhằm tạo quỹ đất phát triển cho các năm tiếp theo.</p><p>Dự kiến trong các năm tới, Taseco Land sẽ tham gia đấu thầu, đấu giá nhiều dự án với quỹ đất lớn tại nhiều địa phương. Để chuẩn bị cho hoạt động đầu tư lớn này, Taseco Land đã lên kế hoạch thu hồi vốn tại các dự án đã và đang đầu tư từ các năm trước cũng như định hướng sẽ niêm yết cổ phiếu Taseco Land lên sàn chứng khoán.</p><p><a href=\"https://theleader.vn/taseco-airs-cua-doanh-nhan-pham-ngoc-thanh-dung-truoc-nguy-co-huy-niem-yet-1662542385969.htm\">Theo Trần Anh / The Leader</a></p>', '\"{\\\"content\\\":{\\\"vi\\\":\\\"<figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"https:\\\\\\/\\\\\\/image.theleader.vn\\\\\\/thumbs\\\\\\/788x0\\\\\\/upload\\\\\\/minhan\\\\\\/2022\\\\\\/9\\\\\\/7\\\\\\/Tasecoair.jpg\\\\\\\" alt=\\\\\\\"Taseco Airs c\\\\u1ee7a doanh nh\\\\u00e2n Ph\\\\u1ea1m Ng\\\\u1ecdc Thanh \\\\u0111\\\\u1ee9ng tr\\\\u01b0\\\\u1edbc nguy c\\\\u01a1 h\\\\u1ee7y ni\\\\u00eam y\\\\u1ebft\\\\\\\"><\\\\\\/figure><p><i>\\\\u00d4ng Ph\\\\u1ea1m Ng\\\\u1ecdc Thanh, Ch\\\\u1ee7 t\\\\u1ecbch H\\\\u0110QT c\\\\u1ee7a Taseco Airs<\\\\\\/i><\\\\\\/p><p>S\\\\u1edf Giao d\\\\u1ecbch Ch\\\\u1ee9ng kho\\\\u00e1n Th\\\\u00e0nh ph\\\\u1ed1 H\\\\u1ed3 Ch\\\\u00ed Minh (HOSE) th\\\\u00f4ng b\\\\u00e1o v\\\\u1ec1 vi\\\\u1ec7c l\\\\u01b0u \\\\u00fd C\\\\u00f4ng ty C\\\\u1ed5 ph\\\\u1ea7n D\\\\u1ecbch v\\\\u1ee5 H\\\\u00e0ng kh\\\\u00f4ng Taseco (Taseco Airs) v\\\\u1ec1 kh\\\\u1ea3 n\\\\u0103ng h\\\\u1ee7y ni\\\\u00eam y\\\\u1ebft. Tr\\\\u01b0\\\\u1edbc \\\\u0111\\\\u00f3, t\\\\u1eeb ng\\\\u00e0y 14\\\\\\/4\\\\\\/2022, HOSE \\\\u0111\\\\u00e3 chuy\\\\u1ec3n c\\\\u1ed5 phi\\\\u1ebfu AST c\\\\u1ee7a Taseco Airs t\\\\u1eeb di\\\\u1ec7n c\\\\u1ea3nh b\\\\u00e1o sang di\\\\u1ec7n ki\\\\u1ec3m so\\\\u00e1t.<\\\\\\/p><p>Nguy\\\\u00ean nh\\\\u00e2n l\\\\u00e0 do Taseco Airs li\\\\u00ean t\\\\u1ee5c thua l\\\\u1ed7 trong 3 n\\\\u0103m g\\\\u1ea7n \\\\u0111\\\\u00e2y. B\\\\u00e1o c\\\\u00e1o t\\\\u00e0i ch\\\\u00ednh h\\\\u1ee3p nh\\\\u1ea5t ki\\\\u1ec3m to\\\\u00e1n n\\\\u0103m 2020 v\\\\u00e0 2021 ghi nh\\\\u1eadn l\\\\u1ee3i nhu\\\\u1eadn sau thu\\\\u1ebf c\\\\u1ed5 \\\\u0111\\\\u00f4ng c\\\\u00f4ng ty m\\\\u1eb9 l\\\\u1ea7n l\\\\u01b0\\\\u1ee3t l\\\\u00e0 \\\\u00e2m 118 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng v\\\\u00e0 49 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng, thu\\\\u1ed9c tr\\\\u01b0\\\\u1eddng h\\\\u1ecdp ch\\\\u1ee9ng kho\\\\u00e1n b\\\\u1ecb ki\\\\u1ec3m so\\\\u00e1t theo quy \\\\u0111\\\\u1ecbnh.&nbsp;<\\\\\\/p><p>N\\\\u1eeda \\\\u0111\\\\u1ea7u n\\\\u0103m nay, l\\\\u1ee3i nhu\\\\u1eadn sau thu\\\\u1ebf c\\\\u1ee7a c\\\\u1ed5 \\\\u0111\\\\u00f4ng c\\\\u00f4ng ty m\\\\u1eb9 ti\\\\u1ebfp t\\\\u1ee5c \\\\u00e2m 7,5 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng v\\\\u00e0 l\\\\u1ed7 l\\\\u0169y k\\\\u1ebf \\\\u0111\\\\u1ebfn ng\\\\u00e0y 30\\\\\\/06\\\\\\/2022 l\\\\u00e0 84,35 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng. C\\\\u0103n c\\\\u1ee9 theo quy \\\\u0111\\\\u1ecbnh, c\\\\u1ed5 phi\\\\u1ebfu c\\\\u00f4ng ty \\\\u0111\\\\u1ea1i ch\\\\u00fang c\\\\u00f3 th\\\\u1ec3 h\\\\u1ee7y ni\\\\u00eam y\\\\u1ebft n\\\\u1ebfu thua l\\\\u1ed7 3 n\\\\u0103m li\\\\u00ean ti\\\\u1ebfp. Do \\\\u0111\\\\u00f3, HOSE l\\\\u01b0u \\\\u00fd c\\\\u00f4ng ty v\\\\u1ec1 kh\\\\u1ea3 n\\\\u0103ng Taseco Airs b\\\\u1ecb h\\\\u1ee7y ni\\\\u00eam y\\\\u1ebft n\\\\u1ebfu b\\\\u00e1o c\\\\u00e1o t\\\\u00e0i ch\\\\u00ednh ki\\\\u1ec3m to\\\\u00e1n n\\\\u0103m 2022 ti\\\\u1ebfp t\\\\u1ee5c c\\\\u00f3 l\\\\u1ee3i nhu\\\\u1eadn sau thu\\\\u1ebf \\\\u00e2m.<\\\\\\/p><p>C\\\\u00f4ng ty Taseco Airs l\\\\u00e0 m\\\\u1ed9t th\\\\u00e0nh vi\\\\u00ean c\\\\u1ee7a T\\\\u1eadp \\\\u0111o\\\\u00e0n Taseco, ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng ch\\\\u00ednh l\\\\u00e0 b\\\\u00e1n l\\\\u1ebb t\\\\u1ea1i s\\\\u00e2n bay v\\\\u1edbi c\\\\u00e1c c\\\\u1eeda h\\\\u00e0ng l\\\\u01b0u ni\\\\u1ec7m, nh\\\\u00e0 h\\\\u00e0ng, qu\\\\u00e1n \\\\u0103n nhanh v\\\\u00e0 caf\\\\u00e9 d\\\\u01b0\\\\u1edbi th\\\\u01b0\\\\u01a1ng hi\\\\u1ec7u \\\\u201cLucky\\\\u201d t\\\\u1ea1i nhi\\\\u1ec1u s\\\\u00e2n bay \\\\u0111\\\\u00f4ng nh\\\\u1ea5t t\\\\u1ea1i Vi\\\\u1ec7t Nam v\\\\u00e0 \\\\u0111i\\\\u1ec1u h\\\\u00e0nh kh\\\\u00e1ch s\\\\u1ea1n v\\\\u1edbi m\\\\u1ed9t kh\\\\u00e1ch s\\\\u1ea1n 4 sao t\\\\u1ea1i \\\\u0110\\\\u00e0 N\\\\u1eb5ng. Ngo\\\\u00e0i ra, c\\\\u00f4ng ty c\\\\u00f2n c\\\\u00f3 c\\\\u00f4ng ty li\\\\u00ean k\\\\u1ebft l\\\\u00e0 CTCP D\\\\u1ecbch v\\\\u1ee5 su\\\\u1ea5t \\\\u0103n H\\\\u00e0ng kh\\\\u00f4ng Vi\\\\u1ec7t Nam (VINACS) ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng tai s\\\\u00e2n bay N\\\\u1ed9i B\\\\u00e0i v\\\\u00e0 Cam Ranh.<\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"https:\\\\\\/\\\\\\/image.theleader.vn\\\\\\/upload\\\\\\/quocdung\\\\\\/2022\\\\\\/9\\\\\\/7\\\\\\/DH899818.jpg\\\\\\\" alt=\\\\\\\"Taseco Airs c\\\\u1ee7a doanh nh\\\\u00e2n Ph\\\\u1ea1m Ng\\\\u1ecdc Thanh \\\\u0111\\\\u1ee9ng tr\\\\u01b0\\\\u1edbc nguy c\\\\u01a1 h\\\\u1ee7y ni\\\\u00eam y\\\\u1ebft\\\\\\\"><\\\\\\/figure><p style=\\\\\\\"text-align:center;\\\\\\\"><i>C\\\\u1eeda h\\\\u00e0ng Lucky c\\\\u1ee7a Taseco Airs t\\\\u1ea1i s\\\\u00e2n bay.<\\\\\\/i><\\\\\\/p><p>&nbsp;<\\\\\\/p><p>V\\\\u1edbi l\\\\u1ee3i th\\\\u1ebf \\\\u0111\\\\u1ed9c quy\\\\u1ec1n cung c\\\\u1ea5p d\\\\u1ecbch v\\\\u1ee5 trong c\\\\u00e1c c\\\\u1ea3ng h\\\\u00e0ng kh\\\\u00f4ng, l\\\\u1ee3i nhu\\\\u1eadn Taseco Airs t\\\\u1eebng r\\\\u1ea5t t\\\\u1ed1t. Giai \\\\u0111o\\\\u1ea1n 2017 \\\\u2013 2019, c\\\\u00f4ng ty ghi nh\\\\u1eadn l\\\\u1ee3i nhu\\\\u1eadn \\\\u0111\\\\u1ec1u \\\\u0111\\\\u1eb7n h\\\\u00e0ng tr\\\\u0103m t\\\\u1ef7 \\\\u0111\\\\u1ed3ng m\\\\u1ed7i n\\\\u0103m. Tuy nhi\\\\u00ean, \\\\u0111\\\\u1ea1i d\\\\u1ecbch Covid-19 khi\\\\u1ebfn ng\\\\u00e0nh h\\\\u00e0ng kh\\\\u00f4ng b\\\\u1ecb \\\\u0111\\\\u00ecnh tr\\\\u1ec7 v\\\\u00e0 ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng c\\\\u1ee7a Taseco Airs b\\\\u1ecb \\\\u1ea3nh h\\\\u01b0\\\\u1edfng nghi\\\\u00eam tr\\\\u1ecdng.<br>&nbsp;<\\\\\\/p><p>C\\\\u00e1c c\\\\u1eeda h\\\\u00e0ng c\\\\u1ee7a Taseco Airs ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng c\\\\u1ea7m ch\\\\u1eebng trong su\\\\u1ed1t th\\\\u1eddi gian x\\\\u1ea3y ra d\\\\u1ecbch b\\\\u1ec7nh Covid-19, \\\\u0111\\\\u1eb7c bi\\\\u1ec7t l\\\\u00e0 v\\\\u00e0o qu\\\\u00fd 3 n\\\\u0103m 2021, g\\\\u1ea7n nh\\\\u01b0 t\\\\u1ea5t c\\\\u1ea3 c\\\\u00e1c c\\\\u1eeda h\\\\u00e0ng ph\\\\u1ea3i t\\\\u1ea1m th\\\\u1eddi \\\\u0111\\\\u00f3ng c\\\\u1eeda. \\\\u0110\\\\u1ebfn cu\\\\u1ed1i qu\\\\u00fd II\\\\\\/2022, t\\\\u1ea5t c\\\\u1ea3 c\\\\u00e1c c\\\\u1eeda h\\\\u00e0ng trong n\\\\u01b0\\\\u1edbc \\\\u0111\\\\u00e3 ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng tr\\\\u1edf l\\\\u1ea1i, trong khi m\\\\u1ed9t s\\\\u1ed1 c\\\\u1eeda h\\\\u00e0ng \\\\u1edf c\\\\u00e1c nh\\\\u00e0 ga qu\\\\u1ed1c t\\\\u1ebf v\\\\u1eabn \\\\u0111\\\\u00f3ng c\\\\u1eeda.<\\\\\\/p><p>Taseco Airs cho bi\\\\u1ebft d\\\\u00f9 l\\\\u1ed7 qu\\\\u00fd II\\\\\\/2022, c\\\\u00f4ng ty \\\\u0111\\\\u00e3 b\\\\u1eaft \\\\u0111\\\\u1ea7u c\\\\u00f3 l\\\\u00e3i tr\\\\u1edf l\\\\u1ea1i trong th\\\\u00e1ng 5. K\\\\u1ebf ho\\\\u1ea1ch l\\\\u1ee3i nhu\\\\u1eadn n\\\\u0103m 2022 \\\\u0111\\\\u1eb7t ra l\\\\u00e0 23,5 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng.<\\\\\\/p><p>N\\\\u0103m 2022, <strong>Taseco Airs<\\\\\\/strong> cho bi\\\\u1ebft s\\\\u1ebd mua l\\\\u1ea1i 51% c\\\\u1ed5 ph\\\\u1ea7n c\\\\u1ee7a C\\\\u00f4ng ty D\\\\u1ecbch v\\\\u1ee5 H\\\\u00e0 Linh v\\\\u1edbi gi\\\\u00e1 ch\\\\u1ec9 25 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng. C\\\\u00f4ng ty D\\\\u1ecbch v\\\\u1ee5 H\\\\u00e0 Linh \\\\u0111ang qu\\\\u1ea3n l\\\\u00fd 10 c\\\\u1eeda h\\\\u00e0ng t\\\\u1ea1i S\\\\u00e2n bay N\\\\u1ed9i B\\\\u00e0i, \\\\u0110\\\\u00e0 N\\\\u1eb5ng v\\\\u00e0 Ph\\\\u00fa Qu\\\\u1ed1c, v\\\\u00e0 c\\\\u00e1c c\\\\u1eeda h\\\\u00e0ng n\\\\u00e0y s\\\\u1ebd \\\\u0111\\\\u01b0\\\\u1ee3c h\\\\u1ee3p nh\\\\u1ea5t v\\\\u00e0o Taseco Airs trong 6 th\\\\u00e1ng cu\\\\u1ed1i n\\\\u0103m 2022.&nbsp;<\\\\\\/p><p>Trong c\\\\u00e1c n\\\\u0103m t\\\\u1edbi, Taseco Airs \\\\u0111\\\\u1eb7t m\\\\u1ee5c ti\\\\u00eau ti\\\\u1ebfp t\\\\u1ee5c m\\\\u1edf r\\\\u1ed9ng ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng kinh doanh v\\\\u1edbi vi\\\\u1ec7c m\\\\u1edf th\\\\u00eam c\\\\u1eeda h\\\\u00e0ng m\\\\u1edbi t\\\\u1ea1i c\\\\u00e1c s\\\\u00e2n bay hi\\\\u1ec7n c\\\\u00f3 v\\\\u00e0 s\\\\u00e2n bay m\\\\u1edbi (nh\\\\u00e0 ga qu\\\\u1ed1c t\\\\u1ebf Ph\\\\u00fa B\\\\u00e0i, s\\\\u00e2n bay qu\\\\u1ed1c t\\\\u1ebf Long Th\\\\u00e0nh).<\\\\\\/p><p>C\\\\u00f4ng ty ch\\\\u1ee9ng kho\\\\u00e1n SSI \\\\u0111\\\\u00e1nh gi\\\\u00e1, b\\\\u1ea5t ch\\\\u1ea5p s\\\\u1ef1 ph\\\\u1ee5c h\\\\u1ed3i m\\\\u1ea1nh m\\\\u1ebd c\\\\u1ee7a th\\\\u1ecb tr\\\\u01b0\\\\u1eddng n\\\\u1ed9i \\\\u0111\\\\u1ecba, c\\\\u00e1c c\\\\u00f4ng ty d\\\\u1ecbch v\\\\u1ee5 s\\\\u00e2n bay v\\\\u1eabn ph\\\\u1ea3i l\\\\u01b0u t\\\\u00e2m \\\\u0111\\\\u1ebfn th\\\\u1ecb tr\\\\u01b0\\\\u1eddng qu\\\\u1ed1c t\\\\u1ebf, v\\\\u00ec h\\\\u00e0nh kh\\\\u00e1ch qu\\\\u1ed1c t\\\\u1ebf th\\\\u01b0\\\\u1eddng mang l\\\\u1ea1i \\\\u0111a s\\\\u1ed1 doanh thu v\\\\u00e0 l\\\\u1ee3i nhu\\\\u1eadn. Nh\\\\u1eefng r\\\\u1ee7i ro qu\\\\u1ed1c t\\\\u1ebf \\\\u1ea3nh h\\\\u01b0\\\\u1edfng \\\\u0111\\\\u1ebfn ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng c\\\\u1ee7a ng\\\\u00e0nh h\\\\u00e0ng kh\\\\u00f4ng bao g\\\\u1ed3m ch\\\\u00ednh s\\\\u00e1ch Zero-Covid c\\\\u1ee7a Trung Qu\\\\u1ed1c, chi\\\\u1ebfn tranh Ukraina v\\\\u00e0 r\\\\u1ee7i ro gi\\\\u1ea3m ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng du l\\\\u1ecbch do suy tho\\\\u00e1i kinh t\\\\u1ebf.<\\\\\\/p><p>Khi m\\\\u1ea3ng d\\\\u1ecbch v\\\\u1ee5 h\\\\u00e0ng kh\\\\u00f4ng - \\\\\\\"con g\\\\u00e0 \\\\u0111\\\\u1ebb tr\\\\u1ee9ng v\\\\u00e0ng\\\\\\\" m\\\\u1ed9t th\\\\u1eddi g\\\\u1eb7p kh\\\\u00f3 kh\\\\u0103n, T\\\\u1eadp \\\\u0111o\\\\u00e0n Taseco chuy\\\\u1ec3n h\\\\u01b0\\\\u1edbng r\\\\u1ea5t m\\\\u1ea1nh sang l\\\\u0129nh v\\\\u1ef1c b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n v\\\\u1edbi Taseco Land. \\\\u0110\\\\u01a1n v\\\\u1ecb n\\\\u00e0y \\\\u201cb\\\\u00e0nh tr\\\\u01b0\\\\u1edbng\\\\u201d m\\\\u1ea1nh m\\\\u1ebd \\\\u1edf th\\\\u1ecb tr\\\\u01b0\\\\u1eddng b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n ph\\\\u00eda T\\\\u00e2y H\\\\u1ed3 T\\\\u00e2y v\\\\u1edbi c\\\\u00e1c d\\\\u1ef1 \\\\u00e1n t\\\\u1ea1i Khu \\\\u0111\\\\u00f4 th\\\\u1ecb \\\\u0110o\\\\u00e0n Ngo\\\\u1ea1i Giao.<\\\\\\/p><p>T\\\\u1ea1i \\\\u0110HC\\\\u0110 n\\\\u0103m 2022 v\\\\u1eeba di\\\\u1ec5n ra h\\\\u1ed3i th\\\\u00e1ng 6, Ban l\\\\u00e3nh \\\\u0111\\\\u1ea1o Taseco Land cho bi\\\\u1ebft c\\\\u00f4ng ty \\\\u0111ang \\\\u01b0u ti\\\\u00ean t\\\\u1eadp trung nghi\\\\u00ean c\\\\u1ee9u c\\\\u00e1c d\\\\u1ef1 \\\\u00e1n m\\\\u1edbi, \\\\u0111\\\\u01b0a t\\\\u1ed5ng s\\\\u1ed1 d\\\\u1ef1 \\\\u00e1n l\\\\u00ean h\\\\u01a1n 40 d\\\\u1ef1 \\\\u00e1n t\\\\u1ea1i tr\\\\u00ean 10 t\\\\u1ec9nh th\\\\u00e0nh v\\\\u1edbi t\\\\u1ed5ng qu\\\\u1ef9 \\\\u0111\\\\u1ea5t nghi\\\\u00ean c\\\\u1ee9u h\\\\u01a1n 2.000 ha nh\\\\u1eb1m t\\\\u1ea1o qu\\\\u1ef9 \\\\u0111\\\\u1ea5t ph\\\\u00e1t tri\\\\u1ec3n cho c\\\\u00e1c n\\\\u0103m ti\\\\u1ebfp theo.<\\\\\\/p><p>D\\\\u1ef1 ki\\\\u1ebfn trong c\\\\u00e1c n\\\\u0103m t\\\\u1edbi, Taseco Land s\\\\u1ebd tham gia \\\\u0111\\\\u1ea5u th\\\\u1ea7u, \\\\u0111\\\\u1ea5u gi\\\\u00e1 nhi\\\\u1ec1u d\\\\u1ef1 \\\\u00e1n v\\\\u1edbi qu\\\\u1ef9 \\\\u0111\\\\u1ea5t l\\\\u1edbn t\\\\u1ea1i nhi\\\\u1ec1u \\\\u0111\\\\u1ecba ph\\\\u01b0\\\\u01a1ng. \\\\u0110\\\\u1ec3 chu\\\\u1ea9n b\\\\u1ecb cho ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng \\\\u0111\\\\u1ea7u t\\\\u01b0 l\\\\u1edbn n\\\\u00e0y, Taseco Land \\\\u0111\\\\u00e3 l\\\\u00ean k\\\\u1ebf ho\\\\u1ea1ch thu h\\\\u1ed3i v\\\\u1ed1n t\\\\u1ea1i c\\\\u00e1c d\\\\u1ef1 \\\\u00e1n \\\\u0111\\\\u00e3 v\\\\u00e0 \\\\u0111ang \\\\u0111\\\\u1ea7u t\\\\u01b0 t\\\\u1eeb c\\\\u00e1c n\\\\u0103m tr\\\\u01b0\\\\u1edbc c\\\\u0169ng nh\\\\u01b0 \\\\u0111\\\\u1ecbnh h\\\\u01b0\\\\u1edbng s\\\\u1ebd ni\\\\u00eam y\\\\u1ebft c\\\\u1ed5 phi\\\\u1ebfu Taseco Land l\\\\u00ean s\\\\u00e0n ch\\\\u1ee9ng kho\\\\u00e1n.<\\\\\\/p><p><a href=\\\\\\\"https:\\\\\\/\\\\\\/theleader.vn\\\\\\/taseco-airs-cua-doanh-nhan-pham-ngoc-thanh-dung-truoc-nguy-co-huy-niem-yet-1662542385969.htm\\\\\\\">Theo Tr\\\\u1ea7n Anh \\\\\\/ The Leader<\\\\\\/a><\\\\\\/p>\\\"},\\\"brief\\\":{\\\"vi\\\":\\\"T\\\\u1eebng l\\\\u00e0 \\\\\\\"con g\\\\u00e0 \\\\u0111\\\\u1ebb tr\\\\u1ee9ng v\\\\u00e0ng\\\\\\\" c\\\\u1ee7a T\\\\u1eadp \\\\u0111o\\\\u00e0n Taseco, Taseco Airs hi\\\\u1ec7n \\\\u0111ang \\\\u0111\\\\u1ee9ng tr\\\\u01b0\\\\u01a1c nguy c\\\\u01a1 h\\\\u1ee7y ni\\\\u00eam y\\\\u1ebft v\\\\u00ec thua l\\\\u1ed7 3 n\\\\u0103m li\\\\u00ean ti\\\\u1ebfp.\\\"},\\\"seo_title\\\":\\\"\\\",\\\"seo_keyword\\\":\\\"C\\\\u00f4ng ty C\\\\u1ed5 ph\\\\u1ea7n D\\\\u1ecbch v\\\\u1ee5 H\\\\u00e0ng kh\\\\u00f4ng Taseco (Taseco Airs). hu\\\\u1ef7 ni\\\\u00eam y\\\\u1ebft, AST\\\",\\\"seo_description\\\":\\\"\\\",\\\"refer\\\":null}\"', 'https://biz9.vn/upload/advertisement/Tasecoair.jpg', '', 'active', 'Tuệ Minh', '', 'taseco-airs-cua-doanh-nhan-pham-ngoc-thanh-dung-truoc-nguy-co-huy-niem-yet', 0, 0, 0, 1, 0, 13, 0, '2022-10-03 15:41:58', NULL, ',1,', NULL, NULL, 'open', '', 'Công ty Cổ phần Dịch vụ Hàng không Taseco (Taseco Airs). huỷ niêm yết, AST', '', NULL, 3, 1, '2022-09-29 08:21:29', '2022-10-13 11:17:29'),
(607, 1, 'post', 'Ngân hàng Nhà nước lý giải chưa tăng lãi suất điều hành', 'Lạm phát tại Việt Nam đang được kiểm soát tốt là một trong những cơ sở quan trọng để Ngân hàng Nhà nước duy trì lãi suất điều hành, không thay đổi nhằm hỗ trợ tăng trưởng kinh tế cũng như đảm bảo khôi phục nhanh nền kinh tế.', '<figure class=\"image\"><img src=\"https://image.theleader.vn/thumbs/788x0/upload/ngocanh/2022/9/7/pqt0125-16624744195021443257578.jpg\" alt=\"Ngân hàng Nhà nước lý giải chưa tăng lãi suất điều hành\"></figure><p><i>Phó Thống đốc Ngân hàng Nhà nước Việt Nam Đào Minh Tú. Ảnh: Quang Thương.</i></p><p>Tại họp báo Chính phủ ngày 6/9, Phó thống đốc Ngân hàng Nhà nước Đào Minh Tú khẳng định: mức lạm phát tại Việt Nam đang không phải là nguy cơ mà Chính phủ đang tích cực ngăn chặn, chống lạm phát.<br>&nbsp;</p><p>Theo nguyên lý như các nước đã và đang triển khai, việc chống lạm phát là tăng lãi suất để hạn chế đầu tư.</p><p>Như đối với Mỹ, Fed thay đổi nâng lãi suất liên tục 4 lần, đến nay mức lãi suất tăng lên đến 2,25 - 2,5%, và sẽ có nhiều đợt tăng lãi suất mới trong thời gian tới.</p><p>Ngân hàng châu Âu (ECB) cũng tăng lãi suất rất cao lên 0,5%, đây là lần tăng lãi suất đầu tiên của ngân hàng này trong 11 năm qua. Trước đó, mức lãi suất huy động âm (-0,5%) của ECB đã được duy trì kể từ năm 2014. Với mức tăng lãi suất mới, lãi suất tiền gửi hiện là 0%. Nhiều quốc gia khác cũng đang \'rục rịch\' tăng lãi suất.</p><p>Tại Việt Nam, lạm phát cũng là câu chuyện rất được quan tâm và Chính phủ đang chỉ đạo rất nhiều biện pháp để ngăn chặn lạm phát.</p><p>Kể từ tháng 7 tới nay, giá xăng trong nước được điều chỉnh giảm mạnh nên chỉ số lạm phát có dương nhưng không nhiều. Vì vậy, chỉ số CPI bình quân 8 tháng đầu năm tăng 2,58% so với cùng kỳ năm trước.</p><p>Trong bối cảnh lạm phát được kiểm soát tốt, Ngân hàng Nhà nước Việt Nam vẫn duy trì lãi suất điều hành, không thay đổi kể từ năm 2021 đến nay, bất chấp các nước trên thế giới đang tăng lãi suất rất cao.&nbsp;</p><p>Theo ông Tú, điều này cũng tạo điều kiện cho các ngân hàng thương mại tiếp cận với nguồn vốn hợp lí với giá rẻ hơn so với nguồn vốn đi vay ở nước ngoài, thì đây cũng là một trong những chính sách của Nhà nước.</p><p>Thời gian qua, nhiều nội dung cần được đáp ứng, nhiều bài toán đặt ra. Đó là vấn đề kiểm soát lạm phát nhưng vừa hỗ trợ việc tăng trưởng kinh tế cũng như đảm bảo khôi phục nhanh nền kinh tế. Hai vấn đề này đặt ra bài toán lãi suất của ngân hàng, tiếp tục điều hành hết sức linh hoạt và đảm bảo được mục tiêu đó.</p><p>Tại các ngân hàng thương mại, lãi suất đã có sự biến động tăng rất nhẹ trong thời gian qua, huy động 0,25%, cho vay là 0,24%. Đây có thể là mức thấp nhất trong tất cả các nước khu vực châu Á, Phó thống đốc cho biết.</p><p>Hiện nay lãi suất cho vay bình quân 9-9,3%, lãi suất huy động bình quân từ 6,3-6,8% đối với kì hạn trung bình. Mức lãi suất cho vay này so với mấy năm gần đây có thể nói duy trì ở mức khá ổn định.</p><p>Tuy nhiên, để kiểm soát lạm phát nhưng lại khôi phục nhanh nền kinh tế, hỗ trợ doanh nghiệp trong điều kiện còn nhiều khó khăn, thì thời gian vừa qua, thay vì tăng lãi suất điều hành, Ngân hàng Nhà nước đã tiếp tục chỉ đạo các ngân hàng thương mại tìm các biện pháp bằng nội lực của mình, nguồn lực của mình để hỗ trợ doanh nghiệp.</p><p>“Lần này chúng tôi tiếp tục kêu gọi các ngân hàng thương mại cắt giảm chi phí trong hoạt động của mình, thứ hai là cắt giảm một phần lợi nhuận để tiếp tục hỗ trợ doanh nghiệp vay vốn trong thời gian tới”, ông Tú cho biết.</p><p>Bên cạnh đó, trước thông tin&nbsp;nhiều ngân hàng đã tăng trưởng tín dụng chạm hạn mức được cấp từ đầu năm khiến nhiều người dân và doanh nghiệp gặp khó khi vay vốn.</p><p>Phó thống đốc Đào Minh Tú cho biết, hết tháng 8, mức tăng trưởng tín dụng đạt 9,91%, trong khi đó kế hoạch mục tiêu cả năm 2022 được Ngân hàng Nhà nước đưa ra từ đầu năm là 14%. \"Đây là mức tăng rất cao so với cùng kỳ năm ngoái. Các ngân hàng cơ bản đã sử dụng hết hạn mức giao đầu năm\".</p><p>Phần còn lại của tăng trưởng tín dụng, Ngân hàng Nhà nước sẽ tiếp tục giao cho các ngân hàng trong 1-2 ngày tới và sẽ thông báo tới từng ngân hàng, theo Phó thống đốc,&nbsp;với quan điểm tạo điều kiện cho các ngân hàng, đặc biệt là các ngân hàng có chỉ số hoạt động tốt, lành mạnh, hệ số an toàn cao.</p><p><a href=\"https://theleader.vn/ngan-hang-nha-nuoc-ly-giai-chua-tang-lai-suat-dieu-hanh-1662515320914.htm\">Theo Nhật Hạ / The Leader</a></p>', '\"{\\\"content\\\":{\\\"vi\\\":\\\"<figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"https:\\\\\\/\\\\\\/image.theleader.vn\\\\\\/thumbs\\\\\\/788x0\\\\\\/upload\\\\\\/ngocanh\\\\\\/2022\\\\\\/9\\\\\\/7\\\\\\/pqt0125-16624744195021443257578.jpg\\\\\\\" alt=\\\\\\\"Ng\\\\u00e2n h\\\\u00e0ng Nh\\\\u00e0 n\\\\u01b0\\\\u1edbc l\\\\u00fd gi\\\\u1ea3i ch\\\\u01b0a t\\\\u0103ng l\\\\u00e3i su\\\\u1ea5t \\\\u0111i\\\\u1ec1u h\\\\u00e0nh\\\\\\\"><\\\\\\/figure><p><i>Ph\\\\u00f3 Th\\\\u1ed1ng \\\\u0111\\\\u1ed1c Ng\\\\u00e2n h\\\\u00e0ng Nh\\\\u00e0 n\\\\u01b0\\\\u1edbc Vi\\\\u1ec7t Nam \\\\u0110\\\\u00e0o Minh T\\\\u00fa. \\\\u1ea2nh: Quang Th\\\\u01b0\\\\u01a1ng.<\\\\\\/i><\\\\\\/p><p>T\\\\u1ea1i h\\\\u1ecdp b\\\\u00e1o Ch\\\\u00ednh ph\\\\u1ee7 ng\\\\u00e0y 6\\\\\\/9, Ph\\\\u00f3 th\\\\u1ed1ng \\\\u0111\\\\u1ed1c Ng\\\\u00e2n h\\\\u00e0ng Nh\\\\u00e0 n\\\\u01b0\\\\u1edbc \\\\u0110\\\\u00e0o Minh T\\\\u00fa kh\\\\u1eb3ng \\\\u0111\\\\u1ecbnh: m\\\\u1ee9c l\\\\u1ea1m ph\\\\u00e1t t\\\\u1ea1i Vi\\\\u1ec7t Nam \\\\u0111ang kh\\\\u00f4ng ph\\\\u1ea3i l\\\\u00e0 nguy c\\\\u01a1 m\\\\u00e0 Ch\\\\u00ednh ph\\\\u1ee7 \\\\u0111ang t\\\\u00edch c\\\\u1ef1c ng\\\\u0103n ch\\\\u1eb7n, ch\\\\u1ed1ng l\\\\u1ea1m ph\\\\u00e1t.<br>&nbsp;<\\\\\\/p><p>Theo nguy\\\\u00ean l\\\\u00fd nh\\\\u01b0 c\\\\u00e1c n\\\\u01b0\\\\u1edbc \\\\u0111\\\\u00e3 v\\\\u00e0 \\\\u0111ang tri\\\\u1ec3n khai, vi\\\\u1ec7c ch\\\\u1ed1ng l\\\\u1ea1m ph\\\\u00e1t l\\\\u00e0 t\\\\u0103ng l\\\\u00e3i su\\\\u1ea5t \\\\u0111\\\\u1ec3 h\\\\u1ea1n ch\\\\u1ebf \\\\u0111\\\\u1ea7u t\\\\u01b0.<\\\\\\/p><p>Nh\\\\u01b0 \\\\u0111\\\\u1ed1i v\\\\u1edbi M\\\\u1ef9, Fed thay \\\\u0111\\\\u1ed5i n\\\\u00e2ng l\\\\u00e3i su\\\\u1ea5t li\\\\u00ean t\\\\u1ee5c 4 l\\\\u1ea7n, \\\\u0111\\\\u1ebfn nay m\\\\u1ee9c l\\\\u00e3i su\\\\u1ea5t t\\\\u0103ng l\\\\u00ean \\\\u0111\\\\u1ebfn 2,25 - 2,5%, v\\\\u00e0 s\\\\u1ebd c\\\\u00f3 nhi\\\\u1ec1u \\\\u0111\\\\u1ee3t t\\\\u0103ng l\\\\u00e3i su\\\\u1ea5t m\\\\u1edbi trong th\\\\u1eddi gian t\\\\u1edbi.<\\\\\\/p><p>Ng\\\\u00e2n h\\\\u00e0ng ch\\\\u00e2u \\\\u00c2u (ECB) c\\\\u0169ng t\\\\u0103ng l\\\\u00e3i su\\\\u1ea5t r\\\\u1ea5t cao l\\\\u00ean 0,5%, \\\\u0111\\\\u00e2y l\\\\u00e0 l\\\\u1ea7n t\\\\u0103ng l\\\\u00e3i su\\\\u1ea5t \\\\u0111\\\\u1ea7u ti\\\\u00ean c\\\\u1ee7a ng\\\\u00e2n h\\\\u00e0ng n\\\\u00e0y trong 11 n\\\\u0103m qua. Tr\\\\u01b0\\\\u1edbc \\\\u0111\\\\u00f3, m\\\\u1ee9c l\\\\u00e3i su\\\\u1ea5t huy \\\\u0111\\\\u1ed9ng \\\\u00e2m (-0,5%) c\\\\u1ee7a ECB \\\\u0111\\\\u00e3 \\\\u0111\\\\u01b0\\\\u1ee3c duy tr\\\\u00ec k\\\\u1ec3 t\\\\u1eeb n\\\\u0103m 2014. V\\\\u1edbi m\\\\u1ee9c t\\\\u0103ng l\\\\u00e3i su\\\\u1ea5t m\\\\u1edbi, l\\\\u00e3i su\\\\u1ea5t ti\\\\u1ec1n g\\\\u1eedi hi\\\\u1ec7n l\\\\u00e0 0%. Nhi\\\\u1ec1u qu\\\\u1ed1c gia kh\\\\u00e1c c\\\\u0169ng \\\\u0111ang \'r\\\\u1ee5c r\\\\u1ecbch\' t\\\\u0103ng l\\\\u00e3i su\\\\u1ea5t.<\\\\\\/p><p>T\\\\u1ea1i Vi\\\\u1ec7t Nam, l\\\\u1ea1m ph\\\\u00e1t c\\\\u0169ng l\\\\u00e0 c\\\\u00e2u chuy\\\\u1ec7n r\\\\u1ea5t \\\\u0111\\\\u01b0\\\\u1ee3c quan t\\\\u00e2m v\\\\u00e0 Ch\\\\u00ednh ph\\\\u1ee7 \\\\u0111ang ch\\\\u1ec9 \\\\u0111\\\\u1ea1o r\\\\u1ea5t nhi\\\\u1ec1u bi\\\\u1ec7n ph\\\\u00e1p \\\\u0111\\\\u1ec3 ng\\\\u0103n ch\\\\u1eb7n l\\\\u1ea1m ph\\\\u00e1t.<\\\\\\/p><p>K\\\\u1ec3 t\\\\u1eeb th\\\\u00e1ng 7 t\\\\u1edbi nay, gi\\\\u00e1 x\\\\u0103ng trong n\\\\u01b0\\\\u1edbc \\\\u0111\\\\u01b0\\\\u1ee3c \\\\u0111i\\\\u1ec1u ch\\\\u1ec9nh gi\\\\u1ea3m m\\\\u1ea1nh n\\\\u00ean ch\\\\u1ec9 s\\\\u1ed1 l\\\\u1ea1m ph\\\\u00e1t c\\\\u00f3 d\\\\u01b0\\\\u01a1ng nh\\\\u01b0ng kh\\\\u00f4ng nhi\\\\u1ec1u. V\\\\u00ec v\\\\u1eady, ch\\\\u1ec9 s\\\\u1ed1 CPI b\\\\u00ecnh qu\\\\u00e2n 8 th\\\\u00e1ng \\\\u0111\\\\u1ea7u n\\\\u0103m t\\\\u0103ng 2,58% so v\\\\u1edbi c\\\\u00f9ng k\\\\u1ef3 n\\\\u0103m tr\\\\u01b0\\\\u1edbc.<\\\\\\/p><p>Trong b\\\\u1ed1i c\\\\u1ea3nh l\\\\u1ea1m ph\\\\u00e1t \\\\u0111\\\\u01b0\\\\u1ee3c ki\\\\u1ec3m so\\\\u00e1t t\\\\u1ed1t, Ng\\\\u00e2n h\\\\u00e0ng Nh\\\\u00e0 n\\\\u01b0\\\\u1edbc Vi\\\\u1ec7t Nam v\\\\u1eabn duy tr\\\\u00ec l\\\\u00e3i su\\\\u1ea5t \\\\u0111i\\\\u1ec1u h\\\\u00e0nh, kh\\\\u00f4ng thay \\\\u0111\\\\u1ed5i k\\\\u1ec3 t\\\\u1eeb n\\\\u0103m 2021 \\\\u0111\\\\u1ebfn nay, b\\\\u1ea5t ch\\\\u1ea5p c\\\\u00e1c n\\\\u01b0\\\\u1edbc tr\\\\u00ean th\\\\u1ebf gi\\\\u1edbi \\\\u0111ang t\\\\u0103ng l\\\\u00e3i su\\\\u1ea5t r\\\\u1ea5t cao.&nbsp;<\\\\\\/p><p>Theo \\\\u00f4ng T\\\\u00fa, \\\\u0111i\\\\u1ec1u n\\\\u00e0y c\\\\u0169ng t\\\\u1ea1o \\\\u0111i\\\\u1ec1u ki\\\\u1ec7n cho c\\\\u00e1c ng\\\\u00e2n h\\\\u00e0ng th\\\\u01b0\\\\u01a1ng m\\\\u1ea1i ti\\\\u1ebfp c\\\\u1eadn v\\\\u1edbi ngu\\\\u1ed3n v\\\\u1ed1n h\\\\u1ee3p l\\\\u00ed v\\\\u1edbi gi\\\\u00e1 r\\\\u1ebb h\\\\u01a1n so v\\\\u1edbi ngu\\\\u1ed3n v\\\\u1ed1n \\\\u0111i vay \\\\u1edf n\\\\u01b0\\\\u1edbc ngo\\\\u00e0i, th\\\\u00ec \\\\u0111\\\\u00e2y c\\\\u0169ng l\\\\u00e0 m\\\\u1ed9t trong nh\\\\u1eefng ch\\\\u00ednh s\\\\u00e1ch c\\\\u1ee7a Nh\\\\u00e0 n\\\\u01b0\\\\u1edbc.<\\\\\\/p><p>Th\\\\u1eddi gian qua, nhi\\\\u1ec1u n\\\\u1ed9i dung c\\\\u1ea7n \\\\u0111\\\\u01b0\\\\u1ee3c \\\\u0111\\\\u00e1p \\\\u1ee9ng, nhi\\\\u1ec1u b\\\\u00e0i to\\\\u00e1n \\\\u0111\\\\u1eb7t ra. \\\\u0110\\\\u00f3 l\\\\u00e0 v\\\\u1ea5n \\\\u0111\\\\u1ec1 ki\\\\u1ec3m so\\\\u00e1t l\\\\u1ea1m ph\\\\u00e1t nh\\\\u01b0ng v\\\\u1eeba h\\\\u1ed7 tr\\\\u1ee3 vi\\\\u1ec7c t\\\\u0103ng tr\\\\u01b0\\\\u1edfng kinh t\\\\u1ebf c\\\\u0169ng nh\\\\u01b0 \\\\u0111\\\\u1ea3m b\\\\u1ea3o kh\\\\u00f4i ph\\\\u1ee5c nhanh n\\\\u1ec1n kinh t\\\\u1ebf. Hai v\\\\u1ea5n \\\\u0111\\\\u1ec1 n\\\\u00e0y \\\\u0111\\\\u1eb7t ra b\\\\u00e0i to\\\\u00e1n l\\\\u00e3i su\\\\u1ea5t c\\\\u1ee7a ng\\\\u00e2n h\\\\u00e0ng, ti\\\\u1ebfp t\\\\u1ee5c \\\\u0111i\\\\u1ec1u h\\\\u00e0nh h\\\\u1ebft s\\\\u1ee9c linh ho\\\\u1ea1t v\\\\u00e0 \\\\u0111\\\\u1ea3m b\\\\u1ea3o \\\\u0111\\\\u01b0\\\\u1ee3c m\\\\u1ee5c ti\\\\u00eau \\\\u0111\\\\u00f3.<\\\\\\/p><p>T\\\\u1ea1i c\\\\u00e1c ng\\\\u00e2n h\\\\u00e0ng th\\\\u01b0\\\\u01a1ng m\\\\u1ea1i, l\\\\u00e3i su\\\\u1ea5t \\\\u0111\\\\u00e3 c\\\\u00f3 s\\\\u1ef1 bi\\\\u1ebfn \\\\u0111\\\\u1ed9ng t\\\\u0103ng r\\\\u1ea5t nh\\\\u1eb9 trong th\\\\u1eddi gian qua, huy \\\\u0111\\\\u1ed9ng 0,25%, cho vay l\\\\u00e0 0,24%. \\\\u0110\\\\u00e2y c\\\\u00f3 th\\\\u1ec3 l\\\\u00e0 m\\\\u1ee9c th\\\\u1ea5p nh\\\\u1ea5t trong t\\\\u1ea5t c\\\\u1ea3 c\\\\u00e1c n\\\\u01b0\\\\u1edbc khu v\\\\u1ef1c ch\\\\u00e2u \\\\u00c1, Ph\\\\u00f3 th\\\\u1ed1ng \\\\u0111\\\\u1ed1c cho bi\\\\u1ebft.<\\\\\\/p><p>Hi\\\\u1ec7n nay l\\\\u00e3i su\\\\u1ea5t cho vay b\\\\u00ecnh qu\\\\u00e2n 9-9,3%, l\\\\u00e3i su\\\\u1ea5t huy \\\\u0111\\\\u1ed9ng b\\\\u00ecnh qu\\\\u00e2n t\\\\u1eeb 6,3-6,8% \\\\u0111\\\\u1ed1i v\\\\u1edbi k\\\\u00ec h\\\\u1ea1n trung b\\\\u00ecnh. M\\\\u1ee9c l\\\\u00e3i su\\\\u1ea5t cho vay n\\\\u00e0y so v\\\\u1edbi m\\\\u1ea5y n\\\\u0103m g\\\\u1ea7n \\\\u0111\\\\u00e2y c\\\\u00f3 th\\\\u1ec3 n\\\\u00f3i duy tr\\\\u00ec \\\\u1edf m\\\\u1ee9c kh\\\\u00e1 \\\\u1ed5n \\\\u0111\\\\u1ecbnh.<\\\\\\/p><p>Tuy nhi\\\\u00ean, \\\\u0111\\\\u1ec3 ki\\\\u1ec3m so\\\\u00e1t l\\\\u1ea1m ph\\\\u00e1t nh\\\\u01b0ng l\\\\u1ea1i kh\\\\u00f4i ph\\\\u1ee5c nhanh n\\\\u1ec1n kinh t\\\\u1ebf, h\\\\u1ed7 tr\\\\u1ee3 doanh nghi\\\\u1ec7p trong \\\\u0111i\\\\u1ec1u ki\\\\u1ec7n c\\\\u00f2n nhi\\\\u1ec1u kh\\\\u00f3 kh\\\\u0103n, th\\\\u00ec th\\\\u1eddi gian v\\\\u1eeba qua, thay v\\\\u00ec t\\\\u0103ng l\\\\u00e3i su\\\\u1ea5t \\\\u0111i\\\\u1ec1u h\\\\u00e0nh, Ng\\\\u00e2n h\\\\u00e0ng Nh\\\\u00e0 n\\\\u01b0\\\\u1edbc \\\\u0111\\\\u00e3 ti\\\\u1ebfp t\\\\u1ee5c ch\\\\u1ec9 \\\\u0111\\\\u1ea1o c\\\\u00e1c ng\\\\u00e2n h\\\\u00e0ng th\\\\u01b0\\\\u01a1ng m\\\\u1ea1i t\\\\u00ecm c\\\\u00e1c bi\\\\u1ec7n ph\\\\u00e1p b\\\\u1eb1ng n\\\\u1ed9i l\\\\u1ef1c c\\\\u1ee7a m\\\\u00ecnh, ngu\\\\u1ed3n l\\\\u1ef1c c\\\\u1ee7a m\\\\u00ecnh \\\\u0111\\\\u1ec3 h\\\\u1ed7 tr\\\\u1ee3 doanh nghi\\\\u1ec7p.<\\\\\\/p><p>\\\\u201cL\\\\u1ea7n n\\\\u00e0y ch\\\\u00fang t\\\\u00f4i ti\\\\u1ebfp t\\\\u1ee5c k\\\\u00eau g\\\\u1ecdi c\\\\u00e1c ng\\\\u00e2n h\\\\u00e0ng th\\\\u01b0\\\\u01a1ng m\\\\u1ea1i c\\\\u1eaft gi\\\\u1ea3m chi ph\\\\u00ed trong ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng c\\\\u1ee7a m\\\\u00ecnh, th\\\\u1ee9 hai l\\\\u00e0 c\\\\u1eaft gi\\\\u1ea3m m\\\\u1ed9t ph\\\\u1ea7n l\\\\u1ee3i nhu\\\\u1eadn \\\\u0111\\\\u1ec3 ti\\\\u1ebfp t\\\\u1ee5c h\\\\u1ed7 tr\\\\u1ee3 doanh nghi\\\\u1ec7p vay v\\\\u1ed1n trong th\\\\u1eddi gian t\\\\u1edbi\\\\u201d, \\\\u00f4ng T\\\\u00fa cho bi\\\\u1ebft.<\\\\\\/p><p>B\\\\u00ean c\\\\u1ea1nh \\\\u0111\\\\u00f3, tr\\\\u01b0\\\\u1edbc th\\\\u00f4ng tin&nbsp;nhi\\\\u1ec1u ng\\\\u00e2n h\\\\u00e0ng \\\\u0111\\\\u00e3 t\\\\u0103ng tr\\\\u01b0\\\\u1edfng t\\\\u00edn d\\\\u1ee5ng ch\\\\u1ea1m h\\\\u1ea1n m\\\\u1ee9c \\\\u0111\\\\u01b0\\\\u1ee3c c\\\\u1ea5p t\\\\u1eeb \\\\u0111\\\\u1ea7u n\\\\u0103m khi\\\\u1ebfn nhi\\\\u1ec1u ng\\\\u01b0\\\\u1eddi d\\\\u00e2n v\\\\u00e0 doanh nghi\\\\u1ec7p g\\\\u1eb7p kh\\\\u00f3 khi vay v\\\\u1ed1n.<\\\\\\/p><p>Ph\\\\u00f3 th\\\\u1ed1ng \\\\u0111\\\\u1ed1c \\\\u0110\\\\u00e0o Minh T\\\\u00fa cho bi\\\\u1ebft, h\\\\u1ebft th\\\\u00e1ng 8, m\\\\u1ee9c t\\\\u0103ng tr\\\\u01b0\\\\u1edfng t\\\\u00edn d\\\\u1ee5ng \\\\u0111\\\\u1ea1t 9,91%, trong khi \\\\u0111\\\\u00f3 k\\\\u1ebf ho\\\\u1ea1ch m\\\\u1ee5c ti\\\\u00eau c\\\\u1ea3 n\\\\u0103m 2022 \\\\u0111\\\\u01b0\\\\u1ee3c Ng\\\\u00e2n h\\\\u00e0ng Nh\\\\u00e0 n\\\\u01b0\\\\u1edbc \\\\u0111\\\\u01b0a ra t\\\\u1eeb \\\\u0111\\\\u1ea7u n\\\\u0103m l\\\\u00e0 14%. \\\\\\\"\\\\u0110\\\\u00e2y l\\\\u00e0 m\\\\u1ee9c t\\\\u0103ng r\\\\u1ea5t cao so v\\\\u1edbi c\\\\u00f9ng k\\\\u1ef3 n\\\\u0103m ngo\\\\u00e1i. C\\\\u00e1c ng\\\\u00e2n h\\\\u00e0ng c\\\\u01a1 b\\\\u1ea3n \\\\u0111\\\\u00e3 s\\\\u1eed d\\\\u1ee5ng h\\\\u1ebft h\\\\u1ea1n m\\\\u1ee9c giao \\\\u0111\\\\u1ea7u n\\\\u0103m\\\\\\\".<\\\\\\/p><p>Ph\\\\u1ea7n c\\\\u00f2n l\\\\u1ea1i c\\\\u1ee7a t\\\\u0103ng tr\\\\u01b0\\\\u1edfng t\\\\u00edn d\\\\u1ee5ng, Ng\\\\u00e2n h\\\\u00e0ng Nh\\\\u00e0 n\\\\u01b0\\\\u1edbc s\\\\u1ebd ti\\\\u1ebfp t\\\\u1ee5c giao cho c\\\\u00e1c ng\\\\u00e2n h\\\\u00e0ng trong 1-2 ng\\\\u00e0y t\\\\u1edbi v\\\\u00e0 s\\\\u1ebd th\\\\u00f4ng b\\\\u00e1o t\\\\u1edbi t\\\\u1eebng ng\\\\u00e2n h\\\\u00e0ng, theo Ph\\\\u00f3 th\\\\u1ed1ng \\\\u0111\\\\u1ed1c,&nbsp;v\\\\u1edbi quan \\\\u0111i\\\\u1ec3m t\\\\u1ea1o \\\\u0111i\\\\u1ec1u ki\\\\u1ec7n cho c\\\\u00e1c ng\\\\u00e2n h\\\\u00e0ng, \\\\u0111\\\\u1eb7c bi\\\\u1ec7t l\\\\u00e0 c\\\\u00e1c ng\\\\u00e2n h\\\\u00e0ng c\\\\u00f3 ch\\\\u1ec9 s\\\\u1ed1 ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng t\\\\u1ed1t, l\\\\u00e0nh m\\\\u1ea1nh, h\\\\u1ec7 s\\\\u1ed1 an to\\\\u00e0n cao.<\\\\\\/p><p><a href=\\\\\\\"https:\\\\\\/\\\\\\/theleader.vn\\\\\\/ngan-hang-nha-nuoc-ly-giai-chua-tang-lai-suat-dieu-hanh-1662515320914.htm\\\\\\\">Theo Nh\\\\u1eadt H\\\\u1ea1 \\\\\\/ The Leader<\\\\\\/a><\\\\\\/p>\\\"},\\\"brief\\\":{\\\"vi\\\":\\\"L\\\\u1ea1m ph\\\\u00e1t t\\\\u1ea1i Vi\\\\u1ec7t Nam \\\\u0111ang \\\\u0111\\\\u01b0\\\\u1ee3c ki\\\\u1ec3m so\\\\u00e1t t\\\\u1ed1t l\\\\u00e0 m\\\\u1ed9t trong nh\\\\u1eefng c\\\\u01a1 s\\\\u1edf quan tr\\\\u1ecdng \\\\u0111\\\\u1ec3 Ng\\\\u00e2n h\\\\u00e0ng Nh\\\\u00e0 n\\\\u01b0\\\\u1edbc duy tr\\\\u00ec l\\\\u00e3i su\\\\u1ea5t \\\\u0111i\\\\u1ec1u h\\\\u00e0nh, kh\\\\u00f4ng thay \\\\u0111\\\\u1ed5i nh\\\\u1eb1m h\\\\u1ed7 tr\\\\u1ee3 t\\\\u0103ng tr\\\\u01b0\\\\u1edfng kinh t\\\\u1ebf c\\\\u0169ng nh\\\\u01b0 \\\\u0111\\\\u1ea3m b\\\\u1ea3o kh\\\\u00f4i ph\\\\u1ee5c nhanh n\\\\u1ec1n kinh t\\\\u1ebf.\\\"},\\\"seo_title\\\":\\\"\\\",\\\"seo_keyword\\\":\\\"Ng\\\\u00e2n h\\\\u00e0ng nh\\\\u00e0 n\\\\u01b0\\\\u1edbc, t\\\\u0103ng l\\\\u00e3i su\\\\u1ea5t, n\\\\u1edbi room t\\\\u00edn d\\\\u1ee5ng\\\",\\\"seo_description\\\":\\\"\\\",\\\"refer\\\":null}\"', 'https://biz9.vn/upload/advertisement/pqt0125-16624744195021443257578.jpg', NULL, 'active', 'Tuệ Minh', NULL, 'ngan-hang-nha-nuoc-ly-giai-chua-tang-lai-suat-dieu-hanh', 0, 0, 1, 1, 0, 11, 0, '2022-10-03 15:41:00', NULL, ',1,', NULL, '', 'open', NULL, 'Ngân hàng nhà nước, tăng lãi suất, nới room tín dụng', NULL, NULL, 1, 1, '2022-09-29 08:21:29', '2023-02-03 03:28:03');
