(608, 1, 'post', 'KienlongBank hỗ trợ vùng sâu, vùng xa các hoạt động giáo dục và tác vụ ngân hàng, dịch vụ công', 'Với mục tiêu xuyên suốt hướng tới một ngân hàng xanh, chia sẻ giá trị xanh và tiên phong trong các chương trình, hoạt động xanh vì lợi ích cộng đồng tại Việt Nam, KienlongBank luôn đồng hành với chính quyền địa phương triển khai các chương trình an sinh xã hội, hỗ trợ thiết thực công tác số hóa nông thôn và vùng sâu, vùng xa. ', '<p style=\"text-align:justify;\"><span style=\"color:black;\"><strong>KienlongBank tặng học bổng, trang thiết bị giáo dục và xây mới trường học tại Thanh Hoá, Kiên Giang…</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Hòa chung trong không khí tưng bừng chào đón năm học mới của trường, ngày 05/9/2022, Ngân hàng TMCP Kiên Long (KienlongBank) cùng với Ban Lãnh đạo trường PTDTBT THCS Trung Thượng (huyện Quan Sơn, tỉnh Thanh Hoá) tổ chức chương trình “Chắp cánh ước mơ xanh, cùng em tiến bước tới trường”. Là một trường vùng núi thuộc mảnh đất xứ Thanh giàu truyền thống hiếu học, thầy và trò trường Trung Thượng luôn nỗ lực vượt khó và giành được những thành tích xuất sắc trong học tập cũng như công tác giảng dạy.</span></p><figure class=\"image\"><img src=\"/ckfinder/userfiles/files/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn/hotrovungsau.png\"></figure><p style=\"text-align:center;\"><span style=\"color:black;\"><i>Bà Trần Thị Thu Hằng - Chủ tịch HĐQT Ngân hàng Kiên Long đại diện trao tặng Phòng máy tính cho Ban Lãnh đạo trường PTDTBT THCS Trung SThượng</i></span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Thấu hiểu những khó khăn trong công tác giảng dạy và học tập tại các tỉnh miền núi, vùng sâu, vùng xa, đồng thời trợ giúp các em học sinh và thầy cô trong hoạt động tiếp cận những nguồn tri thức mới, Ban Lãnh đạo Ngân hàng Kiên Long đã dành tặng những suất học bổng, phòng máy tính và các trang thiết bị phục vụ việc học tập của các em học sinh và nâng cao chất lượng giảng dạy của các thầy cô giáo trong nhà trường.</span></p><figure class=\"image\"><img src=\"/ckfinder/userfiles/files/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn/hotrovungsau1.png\"></figure><p style=\"text-align:center;\"><span style=\"color:black;\"><i>Những suất học bổng được Ngân hàng Kiên Long trao tặng đến những em học sinh nghèo có thành tích vượt khó trong học tập</i></span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Phát biểu với trường tại buổi lễ trao tặng, bà Trần Thị Thu Hằng - Chủ tịch HĐQT Ngân hàng Kiên Long nhấn mạnh: “<i>KienlongBank gửi gắm trong mỗi phần quà là những niềm tin vững chắc với các em học sinh, mong muốn các em sẽ bay cao, bay xa, xứng đáng là người con của quê hương xứ Thanh “địa linh nhân kiệt”</i>.</span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Với mong muốn đóng góp để nâng cao chất lượng đào tạo tại các tỉnh vùng sâu vùng xa, những địa điểm khó khăn trên cả nước, KienlongBank đã và đang lên kế hoạch xây dựng và trao tặng các điểm trường học đạt chuẩn thông qua việc xây dựng và đầu tư hệ thống trang thiết bị hiện đại phục vụ cho việc dạy và học tại các nhà trường. Theo kế hoạch, KienlongBank và đối tác chiến lược SCG sẽ khởi công vào tháng 9/2022 việc xây dựng công trình tại trường Phổ thông Dân tộc nội trú tỉnh Kiên Giang, với tổng kinh phí tài trợ lên đến 1.000.000.000 đồng.</span></p><figure class=\"image\"><img src=\"/ckfinder/userfiles/files/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn/hotrovungsau2.png\"></figure><p style=\"text-align:center;\"><span style=\"color:black;\"><i>Đại diện KienlongBank và SCG trao tặng công trình kỷ niệm 30 năm thành lập trường PTDTNT tỉnh Kiên Giang</i></span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Khi công trình thư viện hoàn thành sẽ đáp ứng nhu cầu về cơ sở vật chất, trang thiết bị đảm bảo điều kiện phục vụ cho việc dạy và học của thầy trò trường PT DTNT tỉnh Kiên Giang. Chia sẻ về ý nghĩa của các hoạt động này, đại diện Ngân hàng Kiên Long cho biết “<i>Song song với việc phát triển kinh doanh, Kiên Long luôn quan tâm tới việc thực hiện các hoạt động trách nhiệm xã hội (CSR). Thông qua mỗi hoạt động, Kiên Long mong muốn góp phần mang đến một môi trường học đường an toàn, lành mạnh và cùng chung tay xóa sạch những điểm trường khó khăn đang còn tồn tại trên Việt Nam</i>.”&nbsp;</span></p><p style=\"text-align:justify;\"><span style=\"color:black;\"><strong>Triển khai chương trình hỗ trợ 1000 “ngân hàng thông minh” (STM), KienlongBank đồng hành cùng Chính phủ xây dựng “nông thôn số\" cho vùng sâu, vùng xa</strong></span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Không chỉ dừng lại ở các hoạt động khuyến học, trong suốt hành trình 27 năm hình thành và phát triển, KienlongBank luôn tổ chức các hoạt động hướng hướng tới lợi ích toàn dân và cộng đồng. Hàng loạt chương trình như trao tặng quà Tết cho các bà con có hoàn cảnh khó khăn; trao tặng nhà tình nghĩa cho các cựu chiến binh tỉnh Rạch Giá; trao tặng các căn nhà tình nghĩa tại tỉnh Long An hay chung sức vào các hoạt động bảo vệ chủ quyền biển đảo… được tổ chức hàng năm đã mang đến hình ảnh về một Ngân hàng Tâm - Tín - Kiên - Xanh và gần gũi hơn với cuộc sống của người dân Việt.</span></p><figure class=\"image\"><img src=\"/ckfinder/userfiles/files/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn/hotrovungsau3.png\"></figure><p style=\"text-align:center;\"><span style=\"color:black;\"><i>Hoạt động trao tặng quà Tết 2022 cho bà con tỉnh Bình Dương</i></span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Với mong muốn đồng hành cũng Chính phủ trong công tác xây dựng nông thôn mới, bằng việc tiết giảm tối đa những thủ tục rườm rà, rút ngắn thời hạn thẩm định giải ngân vốn, KienlongBank đã và đang đẩy mạnh các hoạt động cấp tín dụng cho các cá nhân, hộ kinh doanh và doanh nghiệp đủ điều kiện tại các tỉnh thành trên cả nước. Bằng việc đa dạng các gói hỗ trợ ưu đãi lãi suất dành cho các đối tượng khác nhau, KienlongBank cam kết trong việc đồng hành cùng doanh nghiệp và người dân trong việc phát triển kinh tế, phục hồi sản xuất sau đại dịch.</span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Mặt khác, để xóa nhòa khoảng cách giữa thành thị và nông thôn, giúp người dân vùng sâu, vùng xa có thể tiếp cận công nghệ mới, phát triển đồng đều ba trụ cột Kinh tế số - Chính phủ số - Xã hội số theo định hướng chung của Chính phủ, trong chiến lược số hóa chung toàn hàng công tác xây dựng “nông thôn số” được xem như là giải pháp và nhiệm vụ trọng tâm mà KienlongBank đang hướng đến.&nbsp;</span></p><figure class=\"image\"><img src=\"/ckfinder/userfiles/files/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn/hotrovungsau5.png\"></figure><p style=\"text-align:justify;\"><span style=\"color:black;\">Theo đó, KienlongBank đã hợp tác cùng Tập đoàn Công nghệ Unicloud (Unicloud) xây dựng kế hoạch nhằm gia tăng nhận thức về các sản phẩm, dịch vụ tài chính cho dân cư tại những nơi bị hạn chế về khả năng tiếp cận các sản phẩm và dịch vụ tài chính thông thường. Trong chiến lược dài hạn, hai bên đặt mục tiêu triển khai 1.000 hệ thống máy giao dịch ngân hàng tự động (STM), khơi thông dòng chảy trong việc tiếp cận các dịch vụ công, thuận tiện trong việc tiếp cận tài chính số của người dân vùng nông thôn.</span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Được xây dựng dựa trên kết quả nghiên cứu từ những thói quen cũng như hành vi của phần lớn người dân tại các vùng nông thôn, mỗi máy STM sẽ được trang bị đầy đủ các chức năng nghiệp vụ của một phòng giao dịch ngân hàng truyền thống. Thay vì phải nhân rộng mô hình các phòng giao dịch như hiện nay, với STM, người dân có thể thực hiện mở tài khoản thông qua công nghệ eKYC (xác thực danh tính bằng CCCD gắn chíp hoặc tĩnh mạch đạt độ chính xác cao nhất tại Việt Nam hiện nay); mở thẻ bằng mã QR; ký hợp đồng; tư vấn; thanh toán; nộp lệ phí dịch vụ hành chính công…&nbsp;</span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Đồng thời, máy STM còn được tích hợp thêm tính năng video call, máy in và scan nhằm hỗ trợ đắc lực cho người dân thực hiện 24/7 các giao dịch đòi hỏi phải có chữ ký tươi mà không cần phải gặp mặt trực tiếp giao dịch viên. Không cần giao dịch viên hay đội ngũ hỗ trợ trực tiếp, STM trao quyền cho người dân để tự phục vụ các nhu cầu giao dịch của mình mà vẫn dễ sử dụng, phù hợp với khu vực nông thôn và miền núi.</span></p><figure class=\"image\"><img src=\"/ckfinder/userfiles/files/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn/hotrovungsau4.png\"></figure><p style=\"text-align:center;\"><span style=\"color:black;\"><i>1.000 máy STM được KienlongBank dự kiến triển khai tại các tỉnh vùng sâu, vùng xa trong thời gian tới</i></span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Nếu được khai thác tối đa các tính năng, thì STM hoàn toàn có thể hỗ trợ đắc lực cho công tác số hoá dịch vụ công, góp phần không nhỏ trong việc rút ngắn được quy trình, tiết kiệm được thời gian khi thay vì phải đến tận trung tâm hành chính công (bộ phận \"một cửa\" của xã) trong giờ làm việc hành chính, thì người dân có thể thực hiện được một số thủ tục dịch vụ công thông qua STM đặt tại các địa bàn gần hơn vào bất cứ lúc nào.&nbsp;</span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Đặt trong bài toán tổng thể (chi phí lắp đặt một máy STM tiết kiệm hơn nhiều chỉ riêng chi phí mở một phòng giao dịch), trong điều kiện có sự cùng tham gia của ngân hàng và các cấp chính quyền tại địa phương, thì người dân chính là đối tượng được hưởng lợi lớn nhất trong việc được hỗ trợ tiếp cận các dịch vụ tài chính, ngân hàng đa tiện ích cũng như các dịch vụ công.</span></p><figure class=\"image\"><img src=\"/ckfinder/userfiles/files/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn/hotrovungsau6.png\"></figure><p style=\"text-align:center;\"><span style=\"color:black;\"><i>Máy giao dịch STM đảm nhiệm vai trò tương đương với một quầy giao dịch truyền thống</i></span></p><p style=\"text-align:justify;\"><span style=\"color:black;\">Cho đến nay, STM là máy giao dịch ngân hàng tự động duy nhất được sản xuất hoàn toàn trong nước, từ thiết bị phần cứng đến phần mềm đều vượt qua chứng thực bảo mật thẻ của Mỹ (EMV Level 2), chứng chỉ VCCS của NAPAS... đảm bảo an toàn trong vận hành, đủ sức cạnh tranh về giá thành và tính năng trên thị trường. Tự chủ phần mềm và khả năng tùy biến phần cứng, hệ thống máy STM trở thành một máy giao dịch ngân hàng đa tiện ích đi sâu vào thực tiễn và đem lại nhiều giá trị cho cộng đồng, giúp định hình thói quen và hành vi của người dùng trong thời đại số hóa.&nbsp;</span></p><figure class=\"image\"><img src=\"/ckfinder/userfiles/files/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn/hotrovungsau7.png\"></figure><p style=\"text-align:justify;\"><span style=\"color:black;\">Không chỉ hoạt động trong vai trò một ngân hàng số tiên phong trong việc ứng dụng và triển khai những công nghệ mới để tối đa hoá lợi ích và đáp ứng nhu cầu của nhiều bộ phần khách hàng, KienlongBank đã và đang phát triển, hoàn thiện để trở thành một ngân hàng số toàn dân, gắn liền lợi ích của người dân đối với hoạt động của Ngân hàng, đưa Ngân hàng trở thành cầu nối mang những sản phẩm dịch vụ tài chính đến với mọi nhà.&nbsp;</span></p>', '\"{\\\"content\\\":{\\\"vi\\\":\\\"<p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\"><strong>KienlongBank t\\\\u1eb7ng h\\\\u1ecdc b\\\\u1ed5ng, trang thi\\\\u1ebft b\\\\u1ecb gi\\\\u00e1o d\\\\u1ee5c v\\\\u00e0 x\\\\u00e2y m\\\\u1edbi tr\\\\u01b0\\\\u1eddng h\\\\u1ecdc t\\\\u1ea1i Thanh Ho\\\\u00e1, Ki\\\\u00ean Giang\\\\u2026<\\\\\\/strong><\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">H\\\\u00f2a chung trong kh\\\\u00f4ng kh\\\\u00ed t\\\\u01b0ng b\\\\u1eebng ch\\\\u00e0o \\\\u0111\\\\u00f3n n\\\\u0103m h\\\\u1ecdc m\\\\u1edbi c\\\\u1ee7a tr\\\\u01b0\\\\u1eddng, ng\\\\u00e0y 05\\\\\\/9\\\\\\/2022, Ng\\\\u00e2n h\\\\u00e0ng TMCP Ki\\\\u00ean Long (KienlongBank) c\\\\u00f9ng v\\\\u1edbi Ban L\\\\u00e3nh \\\\u0111\\\\u1ea1o tr\\\\u01b0\\\\u1eddng PTDTBT THCS Trung Th\\\\u01b0\\\\u1ee3ng (huy\\\\u1ec7n Quan S\\\\u01a1n, t\\\\u1ec9nh Thanh Ho\\\\u00e1) t\\\\u1ed5 ch\\\\u1ee9c ch\\\\u01b0\\\\u01a1ng tr\\\\u00ecnh \\\\u201cCh\\\\u1eafp c\\\\u00e1nh \\\\u01b0\\\\u1edbc m\\\\u01a1 xanh, c\\\\u00f9ng em ti\\\\u1ebfn b\\\\u01b0\\\\u1edbc t\\\\u1edbi tr\\\\u01b0\\\\u1eddng\\\\u201d. L\\\\u00e0 m\\\\u1ed9t tr\\\\u01b0\\\\u1eddng v\\\\u00f9ng n\\\\u00fai thu\\\\u1ed9c m\\\\u1ea3nh \\\\u0111\\\\u1ea5t x\\\\u1ee9 Thanh gi\\\\u00e0u truy\\\\u1ec1n th\\\\u1ed1ng hi\\\\u1ebfu h\\\\u1ecdc, th\\\\u1ea7y v\\\\u00e0 tr\\\\u00f2 tr\\\\u01b0\\\\u1eddng Trung Th\\\\u01b0\\\\u1ee3ng lu\\\\u00f4n n\\\\u1ed7 l\\\\u1ef1c v\\\\u01b0\\\\u1ee3t kh\\\\u00f3 v\\\\u00e0 gi\\\\u00e0nh \\\\u0111\\\\u01b0\\\\u1ee3c nh\\\\u1eefng th\\\\u00e0nh t\\\\u00edch xu\\\\u1ea5t s\\\\u1eafc trong h\\\\u1ecdc t\\\\u1eadp c\\\\u0169ng nh\\\\u01b0 c\\\\u00f4ng t\\\\u00e1c gi\\\\u1ea3ng d\\\\u1ea1y.<\\\\\\/span><\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"\\\\\\/ckfinder\\\\\\/userfiles\\\\\\/files\\\\\\/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn\\\\\\/hotrovungsau.png\\\\\\\"><\\\\\\/figure><p style=\\\\\\\"text-align:center;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\"><i>B\\\\u00e0 Tr\\\\u1ea7n Th\\\\u1ecb Thu H\\\\u1eb1ng - Ch\\\\u1ee7 t\\\\u1ecbch H\\\\u0110QT Ng\\\\u00e2n h\\\\u00e0ng Ki\\\\u00ean Long \\\\u0111\\\\u1ea1i di\\\\u1ec7n trao t\\\\u1eb7ng Ph\\\\u00f2ng m\\\\u00e1y t\\\\u00ednh cho Ban L\\\\u00e3nh \\\\u0111\\\\u1ea1o tr\\\\u01b0\\\\u1eddng PTDTBT THCS Trung STh\\\\u01b0\\\\u1ee3ng<\\\\\\/i><\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">Th\\\\u1ea5u hi\\\\u1ec3u nh\\\\u1eefng kh\\\\u00f3 kh\\\\u0103n trong c\\\\u00f4ng t\\\\u00e1c gi\\\\u1ea3ng d\\\\u1ea1y v\\\\u00e0 h\\\\u1ecdc t\\\\u1eadp t\\\\u1ea1i c\\\\u00e1c t\\\\u1ec9nh mi\\\\u1ec1n n\\\\u00fai, v\\\\u00f9ng s\\\\u00e2u, v\\\\u00f9ng xa, \\\\u0111\\\\u1ed3ng th\\\\u1eddi tr\\\\u1ee3 gi\\\\u00fap c\\\\u00e1c em h\\\\u1ecdc sinh v\\\\u00e0 th\\\\u1ea7y c\\\\u00f4 trong ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng ti\\\\u1ebfp c\\\\u1eadn nh\\\\u1eefng ngu\\\\u1ed3n tri th\\\\u1ee9c m\\\\u1edbi, Ban L\\\\u00e3nh \\\\u0111\\\\u1ea1o Ng\\\\u00e2n h\\\\u00e0ng Ki\\\\u00ean Long \\\\u0111\\\\u00e3 d\\\\u00e0nh t\\\\u1eb7ng nh\\\\u1eefng su\\\\u1ea5t h\\\\u1ecdc b\\\\u1ed5ng, ph\\\\u00f2ng m\\\\u00e1y t\\\\u00ednh v\\\\u00e0 c\\\\u00e1c trang thi\\\\u1ebft b\\\\u1ecb ph\\\\u1ee5c v\\\\u1ee5 vi\\\\u1ec7c h\\\\u1ecdc t\\\\u1eadp c\\\\u1ee7a c\\\\u00e1c em h\\\\u1ecdc sinh v\\\\u00e0 n\\\\u00e2ng cao ch\\\\u1ea5t l\\\\u01b0\\\\u1ee3ng gi\\\\u1ea3ng d\\\\u1ea1y c\\\\u1ee7a c\\\\u00e1c th\\\\u1ea7y c\\\\u00f4 gi\\\\u00e1o trong nh\\\\u00e0 tr\\\\u01b0\\\\u1eddng.<\\\\\\/span><\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"\\\\\\/ckfinder\\\\\\/userfiles\\\\\\/files\\\\\\/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn\\\\\\/hotrovungsau1.png\\\\\\\"><\\\\\\/figure><p style=\\\\\\\"text-align:center;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\"><i>Nh\\\\u1eefng su\\\\u1ea5t h\\\\u1ecdc b\\\\u1ed5ng \\\\u0111\\\\u01b0\\\\u1ee3c Ng\\\\u00e2n h\\\\u00e0ng Ki\\\\u00ean Long trao t\\\\u1eb7ng \\\\u0111\\\\u1ebfn nh\\\\u1eefng em h\\\\u1ecdc sinh ngh\\\\u00e8o c\\\\u00f3 th\\\\u00e0nh t\\\\u00edch v\\\\u01b0\\\\u1ee3t kh\\\\u00f3 trong h\\\\u1ecdc t\\\\u1eadp<\\\\\\/i><\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">Ph\\\\u00e1t bi\\\\u1ec3u v\\\\u1edbi tr\\\\u01b0\\\\u1eddng t\\\\u1ea1i bu\\\\u1ed5i l\\\\u1ec5 trao t\\\\u1eb7ng, b\\\\u00e0 Tr\\\\u1ea7n Th\\\\u1ecb Thu H\\\\u1eb1ng - Ch\\\\u1ee7 t\\\\u1ecbch H\\\\u0110QT Ng\\\\u00e2n h\\\\u00e0ng Ki\\\\u00ean Long nh\\\\u1ea5n m\\\\u1ea1nh: \\\\u201c<i>KienlongBank g\\\\u1eedi g\\\\u1eafm trong m\\\\u1ed7i ph\\\\u1ea7n qu\\\\u00e0 l\\\\u00e0 nh\\\\u1eefng ni\\\\u1ec1m tin v\\\\u1eefng ch\\\\u1eafc v\\\\u1edbi c\\\\u00e1c em h\\\\u1ecdc sinh, mong mu\\\\u1ed1n c\\\\u00e1c em s\\\\u1ebd bay cao, bay xa, x\\\\u1ee9ng \\\\u0111\\\\u00e1ng l\\\\u00e0 ng\\\\u01b0\\\\u1eddi con c\\\\u1ee7a qu\\\\u00ea h\\\\u01b0\\\\u01a1ng x\\\\u1ee9 Thanh \\\\u201c\\\\u0111\\\\u1ecba linh nh\\\\u00e2n ki\\\\u1ec7t\\\\u201d<\\\\\\/i>.<\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">V\\\\u1edbi mong mu\\\\u1ed1n \\\\u0111\\\\u00f3ng g\\\\u00f3p \\\\u0111\\\\u1ec3 n\\\\u00e2ng cao ch\\\\u1ea5t l\\\\u01b0\\\\u1ee3ng \\\\u0111\\\\u00e0o t\\\\u1ea1o t\\\\u1ea1i c\\\\u00e1c t\\\\u1ec9nh v\\\\u00f9ng s\\\\u00e2u v\\\\u00f9ng xa, nh\\\\u1eefng \\\\u0111\\\\u1ecba \\\\u0111i\\\\u1ec3m kh\\\\u00f3 kh\\\\u0103n tr\\\\u00ean c\\\\u1ea3 n\\\\u01b0\\\\u1edbc, KienlongBank \\\\u0111\\\\u00e3 v\\\\u00e0 \\\\u0111ang l\\\\u00ean k\\\\u1ebf ho\\\\u1ea1ch x\\\\u00e2y d\\\\u1ef1ng v\\\\u00e0 trao t\\\\u1eb7ng c\\\\u00e1c \\\\u0111i\\\\u1ec3m tr\\\\u01b0\\\\u1eddng h\\\\u1ecdc \\\\u0111\\\\u1ea1t chu\\\\u1ea9n th\\\\u00f4ng qua vi\\\\u1ec7c x\\\\u00e2y d\\\\u1ef1ng v\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 h\\\\u1ec7 th\\\\u1ed1ng trang thi\\\\u1ebft b\\\\u1ecb hi\\\\u1ec7n \\\\u0111\\\\u1ea1i ph\\\\u1ee5c v\\\\u1ee5 cho vi\\\\u1ec7c d\\\\u1ea1y v\\\\u00e0 h\\\\u1ecdc t\\\\u1ea1i c\\\\u00e1c nh\\\\u00e0 tr\\\\u01b0\\\\u1eddng. Theo k\\\\u1ebf ho\\\\u1ea1ch, KienlongBank v\\\\u00e0 \\\\u0111\\\\u1ed1i t\\\\u00e1c chi\\\\u1ebfn l\\\\u01b0\\\\u1ee3c SCG s\\\\u1ebd kh\\\\u1edfi c\\\\u00f4ng v\\\\u00e0o th\\\\u00e1ng 9\\\\\\/2022 vi\\\\u1ec7c x\\\\u00e2y d\\\\u1ef1ng c\\\\u00f4ng tr\\\\u00ecnh t\\\\u1ea1i tr\\\\u01b0\\\\u1eddng Ph\\\\u1ed5 th\\\\u00f4ng D\\\\u00e2n t\\\\u1ed9c n\\\\u1ed9i tr\\\\u00fa t\\\\u1ec9nh Ki\\\\u00ean Giang, v\\\\u1edbi t\\\\u1ed5ng kinh ph\\\\u00ed t\\\\u00e0i tr\\\\u1ee3 l\\\\u00ean \\\\u0111\\\\u1ebfn 1.000.000.000 \\\\u0111\\\\u1ed3ng.<\\\\\\/span><\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"\\\\\\/ckfinder\\\\\\/userfiles\\\\\\/files\\\\\\/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn\\\\\\/hotrovungsau2.png\\\\\\\"><\\\\\\/figure><p style=\\\\\\\"text-align:center;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\"><i>\\\\u0110\\\\u1ea1i di\\\\u1ec7n KienlongBank v\\\\u00e0 SCG trao t\\\\u1eb7ng c\\\\u00f4ng tr\\\\u00ecnh k\\\\u1ef7 ni\\\\u1ec7m 30 n\\\\u0103m th\\\\u00e0nh l\\\\u1eadp tr\\\\u01b0\\\\u1eddng PTDTNT t\\\\u1ec9nh Ki\\\\u00ean Giang<\\\\\\/i><\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">Khi c\\\\u00f4ng tr\\\\u00ecnh th\\\\u01b0 vi\\\\u1ec7n ho\\\\u00e0n th\\\\u00e0nh s\\\\u1ebd \\\\u0111\\\\u00e1p \\\\u1ee9ng nhu c\\\\u1ea7u v\\\\u1ec1 c\\\\u01a1 s\\\\u1edf v\\\\u1eadt ch\\\\u1ea5t, trang thi\\\\u1ebft b\\\\u1ecb \\\\u0111\\\\u1ea3m b\\\\u1ea3o \\\\u0111i\\\\u1ec1u ki\\\\u1ec7n ph\\\\u1ee5c v\\\\u1ee5 cho vi\\\\u1ec7c d\\\\u1ea1y v\\\\u00e0 h\\\\u1ecdc c\\\\u1ee7a th\\\\u1ea7y tr\\\\u00f2 tr\\\\u01b0\\\\u1eddng PT DTNT t\\\\u1ec9nh Ki\\\\u00ean Giang. Chia s\\\\u1ebb v\\\\u1ec1 \\\\u00fd ngh\\\\u0129a c\\\\u1ee7a c\\\\u00e1c ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng n\\\\u00e0y, \\\\u0111\\\\u1ea1i di\\\\u1ec7n Ng\\\\u00e2n h\\\\u00e0ng Ki\\\\u00ean Long cho bi\\\\u1ebft \\\\u201c<i>Song song v\\\\u1edbi vi\\\\u1ec7c ph\\\\u00e1t tri\\\\u1ec3n kinh doanh, Ki\\\\u00ean Long lu\\\\u00f4n quan t\\\\u00e2m t\\\\u1edbi vi\\\\u1ec7c th\\\\u1ef1c hi\\\\u1ec7n c\\\\u00e1c ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng tr\\\\u00e1ch nhi\\\\u1ec7m x\\\\u00e3 h\\\\u1ed9i (CSR). Th\\\\u00f4ng qua m\\\\u1ed7i ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng, Ki\\\\u00ean Long mong mu\\\\u1ed1n g\\\\u00f3p ph\\\\u1ea7n mang \\\\u0111\\\\u1ebfn m\\\\u1ed9t m\\\\u00f4i tr\\\\u01b0\\\\u1eddng h\\\\u1ecdc \\\\u0111\\\\u01b0\\\\u1eddng an to\\\\u00e0n, l\\\\u00e0nh m\\\\u1ea1nh v\\\\u00e0 c\\\\u00f9ng chung tay x\\\\u00f3a s\\\\u1ea1ch nh\\\\u1eefng \\\\u0111i\\\\u1ec3m tr\\\\u01b0\\\\u1eddng kh\\\\u00f3 kh\\\\u0103n \\\\u0111ang c\\\\u00f2n t\\\\u1ed3n t\\\\u1ea1i tr\\\\u00ean Vi\\\\u1ec7t Nam<\\\\\\/i>.\\\\u201d&nbsp;<\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\"><strong>Tri\\\\u1ec3n khai ch\\\\u01b0\\\\u01a1ng tr\\\\u00ecnh h\\\\u1ed7 tr\\\\u1ee3 1000 \\\\u201cng\\\\u00e2n h\\\\u00e0ng th\\\\u00f4ng minh\\\\u201d (STM), KienlongBank \\\\u0111\\\\u1ed3ng h\\\\u00e0nh c\\\\u00f9ng Ch\\\\u00ednh ph\\\\u1ee7 x\\\\u00e2y d\\\\u1ef1ng \\\\u201cn\\\\u00f4ng th\\\\u00f4n s\\\\u1ed1\\\\\\\" cho v\\\\u00f9ng s\\\\u00e2u, v\\\\u00f9ng xa<\\\\\\/strong><\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">Kh\\\\u00f4ng ch\\\\u1ec9 d\\\\u1eebng l\\\\u1ea1i \\\\u1edf c\\\\u00e1c ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng khuy\\\\u1ebfn h\\\\u1ecdc, trong su\\\\u1ed1t h\\\\u00e0nh tr\\\\u00ecnh 27 n\\\\u0103m h\\\\u00ecnh th\\\\u00e0nh v\\\\u00e0 ph\\\\u00e1t tri\\\\u1ec3n, KienlongBank lu\\\\u00f4n t\\\\u1ed5 ch\\\\u1ee9c c\\\\u00e1c ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng h\\\\u01b0\\\\u1edbng h\\\\u01b0\\\\u1edbng t\\\\u1edbi l\\\\u1ee3i \\\\u00edch to\\\\u00e0n d\\\\u00e2n v\\\\u00e0 c\\\\u1ed9ng \\\\u0111\\\\u1ed3ng. H\\\\u00e0ng lo\\\\u1ea1t ch\\\\u01b0\\\\u01a1ng tr\\\\u00ecnh nh\\\\u01b0 trao t\\\\u1eb7ng qu\\\\u00e0 T\\\\u1ebft cho c\\\\u00e1c b\\\\u00e0 con c\\\\u00f3 ho\\\\u00e0n c\\\\u1ea3nh kh\\\\u00f3 kh\\\\u0103n; trao t\\\\u1eb7ng nh\\\\u00e0 t\\\\u00ecnh ngh\\\\u0129a cho c\\\\u00e1c c\\\\u1ef1u chi\\\\u1ebfn binh t\\\\u1ec9nh R\\\\u1ea1ch Gi\\\\u00e1; trao t\\\\u1eb7ng c\\\\u00e1c c\\\\u0103n nh\\\\u00e0 t\\\\u00ecnh ngh\\\\u0129a t\\\\u1ea1i t\\\\u1ec9nh Long An hay chung s\\\\u1ee9c v\\\\u00e0o c\\\\u00e1c ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng b\\\\u1ea3o v\\\\u1ec7 ch\\\\u1ee7 quy\\\\u1ec1n bi\\\\u1ec3n \\\\u0111\\\\u1ea3o\\\\u2026 \\\\u0111\\\\u01b0\\\\u1ee3c t\\\\u1ed5 ch\\\\u1ee9c h\\\\u00e0ng n\\\\u0103m \\\\u0111\\\\u00e3 mang \\\\u0111\\\\u1ebfn h\\\\u00ecnh \\\\u1ea3nh v\\\\u1ec1 m\\\\u1ed9t Ng\\\\u00e2n h\\\\u00e0ng T\\\\u00e2m - T\\\\u00edn - Ki\\\\u00ean - Xanh v\\\\u00e0 g\\\\u1ea7n g\\\\u0169i h\\\\u01a1n v\\\\u1edbi cu\\\\u1ed9c s\\\\u1ed1ng c\\\\u1ee7a ng\\\\u01b0\\\\u1eddi d\\\\u00e2n Vi\\\\u1ec7t.<\\\\\\/span><\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"\\\\\\/ckfinder\\\\\\/userfiles\\\\\\/files\\\\\\/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn\\\\\\/hotrovungsau3.png\\\\\\\"><\\\\\\/figure><p style=\\\\\\\"text-align:center;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\"><i>Ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng trao t\\\\u1eb7ng qu\\\\u00e0 T\\\\u1ebft 2022 cho b\\\\u00e0 con t\\\\u1ec9nh B\\\\u00ecnh D\\\\u01b0\\\\u01a1ng<\\\\\\/i><\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">V\\\\u1edbi mong mu\\\\u1ed1n \\\\u0111\\\\u1ed3ng h\\\\u00e0nh c\\\\u0169ng Ch\\\\u00ednh ph\\\\u1ee7 trong c\\\\u00f4ng t\\\\u00e1c x\\\\u00e2y d\\\\u1ef1ng n\\\\u00f4ng th\\\\u00f4n m\\\\u1edbi, b\\\\u1eb1ng vi\\\\u1ec7c ti\\\\u1ebft gi\\\\u1ea3m t\\\\u1ed1i \\\\u0111a nh\\\\u1eefng th\\\\u1ee7 t\\\\u1ee5c r\\\\u01b0\\\\u1eddm r\\\\u00e0, r\\\\u00fat ng\\\\u1eafn th\\\\u1eddi h\\\\u1ea1n th\\\\u1ea9m \\\\u0111\\\\u1ecbnh gi\\\\u1ea3i ng\\\\u00e2n v\\\\u1ed1n, KienlongBank \\\\u0111\\\\u00e3 v\\\\u00e0 \\\\u0111ang \\\\u0111\\\\u1ea9y m\\\\u1ea1nh c\\\\u00e1c ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng c\\\\u1ea5p t\\\\u00edn d\\\\u1ee5ng cho c\\\\u00e1c c\\\\u00e1 nh\\\\u00e2n, h\\\\u1ed9 kinh doanh v\\\\u00e0 doanh nghi\\\\u1ec7p \\\\u0111\\\\u1ee7 \\\\u0111i\\\\u1ec1u ki\\\\u1ec7n t\\\\u1ea1i c\\\\u00e1c t\\\\u1ec9nh th\\\\u00e0nh tr\\\\u00ean c\\\\u1ea3 n\\\\u01b0\\\\u1edbc. B\\\\u1eb1ng vi\\\\u1ec7c \\\\u0111a d\\\\u1ea1ng c\\\\u00e1c g\\\\u00f3i h\\\\u1ed7 tr\\\\u1ee3 \\\\u01b0u \\\\u0111\\\\u00e3i l\\\\u00e3i su\\\\u1ea5t d\\\\u00e0nh cho c\\\\u00e1c \\\\u0111\\\\u1ed1i t\\\\u01b0\\\\u1ee3ng kh\\\\u00e1c nhau, KienlongBank cam k\\\\u1ebft trong vi\\\\u1ec7c \\\\u0111\\\\u1ed3ng h\\\\u00e0nh c\\\\u00f9ng doanh nghi\\\\u1ec7p v\\\\u00e0 ng\\\\u01b0\\\\u1eddi d\\\\u00e2n trong vi\\\\u1ec7c ph\\\\u00e1t tri\\\\u1ec3n kinh t\\\\u1ebf, ph\\\\u1ee5c h\\\\u1ed3i s\\\\u1ea3n xu\\\\u1ea5t sau \\\\u0111\\\\u1ea1i d\\\\u1ecbch.<\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">M\\\\u1eb7t kh\\\\u00e1c, \\\\u0111\\\\u1ec3 x\\\\u00f3a nh\\\\u00f2a kho\\\\u1ea3ng c\\\\u00e1ch gi\\\\u1eefa th\\\\u00e0nh th\\\\u1ecb v\\\\u00e0 n\\\\u00f4ng th\\\\u00f4n, gi\\\\u00fap ng\\\\u01b0\\\\u1eddi d\\\\u00e2n v\\\\u00f9ng s\\\\u00e2u, v\\\\u00f9ng xa c\\\\u00f3 th\\\\u1ec3 ti\\\\u1ebfp c\\\\u1eadn c\\\\u00f4ng ngh\\\\u1ec7 m\\\\u1edbi, ph\\\\u00e1t tri\\\\u1ec3n \\\\u0111\\\\u1ed3ng \\\\u0111\\\\u1ec1u ba tr\\\\u1ee5 c\\\\u1ed9t Kinh t\\\\u1ebf s\\\\u1ed1 - Ch\\\\u00ednh ph\\\\u1ee7 s\\\\u1ed1 - X\\\\u00e3 h\\\\u1ed9i s\\\\u1ed1 theo \\\\u0111\\\\u1ecbnh h\\\\u01b0\\\\u1edbng chung c\\\\u1ee7a Ch\\\\u00ednh ph\\\\u1ee7, trong chi\\\\u1ebfn l\\\\u01b0\\\\u1ee3c s\\\\u1ed1 h\\\\u00f3a chung to\\\\u00e0n h\\\\u00e0ng c\\\\u00f4ng t\\\\u00e1c x\\\\u00e2y d\\\\u1ef1ng \\\\u201cn\\\\u00f4ng th\\\\u00f4n s\\\\u1ed1\\\\u201d \\\\u0111\\\\u01b0\\\\u1ee3c xem nh\\\\u01b0 l\\\\u00e0 gi\\\\u1ea3i ph\\\\u00e1p v\\\\u00e0 nhi\\\\u1ec7m v\\\\u1ee5 tr\\\\u1ecdng t\\\\u00e2m m\\\\u00e0 KienlongBank \\\\u0111ang h\\\\u01b0\\\\u1edbng \\\\u0111\\\\u1ebfn.&nbsp;<\\\\\\/span><\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"\\\\\\/ckfinder\\\\\\/userfiles\\\\\\/files\\\\\\/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn\\\\\\/hotrovungsau5.png\\\\\\\"><\\\\\\/figure><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">Theo \\\\u0111\\\\u00f3, KienlongBank \\\\u0111\\\\u00e3 h\\\\u1ee3p t\\\\u00e1c c\\\\u00f9ng T\\\\u1eadp \\\\u0111o\\\\u00e0n C\\\\u00f4ng ngh\\\\u1ec7 Unicloud (Unicloud) x\\\\u00e2y d\\\\u1ef1ng k\\\\u1ebf ho\\\\u1ea1ch nh\\\\u1eb1m gia t\\\\u0103ng nh\\\\u1eadn th\\\\u1ee9c v\\\\u1ec1 c\\\\u00e1c s\\\\u1ea3n ph\\\\u1ea9m, d\\\\u1ecbch v\\\\u1ee5 t\\\\u00e0i ch\\\\u00ednh cho d\\\\u00e2n c\\\\u01b0 t\\\\u1ea1i nh\\\\u1eefng n\\\\u01a1i b\\\\u1ecb h\\\\u1ea1n ch\\\\u1ebf v\\\\u1ec1 kh\\\\u1ea3 n\\\\u0103ng ti\\\\u1ebfp c\\\\u1eadn c\\\\u00e1c s\\\\u1ea3n ph\\\\u1ea9m v\\\\u00e0 d\\\\u1ecbch v\\\\u1ee5 t\\\\u00e0i ch\\\\u00ednh th\\\\u00f4ng th\\\\u01b0\\\\u1eddng. Trong chi\\\\u1ebfn l\\\\u01b0\\\\u1ee3c d\\\\u00e0i h\\\\u1ea1n, hai b\\\\u00ean \\\\u0111\\\\u1eb7t m\\\\u1ee5c ti\\\\u00eau tri\\\\u1ec3n khai 1.000 h\\\\u1ec7 th\\\\u1ed1ng m\\\\u00e1y giao d\\\\u1ecbch ng\\\\u00e2n h\\\\u00e0ng t\\\\u1ef1 \\\\u0111\\\\u1ed9ng (STM), kh\\\\u01a1i th\\\\u00f4ng d\\\\u00f2ng ch\\\\u1ea3y trong vi\\\\u1ec7c ti\\\\u1ebfp c\\\\u1eadn c\\\\u00e1c d\\\\u1ecbch v\\\\u1ee5 c\\\\u00f4ng, thu\\\\u1eadn ti\\\\u1ec7n trong vi\\\\u1ec7c ti\\\\u1ebfp c\\\\u1eadn t\\\\u00e0i ch\\\\u00ednh s\\\\u1ed1 c\\\\u1ee7a ng\\\\u01b0\\\\u1eddi d\\\\u00e2n v\\\\u00f9ng n\\\\u00f4ng th\\\\u00f4n.<\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">\\\\u0110\\\\u01b0\\\\u1ee3c x\\\\u00e2y d\\\\u1ef1ng d\\\\u1ef1a tr\\\\u00ean k\\\\u1ebft qu\\\\u1ea3 nghi\\\\u00ean c\\\\u1ee9u t\\\\u1eeb nh\\\\u1eefng th\\\\u00f3i quen c\\\\u0169ng nh\\\\u01b0 h\\\\u00e0nh vi c\\\\u1ee7a ph\\\\u1ea7n l\\\\u1edbn ng\\\\u01b0\\\\u1eddi d\\\\u00e2n t\\\\u1ea1i c\\\\u00e1c v\\\\u00f9ng n\\\\u00f4ng th\\\\u00f4n, m\\\\u1ed7i m\\\\u00e1y STM s\\\\u1ebd \\\\u0111\\\\u01b0\\\\u1ee3c trang b\\\\u1ecb \\\\u0111\\\\u1ea7y \\\\u0111\\\\u1ee7 c\\\\u00e1c ch\\\\u1ee9c n\\\\u0103ng nghi\\\\u1ec7p v\\\\u1ee5 c\\\\u1ee7a m\\\\u1ed9t ph\\\\u00f2ng giao d\\\\u1ecbch ng\\\\u00e2n h\\\\u00e0ng truy\\\\u1ec1n th\\\\u1ed1ng. Thay v\\\\u00ec ph\\\\u1ea3i nh\\\\u00e2n r\\\\u1ed9ng m\\\\u00f4 h\\\\u00ecnh c\\\\u00e1c ph\\\\u00f2ng giao d\\\\u1ecbch nh\\\\u01b0 hi\\\\u1ec7n nay, v\\\\u1edbi STM, ng\\\\u01b0\\\\u1eddi d\\\\u00e2n c\\\\u00f3 th\\\\u1ec3 th\\\\u1ef1c hi\\\\u1ec7n m\\\\u1edf t\\\\u00e0i kho\\\\u1ea3n th\\\\u00f4ng qua c\\\\u00f4ng ngh\\\\u1ec7 eKYC (x\\\\u00e1c th\\\\u1ef1c danh t\\\\u00ednh b\\\\u1eb1ng CCCD g\\\\u1eafn ch\\\\u00edp ho\\\\u1eb7c t\\\\u0129nh m\\\\u1ea1ch \\\\u0111\\\\u1ea1t \\\\u0111\\\\u1ed9 ch\\\\u00ednh x\\\\u00e1c cao nh\\\\u1ea5t t\\\\u1ea1i Vi\\\\u1ec7t Nam hi\\\\u1ec7n nay); m\\\\u1edf th\\\\u1ebb b\\\\u1eb1ng m\\\\u00e3 QR; k\\\\u00fd h\\\\u1ee3p \\\\u0111\\\\u1ed3ng; t\\\\u01b0 v\\\\u1ea5n; thanh to\\\\u00e1n; n\\\\u1ed9p l\\\\u1ec7 ph\\\\u00ed d\\\\u1ecbch v\\\\u1ee5 h\\\\u00e0nh ch\\\\u00ednh c\\\\u00f4ng\\\\u2026&nbsp;<\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">\\\\u0110\\\\u1ed3ng th\\\\u1eddi, m\\\\u00e1y STM c\\\\u00f2n \\\\u0111\\\\u01b0\\\\u1ee3c t\\\\u00edch h\\\\u1ee3p th\\\\u00eam t\\\\u00ednh n\\\\u0103ng video call, m\\\\u00e1y in v\\\\u00e0 scan nh\\\\u1eb1m h\\\\u1ed7 tr\\\\u1ee3 \\\\u0111\\\\u1eafc l\\\\u1ef1c cho ng\\\\u01b0\\\\u1eddi d\\\\u00e2n th\\\\u1ef1c hi\\\\u1ec7n 24\\\\\\/7 c\\\\u00e1c giao d\\\\u1ecbch \\\\u0111\\\\u00f2i h\\\\u1ecfi ph\\\\u1ea3i c\\\\u00f3 ch\\\\u1eef k\\\\u00fd t\\\\u01b0\\\\u01a1i m\\\\u00e0 kh\\\\u00f4ng c\\\\u1ea7n ph\\\\u1ea3i g\\\\u1eb7p m\\\\u1eb7t tr\\\\u1ef1c ti\\\\u1ebfp giao d\\\\u1ecbch vi\\\\u00ean. Kh\\\\u00f4ng c\\\\u1ea7n giao d\\\\u1ecbch vi\\\\u00ean hay \\\\u0111\\\\u1ed9i ng\\\\u0169 h\\\\u1ed7 tr\\\\u1ee3 tr\\\\u1ef1c ti\\\\u1ebfp, STM trao quy\\\\u1ec1n cho ng\\\\u01b0\\\\u1eddi d\\\\u00e2n \\\\u0111\\\\u1ec3 t\\\\u1ef1 ph\\\\u1ee5c v\\\\u1ee5 c\\\\u00e1c nhu c\\\\u1ea7u giao d\\\\u1ecbch c\\\\u1ee7a m\\\\u00ecnh m\\\\u00e0 v\\\\u1eabn d\\\\u1ec5 s\\\\u1eed d\\\\u1ee5ng, ph\\\\u00f9 h\\\\u1ee3p v\\\\u1edbi khu v\\\\u1ef1c n\\\\u00f4ng th\\\\u00f4n v\\\\u00e0 mi\\\\u1ec1n n\\\\u00fai.<\\\\\\/span><\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"\\\\\\/ckfinder\\\\\\/userfiles\\\\\\/files\\\\\\/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn\\\\\\/hotrovungsau4.png\\\\\\\"><\\\\\\/figure><p style=\\\\\\\"text-align:center;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\"><i>1.000 m\\\\u00e1y STM \\\\u0111\\\\u01b0\\\\u1ee3c KienlongBank d\\\\u1ef1 ki\\\\u1ebfn tri\\\\u1ec3n khai t\\\\u1ea1i c\\\\u00e1c t\\\\u1ec9nh v\\\\u00f9ng s\\\\u00e2u, v\\\\u00f9ng xa trong th\\\\u1eddi gian t\\\\u1edbi<\\\\\\/i><\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">N\\\\u1ebfu \\\\u0111\\\\u01b0\\\\u1ee3c khai th\\\\u00e1c t\\\\u1ed1i \\\\u0111a c\\\\u00e1c t\\\\u00ednh n\\\\u0103ng, th\\\\u00ec STM ho\\\\u00e0n to\\\\u00e0n c\\\\u00f3 th\\\\u1ec3 h\\\\u1ed7 tr\\\\u1ee3 \\\\u0111\\\\u1eafc l\\\\u1ef1c cho c\\\\u00f4ng t\\\\u00e1c s\\\\u1ed1 ho\\\\u00e1 d\\\\u1ecbch v\\\\u1ee5 c\\\\u00f4ng, g\\\\u00f3p ph\\\\u1ea7n kh\\\\u00f4ng nh\\\\u1ecf trong vi\\\\u1ec7c r\\\\u00fat ng\\\\u1eafn \\\\u0111\\\\u01b0\\\\u1ee3c quy tr\\\\u00ecnh, ti\\\\u1ebft ki\\\\u1ec7m \\\\u0111\\\\u01b0\\\\u1ee3c th\\\\u1eddi gian khi thay v\\\\u00ec ph\\\\u1ea3i \\\\u0111\\\\u1ebfn t\\\\u1eadn trung t\\\\u00e2m h\\\\u00e0nh ch\\\\u00ednh c\\\\u00f4ng (b\\\\u1ed9 ph\\\\u1eadn \\\\\\\"m\\\\u1ed9t c\\\\u1eeda\\\\\\\" c\\\\u1ee7a x\\\\u00e3) trong gi\\\\u1edd l\\\\u00e0m vi\\\\u1ec7c h\\\\u00e0nh ch\\\\u00ednh, th\\\\u00ec ng\\\\u01b0\\\\u1eddi d\\\\u00e2n c\\\\u00f3 th\\\\u1ec3 th\\\\u1ef1c hi\\\\u1ec7n \\\\u0111\\\\u01b0\\\\u1ee3c m\\\\u1ed9t s\\\\u1ed1 th\\\\u1ee7 t\\\\u1ee5c d\\\\u1ecbch v\\\\u1ee5 c\\\\u00f4ng th\\\\u00f4ng qua STM \\\\u0111\\\\u1eb7t t\\\\u1ea1i c\\\\u00e1c \\\\u0111\\\\u1ecba b\\\\u00e0n g\\\\u1ea7n h\\\\u01a1n v\\\\u00e0o b\\\\u1ea5t c\\\\u1ee9 l\\\\u00fac n\\\\u00e0o.&nbsp;<\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">\\\\u0110\\\\u1eb7t trong b\\\\u00e0i to\\\\u00e1n t\\\\u1ed5ng th\\\\u1ec3 (chi ph\\\\u00ed l\\\\u1eafp \\\\u0111\\\\u1eb7t m\\\\u1ed9t m\\\\u00e1y STM ti\\\\u1ebft ki\\\\u1ec7m h\\\\u01a1n nhi\\\\u1ec1u ch\\\\u1ec9 ri\\\\u00eang chi ph\\\\u00ed m\\\\u1edf m\\\\u1ed9t ph\\\\u00f2ng giao d\\\\u1ecbch), trong \\\\u0111i\\\\u1ec1u ki\\\\u1ec7n c\\\\u00f3 s\\\\u1ef1 c\\\\u00f9ng tham gia c\\\\u1ee7a ng\\\\u00e2n h\\\\u00e0ng v\\\\u00e0 c\\\\u00e1c c\\\\u1ea5p ch\\\\u00ednh quy\\\\u1ec1n t\\\\u1ea1i \\\\u0111\\\\u1ecba ph\\\\u01b0\\\\u01a1ng, th\\\\u00ec ng\\\\u01b0\\\\u1eddi d\\\\u00e2n ch\\\\u00ednh l\\\\u00e0 \\\\u0111\\\\u1ed1i t\\\\u01b0\\\\u1ee3ng \\\\u0111\\\\u01b0\\\\u1ee3c h\\\\u01b0\\\\u1edfng l\\\\u1ee3i l\\\\u1edbn nh\\\\u1ea5t trong vi\\\\u1ec7c \\\\u0111\\\\u01b0\\\\u1ee3c h\\\\u1ed7 tr\\\\u1ee3 ti\\\\u1ebfp c\\\\u1eadn c\\\\u00e1c d\\\\u1ecbch v\\\\u1ee5 t\\\\u00e0i ch\\\\u00ednh, ng\\\\u00e2n h\\\\u00e0ng \\\\u0111a ti\\\\u1ec7n \\\\u00edch c\\\\u0169ng nh\\\\u01b0 c\\\\u00e1c d\\\\u1ecbch v\\\\u1ee5 c\\\\u00f4ng.<\\\\\\/span><\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"\\\\\\/ckfinder\\\\\\/userfiles\\\\\\/files\\\\\\/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn\\\\\\/hotrovungsau6.png\\\\\\\"><\\\\\\/figure><p style=\\\\\\\"text-align:center;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\"><i>M\\\\u00e1y giao d\\\\u1ecbch STM \\\\u0111\\\\u1ea3m nhi\\\\u1ec7m vai tr\\\\u00f2 t\\\\u01b0\\\\u01a1ng \\\\u0111\\\\u01b0\\\\u01a1ng v\\\\u1edbi m\\\\u1ed9t qu\\\\u1ea7y giao d\\\\u1ecbch truy\\\\u1ec1n th\\\\u1ed1ng<\\\\\\/i><\\\\\\/span><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">Cho \\\\u0111\\\\u1ebfn nay, STM l\\\\u00e0 m\\\\u00e1y giao d\\\\u1ecbch ng\\\\u00e2n h\\\\u00e0ng t\\\\u1ef1 \\\\u0111\\\\u1ed9ng duy nh\\\\u1ea5t \\\\u0111\\\\u01b0\\\\u1ee3c s\\\\u1ea3n xu\\\\u1ea5t ho\\\\u00e0n to\\\\u00e0n trong n\\\\u01b0\\\\u1edbc, t\\\\u1eeb thi\\\\u1ebft b\\\\u1ecb ph\\\\u1ea7n c\\\\u1ee9ng \\\\u0111\\\\u1ebfn ph\\\\u1ea7n m\\\\u1ec1m \\\\u0111\\\\u1ec1u v\\\\u01b0\\\\u1ee3t qua ch\\\\u1ee9ng th\\\\u1ef1c b\\\\u1ea3o m\\\\u1eadt th\\\\u1ebb c\\\\u1ee7a M\\\\u1ef9 (EMV Level 2), ch\\\\u1ee9ng ch\\\\u1ec9 VCCS c\\\\u1ee7a NAPAS... \\\\u0111\\\\u1ea3m b\\\\u1ea3o an to\\\\u00e0n trong v\\\\u1eadn h\\\\u00e0nh, \\\\u0111\\\\u1ee7 s\\\\u1ee9c c\\\\u1ea1nh tranh v\\\\u1ec1 gi\\\\u00e1 th\\\\u00e0nh v\\\\u00e0 t\\\\u00ednh n\\\\u0103ng tr\\\\u00ean th\\\\u1ecb tr\\\\u01b0\\\\u1eddng. T\\\\u1ef1 ch\\\\u1ee7 ph\\\\u1ea7n m\\\\u1ec1m v\\\\u00e0 kh\\\\u1ea3 n\\\\u0103ng t\\\\u00f9y bi\\\\u1ebfn ph\\\\u1ea7n c\\\\u1ee9ng, h\\\\u1ec7 th\\\\u1ed1ng m\\\\u00e1y STM tr\\\\u1edf th\\\\u00e0nh m\\\\u1ed9t m\\\\u00e1y giao d\\\\u1ecbch ng\\\\u00e2n h\\\\u00e0ng \\\\u0111a ti\\\\u1ec7n \\\\u00edch \\\\u0111i s\\\\u00e2u v\\\\u00e0o th\\\\u1ef1c ti\\\\u1ec5n v\\\\u00e0 \\\\u0111em l\\\\u1ea1i nhi\\\\u1ec1u gi\\\\u00e1 tr\\\\u1ecb cho c\\\\u1ed9ng \\\\u0111\\\\u1ed3ng, gi\\\\u00fap \\\\u0111\\\\u1ecbnh h\\\\u00ecnh th\\\\u00f3i quen v\\\\u00e0 h\\\\u00e0nh vi c\\\\u1ee7a ng\\\\u01b0\\\\u1eddi d\\\\u00f9ng trong th\\\\u1eddi \\\\u0111\\\\u1ea1i s\\\\u1ed1 h\\\\u00f3a.&nbsp;<\\\\\\/span><\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"\\\\\\/ckfinder\\\\\\/userfiles\\\\\\/files\\\\\\/%E1%BA%A3nh%20t%E1%BA%A3i%20l%C3%AAn\\\\\\/hotrovungsau7.png\\\\\\\"><\\\\\\/figure><p style=\\\\\\\"text-align:justify;\\\\\\\"><span style=\\\\\\\"color:black;\\\\\\\">Kh\\\\u00f4ng ch\\\\u1ec9 ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng trong vai tr\\\\u00f2 m\\\\u1ed9t ng\\\\u00e2n h\\\\u00e0ng s\\\\u1ed1 ti\\\\u00ean phong trong vi\\\\u1ec7c \\\\u1ee9ng d\\\\u1ee5ng v\\\\u00e0 tri\\\\u1ec3n khai nh\\\\u1eefng c\\\\u00f4ng ngh\\\\u1ec7 m\\\\u1edbi \\\\u0111\\\\u1ec3 t\\\\u1ed1i \\\\u0111a ho\\\\u00e1 l\\\\u1ee3i \\\\u00edch v\\\\u00e0 \\\\u0111\\\\u00e1p \\\\u1ee9ng nhu c\\\\u1ea7u c\\\\u1ee7a nhi\\\\u1ec1u b\\\\u1ed9 ph\\\\u1ea7n kh\\\\u00e1ch h\\\\u00e0ng, KienlongBank \\\\u0111\\\\u00e3 v\\\\u00e0 \\\\u0111ang ph\\\\u00e1t tri\\\\u1ec3n, ho\\\\u00e0n thi\\\\u1ec7n \\\\u0111\\\\u1ec3 tr\\\\u1edf th\\\\u00e0nh m\\\\u1ed9t ng\\\\u00e2n h\\\\u00e0ng s\\\\u1ed1 to\\\\u00e0n d\\\\u00e2n, g\\\\u1eafn li\\\\u1ec1n l\\\\u1ee3i \\\\u00edch c\\\\u1ee7a ng\\\\u01b0\\\\u1eddi d\\\\u00e2n \\\\u0111\\\\u1ed1i v\\\\u1edbi ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng c\\\\u1ee7a Ng\\\\u00e2n h\\\\u00e0ng, \\\\u0111\\\\u01b0a Ng\\\\u00e2n h\\\\u00e0ng tr\\\\u1edf th\\\\u00e0nh c\\\\u1ea7u n\\\\u1ed1i mang nh\\\\u1eefng s\\\\u1ea3n ph\\\\u1ea9m d\\\\u1ecbch v\\\\u1ee5 t\\\\u00e0i ch\\\\u00ednh \\\\u0111\\\\u1ebfn v\\\\u1edbi m\\\\u1ecdi nh\\\\u00e0.&nbsp;<\\\\\\/span><\\\\\\/p>\\\"},\\\"brief\\\":{\\\"vi\\\":\\\"V\\\\u1edbi m\\\\u1ee5c ti\\\\u00eau xuy\\\\u00ean su\\\\u1ed1t h\\\\u01b0\\\\u1edbng t\\\\u1edbi m\\\\u1ed9t ng\\\\u00e2n h\\\\u00e0ng xanh, chia s\\\\u1ebb gi\\\\u00e1 tr\\\\u1ecb xanh v\\\\u00e0 ti\\\\u00ean phong trong c\\\\u00e1c ch\\\\u01b0\\\\u01a1ng tr\\\\u00ecnh, ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng xanh v\\\\u00ec l\\\\u1ee3i \\\\u00edch c\\\\u1ed9ng \\\\u0111\\\\u1ed3ng t\\\\u1ea1i Vi\\\\u1ec7t Nam, KienlongBank lu\\\\u00f4n \\\\u0111\\\\u1ed3ng h\\\\u00e0nh v\\\\u1edbi ch\\\\u00ednh quy\\\\u1ec1n \\\\u0111\\\\u1ecba ph\\\\u01b0\\\\u01a1ng tri\\\\u1ec3n khai c\\\\u00e1c ch\\\\u01b0\\\\u01a1ng tr\\\\u00ecnh an sinh x\\\\u00e3 h\\\\u1ed9i, h\\\\u1ed7 tr\\\\u1ee3 thi\\\\u1ebft th\\\\u1ef1c c\\\\u00f4ng t\\\\u00e1c s\\\\u1ed1 h\\\\u00f3a n\\\\u00f4ng th\\\\u00f4n v\\\\u00e0 v\\\\u00f9ng s\\\\u00e2u, v\\\\u00f9ng xa. \\\"},\\\"seo_title\\\":\\\"KienlongBank h\\\\u1ed7 tr\\\\u1ee3 v\\\\u00f9ng s\\\\u00e2u, v\\\\u00f9ng xa c\\\\u00e1c ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng gi\\\\u00e1o d\\\\u1ee5c v\\\\u00e0 t\\\\u00e1c v\\\\u1ee5 ng\\\\u00e2n h\\\\u00e0ng, d\\\\u1ecbch v\\\\u1ee5 c\\\\u00f4ng\\\",\\\"seo_keyword\\\":\\\"KienlongBank h\\\\u1ed7 tr\\\\u1ee3 v\\\\u00f9ng s\\\\u00e2u, v\\\\u00f9ng xa c\\\\u00e1c ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng gi\\\\u00e1o d\\\\u1ee5c v\\\\u00e0 t\\\\u00e1c v\\\\u1ee5 ng\\\\u00e2n h\\\\u00e0ng, d\\\\u1ecbch v\\\\u1ee5 c\\\\u00f4ng\\\",\\\"seo_description\\\":\\\"V\\\\u1edbi m\\\\u1ee5c ti\\\\u00eau xuy\\\\u00ean su\\\\u1ed1t h\\\\u01b0\\\\u1edbng t\\\\u1edbi m\\\\u1ed9t ng\\\\u00e2n h\\\\u00e0ng xanh, chia s\\\\u1ebb gi\\\\u00e1 tr\\\\u1ecb xanh v\\\\u00e0 ti\\\\u00ean phong trong c\\\\u00e1c ch\\\\u01b0\\\\u01a1ng tr\\\\u00ecnh, ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng xanh v\\\\u00ec l\\\\u1ee3i \\\\u00edch c\\\\u1ed9ng \\\\u0111\\\\u1ed3ng t\\\\u1ea1i Vi\\\\u1ec7t Nam, KienlongBank lu\\\\u00f4n \\\\u0111\\\\u1ed3ng h\\\\u00e0nh v\\\\u1edbi ch\\\\u00ednh quy\\\\u1ec1n \\\\u0111\\\\u1ecba ph\\\\u01b0\\\\u01a1ng tri\\\\u1ec3n khai c\\\\u00e1c ch\\\\u01b0\\\\u01a1ng tr\\\\u00ecnh an sinh x\\\\u00e3 h\\\\u1ed9i, h\\\\u1ed7 tr\\\\u1ee3 thi\\\\u1ebft th\\\\u1ef1c c\\\\u00f4ng t\\\\u00e1c s\\\\u1ed1 h\\\\u00f3a n\\\\u00f4ng th\\\\u00f4n v\\\\u00e0 v\\\\u00f9ng s\\\\u00e2u, v\\\\u00f9ng xa. \\\",\\\"refer\\\":null}\"', 'https://biz9.vn/upload/advertisement/nh 4 (5).jpg', '', 'active', '', '', 'kienlongbank-ho-tro-vung-sau-vung-xa-cac-hoat-dong-giao-duc-va-tac-vu-ngan-hang-dich-vu-cong', 0, 0, 0, 1, 0, 20, 0, '2022-10-03 15:41:58', NULL, ',1,', NULL, NULL, 'open', 'KienlongBank hỗ trợ vùng sâu, vùng xa các hoạt động giáo dục và tác vụ ngân hàng, dịch vụ công', 'KienlongBank hỗ trợ vùng sâu, vùng xa các hoạt động giáo dục và tác vụ ngân hàng, dịch vụ công', 'Với mục tiêu xuyên suốt hướng tới một ngân hàng xanh, chia sẻ giá trị xanh và tiên phong trong các chương trình, hoạt động xanh vì lợi ích cộng đồng tại Việt Nam, KienlongBank luôn đồng hành với chính quyền địa phương triển khai các chương trình an sinh xã hội, hỗ trợ thiết thực công tác số hóa nông thôn và vùng sâu, vùng xa. ', NULL, 3, 1, '2022-09-29 08:21:29', '2022-10-13 11:17:29');
INSERT INTO `tb_cms_posts` (`id`, `taxonomy_id`, `is_type`, `title`, `brief`, `content`, `json_params`, `image`, `image_thumb`, `status`, `author`, `url_coppy`, `url_part`, `torder`, `iorder`, `news_position`, `number_like`, `number_comment`, `number_view`, `nhuanbut`, `aproved_date`, `rating`, `category`, `cms_tag`, `relation`, `comment_status`, `seo_title`, `seo_keyword`, `seo_description`, `user_id`, `admin_updated_id`, `admin_created_id`, `created_at`, `updated_at`) VALUES
(610, 1, 'post', 'Thấy gì từ việc các doanh nghiệp địa ốc mua lại trái phiếu trước hạn', 'Áp lực đáo hạn trái phiếu đang khiến các doanh nghiệp địa ốc sốt sắng tính kế để không bị tuýt còi do mất khả năng thanh toán cho các trái chủ.', '<p style=\"text-align:justify;\"><strong>Tránh việt vị</strong></p><p style=\"text-align:justify;\">Trái phiếu doanh nghiệp gặp khó đang khiến nhiều công ty địa ốc loay hoay tìm nguồn vốn mới. Bên cạnh đó, áp lực thanh toán với các lô trái phiếu sắp đáo hạn cũng khiến doanh nghiệp nhóm này phải liên tục “đảo vốn” để tránh “việt vị” với các cơ quan chức năng và nhà đầu tư.</p><p style=\"text-align:justify;\">Theo FiinGroup, giá trị mua lại trái phiếu doanh nghiệp trong 6 tháng đầu năm 2022 đạt 72.290 tỷ đồng, tăng 22% so với cùng kỳ 2021, tập trung vào các trái phiếu cận đáo hạn. Cụ thể, 51,25% tổng giá trị trái phiếu được mua lại có kỳ hạn còn lại là 1 - 3 năm. Tổ chức tín dụng và bất động sản là 2 lĩnh vực có khối lượng mua lại trái phiếu lớn nhất, đạt 41,85% và 22,76% trong 6 tháng đầu năm, tương đương với 30.200 tỷ đồng và 16.400 tỷ đồng.</p><p style=\"text-align:justify;\">Việc các doanh nghiệp địa ốc cố gắng xoay xở để thanh toán các lô trái phiếu sắp đáo hạn đang cho thấy nỗ lực vượt qua các khó khăn trong ngắn hạn để có thể duy trì hoạt động. Bình luận về động thái này, chuyên gia kinh tế Đinh Trọng Thịnh cho rằng, doanh nghiệp bất động sản mua lại các lô trái phiếu sắp đáo hạn là việc làm tốt.</p><p style=\"text-align:justify;\">Theo ông Thịnh, doanh nghiệp có thể mua lại trái phiếu cho thấy hai điều, một là trên thị trường, sau thời gian sàng lọc gắt gao, vẫn còn những doanh nghiệp trường vốn, có tiềm lực tài chính tốt. Thứ hai, động thái này cũng là giải pháp để giảm lãi suất, giảm tối đa chi phí vận hành doanh nghiệp.</p><p style=\"text-align:justify;\">“Thời gian qua, dù ít nhưng vẫn có những doanh nghiệp huy động được vốn từ trái phiếu để kinh doanh. Sau một thời gian dài khi có sự kiềm giữ dòng vốn, số người dùng đòn bẩy tín dụng rời khỏi thị trường nhiều, nên hiện tại cơ bản chỉ còn những nhà đầu tư trường vốn, có tiềm lực thật, nên khi gần đến thời hạn trả nợ sẽ tiến hành mua lại để tất toán. Ngoài ra, đây là lĩnh vực nóng, được đề cập đến nhiều và với việc siết trái phiếu, các doanh nghiệp bất động sản gặp khó trong kinh doanh khiến nhiều nhà đầu tư có tâm lý chung là chỉ cần lấy lại được tiền gốc, bảo toàn vốn đã là rất tốt thay vì mong đợi nhận được các lãi suất cao như trước”, ông Thịnh cho biết.</p><p style=\"text-align:justify;\">Theo ông Thịnh, hiện thị trường đang phản ánh khá rõ thực tế, “ai khó thì vẫn khó”, ai có dòng tiền vẫn có dòng tiền. Doanh nghiệp mua lại được các lô trái phiếu sắp đáo hạn không chỉ cho thấy tình hình kinh doanh ổn định, mà còn giúp giảm chi phí vận hành, tránh được vỡ nợ trái phiếu trong tương lai khi không có khả năng thanh toán khi đáo hạn.</p><p style=\"text-align:justify;\"><strong>Giải pháp dòng tiền nào hiệu quả?</strong></p><p style=\"text-align:justify;\">Số liệu từ FiinGroup cũng cho thấy, giá trị đáo hạn của trái phiếu bất động sản vào cuối năm 2022 sẽ đạt khoảng 37.000 tỷ đồng, trong đó các doanh nghiệp chưa niêm yết chiếm phần lớn với 84% tổng giá trị so với con số 16% của các doanh nghiệp niêm yết. Hơn thế, áp lực trả nợ tiếp tục gia tăng mạnh trong giai đoạn 2023 – 2024, việc đảm bảo nguồn vốn đảo nợ đã và sẽ trở thành vấn đề cấp thiết.</p><p style=\"text-align:justify;\">Theo FiinGroup, thị trường địa ốc đang chứng kiến khoảng thời gian trầm lắng về thanh khoản, làm cho vòng quay hàng tồn kho của các doanh nghiệp bất động sản niêm yết tăng lên ở mức rất cao: 1.497 ngày. Tức với tốc độ triển khai và bán hàng như diễn ra trong quý II vừa qua thì phải mất hơn 4 năm mới giải phóng lượng hàng tồn kho này. Đây là mức cao đáng báo động cho các doanh nghiệp bất động sản trong bối cảnh hiện nay.</p><p style=\"text-align:justify;\">Điều này trở nên quan trọng trong bối cảnh các doanh nghiệp bất động sản niêm yết chứng kiến doanh thu thuần giảm 49% và lợi nhuận sau thuế giảm 72,5% trong quý II/2022 và dự kiến 2022 đi ngang (với mức lợi nhuận sau thuế dự kiến tăng chỉ 2%).</p><p style=\"text-align:justify;\">Nhóm nghiên cứu của FiinGroup cho rằng, để thích ứng với bối cảnh mới này, các doanh nghiệp địa ốc cần mở rộng kênh vốn từ khách hàng, đối tác và chủ động minh bạch hồ sơ tín dụng trên thị trường vốn.</p><p style=\"text-align:justify;\">Cụ thể, doanh nghiệp cần tận dụng kênh vốn từ khách hàng qua việc nỗ lực hoàn thiện các thủ tục pháp lý và tiến độ triển khai dự án để có thể mở bán và nhận các khoản tiền trả trước từ khách hàng (nhất là khách hàng cá nhân); Có phương án tài chính hấp dẫn nhằm đẩy mạnh tiến độ thu tiền trả trước từ khách hàng; Tận dụng kênh vốn từ đối tác hợp tác kinh doanh và nhà cung cấp (vốn lưu động).</p><p style=\"text-align:justify;\">Trong khi đó, việc xây dựng và cải thiện hồ sơ tín dụng trên thị trường vốn được xem là giải pháp căn cơ hướng đến một chiến lược vốn tối ưu thay vì khi có nhu cầu huy động vốn mới thực hiện. Cùng với đó là việc chủ động xem xét thực hiện xếp hạng tín nhiệm, minh bạch thông tin và rủi ro đến thị trường trong nước và quốc tế.</p><p style=\"text-align:justify;\">Và cuối cùng là đẩy mạnh kênh trái phiếu chào bán ra công chúng.</p><p style=\"text-align:justify;\">Cũng bình luận về câu chuyện đảo vốn của các doanh nghiệp địa ốc, theo ông Trung Kiên, nhà sáng lập Công ty Quản lý tài sản Vietnam Holdings Inc, việc đảo vốn của các doanh nghiệp là điều dễ hiểu. Với các lô trái phiếu sắp đáo hạn thì doanh nghiệp sẽ phải tất toán cho nhà đầu tư để giữ niềm tin thị trường, cũng là để tránh các vấn đề về pháp lý nếu không thực hiện đúng cam kết.</p><p style=\"text-align:justify;\">Ông Kiên cho rằng, trong bối cảnh hiện tại, khi trái phiếu doanh nghiệp không còn hấp dẫn như trước thì có 4 giải pháp mà các doanh nghiệp địa ốc có thể hướng đến để tìm kiếm cho mình nguồn vốn trung, dài hạn. Đó là phát hành cổ phiếu trên thị trường chứng khoán; tìm kiếm các đối tác chiến lược để có thêm dòng tiền, vốn kinh doanh; bán bớt tài sản, dự án không ưu tiên để tập trung cho các dự án ưu tiên; phát hành trái phiếu quốc tế. Riêng với nhóm doanh nghiệp địa ốc chưa niêm yết, sẽ cần nỗ lực nhiều để có thể đưa doanh nghiệp niêm yết trên sàn chứng khoán để có được kênh huy động vốn.</p><p style=\"text-align:justify;\">Với cái nhìn lạc quan thận trọng, ông Kiên cho biết thêm rằng, năm 2022 có thể vẫn là năm “dọn dẹp” lại thị trường trái phiếu sau ba năm bùng nổ từ 2017 – 2019. Do đó, nhà đầu tư không nên kỳ vọng quá nhiều vào sự phục hồi mạnh mẽ của thị trường trái phiếu doanh nghiệp trong năm 2022 và kể cả năm 2023.</p><p style=\"text-align:justify;\">“Thị trường trái phiếu doanh nghiệp hồi phục hay không phụ thuộc vào ý chí của chính sách, mà theo quan sát của tôi thì chúng ta đang không ưu tiên điều này. Hiện các tổ chức tín dụng không còn được mua trái phiếu doanh nghiệp, trong khi đây mới là các khách hàng chính. Do đó, kể cả việc doanh nghiệp có phát hành được trái phiếu thì thanh khoản có thể cũng không cao, bởi ở thị trường này thì nhà đầu tư cá nhân chiếm số lượng không đáng kể”, ông Kiên nói.</p><p style=\"text-align:justify;\">Còn theo ông Thịnh, trước áp lực đáo hạn, các doanh nghiệp địa ốc cần cân đối dòng tiền và có giải pháp phù hợp, “sửa mình” để huy động được vốn từ trái phiếu bằng cách thoả mãn các quy định vì đây vẫn là kênh dẫn vốn quan trọng.</p><p style=\"text-align:justify;\">Với các nhà đầu tư, theo ông Thịnh, nhà đầu tư muốn tham gia thị trường trái phiếu doanh nghiệp thì nên tập trung quan sát các chỉ số tài chính của doanh nghiệp, bởi đây là yếu tố quan trọng cho thấy khả năng trả nợ của bên phát hành.</p><p style=\"text-align:justify;\"><a href=\"https://bds.tinnhanhchungkhoan.vn/bat-dong-san/thay-gi-tu-viec-cac-doanh-nghiep-dia-oc-mua-lai-trai-phieu-truoc-han-305452.html\">Theo Thành Nguyễn / Đầu tư chứng khoán</a></p>', '\"{\\\"content\\\":{\\\"vi\\\":\\\"<p style=\\\\\\\"text-align:justify;\\\\\\\"><strong>Tr\\\\u00e1nh vi\\\\u1ec7t v\\\\u1ecb<\\\\\\/strong><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">Tr\\\\u00e1i phi\\\\u1ebfu doanh nghi\\\\u1ec7p g\\\\u1eb7p kh\\\\u00f3 \\\\u0111ang khi\\\\u1ebfn nhi\\\\u1ec1u c\\\\u00f4ng ty \\\\u0111\\\\u1ecba \\\\u1ed1c loay hoay t\\\\u00ecm ngu\\\\u1ed3n v\\\\u1ed1n m\\\\u1edbi. B\\\\u00ean c\\\\u1ea1nh \\\\u0111\\\\u00f3, \\\\u00e1p l\\\\u1ef1c thanh to\\\\u00e1n v\\\\u1edbi c\\\\u00e1c l\\\\u00f4 tr\\\\u00e1i phi\\\\u1ebfu s\\\\u1eafp \\\\u0111\\\\u00e1o h\\\\u1ea1n c\\\\u0169ng khi\\\\u1ebfn doanh nghi\\\\u1ec7p nh\\\\u00f3m n\\\\u00e0y ph\\\\u1ea3i li\\\\u00ean t\\\\u1ee5c \\\\u201c\\\\u0111\\\\u1ea3o v\\\\u1ed1n\\\\u201d \\\\u0111\\\\u1ec3 tr\\\\u00e1nh \\\\u201cvi\\\\u1ec7t v\\\\u1ecb\\\\u201d v\\\\u1edbi c\\\\u00e1c c\\\\u01a1 quan ch\\\\u1ee9c n\\\\u0103ng v\\\\u00e0 nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">Theo FiinGroup, gi\\\\u00e1 tr\\\\u1ecb mua l\\\\u1ea1i tr\\\\u00e1i phi\\\\u1ebfu doanh nghi\\\\u1ec7p trong 6 th\\\\u00e1ng \\\\u0111\\\\u1ea7u n\\\\u0103m 2022 \\\\u0111\\\\u1ea1t 72.290 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng, t\\\\u0103ng 22% so v\\\\u1edbi c\\\\u00f9ng k\\\\u1ef3 2021, t\\\\u1eadp trung v\\\\u00e0o c\\\\u00e1c tr\\\\u00e1i phi\\\\u1ebfu c\\\\u1eadn \\\\u0111\\\\u00e1o h\\\\u1ea1n. C\\\\u1ee5 th\\\\u1ec3, 51,25% t\\\\u1ed5ng gi\\\\u00e1 tr\\\\u1ecb tr\\\\u00e1i phi\\\\u1ebfu \\\\u0111\\\\u01b0\\\\u1ee3c mua l\\\\u1ea1i c\\\\u00f3 k\\\\u1ef3 h\\\\u1ea1n c\\\\u00f2n l\\\\u1ea1i l\\\\u00e0 1 - 3 n\\\\u0103m. T\\\\u1ed5 ch\\\\u1ee9c t\\\\u00edn d\\\\u1ee5ng v\\\\u00e0 b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n l\\\\u00e0 2 l\\\\u0129nh v\\\\u1ef1c c\\\\u00f3 kh\\\\u1ed1i l\\\\u01b0\\\\u1ee3ng mua l\\\\u1ea1i tr\\\\u00e1i phi\\\\u1ebfu l\\\\u1edbn nh\\\\u1ea5t, \\\\u0111\\\\u1ea1t 41,85% v\\\\u00e0 22,76% trong 6 th\\\\u00e1ng \\\\u0111\\\\u1ea7u n\\\\u0103m, t\\\\u01b0\\\\u01a1ng \\\\u0111\\\\u01b0\\\\u01a1ng v\\\\u1edbi 30.200 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng v\\\\u00e0 16.400 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">Vi\\\\u1ec7c c\\\\u00e1c doanh nghi\\\\u1ec7p \\\\u0111\\\\u1ecba \\\\u1ed1c c\\\\u1ed1 g\\\\u1eafng xoay x\\\\u1edf \\\\u0111\\\\u1ec3 thanh to\\\\u00e1n c\\\\u00e1c l\\\\u00f4 tr\\\\u00e1i phi\\\\u1ebfu s\\\\u1eafp \\\\u0111\\\\u00e1o h\\\\u1ea1n \\\\u0111ang cho th\\\\u1ea5y n\\\\u1ed7 l\\\\u1ef1c v\\\\u01b0\\\\u1ee3t qua c\\\\u00e1c kh\\\\u00f3 kh\\\\u0103n trong ng\\\\u1eafn h\\\\u1ea1n \\\\u0111\\\\u1ec3 c\\\\u00f3 th\\\\u1ec3 duy tr\\\\u00ec ho\\\\u1ea1t \\\\u0111\\\\u1ed9ng. B\\\\u00ecnh lu\\\\u1eadn v\\\\u1ec1 \\\\u0111\\\\u1ed9ng th\\\\u00e1i n\\\\u00e0y, chuy\\\\u00ean gia kinh t\\\\u1ebf \\\\u0110inh Tr\\\\u1ecdng Th\\\\u1ecbnh cho r\\\\u1eb1ng, doanh nghi\\\\u1ec7p b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n mua l\\\\u1ea1i c\\\\u00e1c l\\\\u00f4 tr\\\\u00e1i phi\\\\u1ebfu s\\\\u1eafp \\\\u0111\\\\u00e1o h\\\\u1ea1n l\\\\u00e0 vi\\\\u1ec7c l\\\\u00e0m t\\\\u1ed1t.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">Theo \\\\u00f4ng Th\\\\u1ecbnh, doanh nghi\\\\u1ec7p c\\\\u00f3 th\\\\u1ec3 mua l\\\\u1ea1i tr\\\\u00e1i phi\\\\u1ebfu cho th\\\\u1ea5y hai \\\\u0111i\\\\u1ec1u, m\\\\u1ed9t l\\\\u00e0 tr\\\\u00ean th\\\\u1ecb tr\\\\u01b0\\\\u1eddng, sau th\\\\u1eddi gian s\\\\u00e0ng l\\\\u1ecdc g\\\\u1eaft gao, v\\\\u1eabn c\\\\u00f2n nh\\\\u1eefng doanh nghi\\\\u1ec7p tr\\\\u01b0\\\\u1eddng v\\\\u1ed1n, c\\\\u00f3 ti\\\\u1ec1m l\\\\u1ef1c t\\\\u00e0i ch\\\\u00ednh t\\\\u1ed1t. Th\\\\u1ee9 hai, \\\\u0111\\\\u1ed9ng th\\\\u00e1i n\\\\u00e0y c\\\\u0169ng l\\\\u00e0 gi\\\\u1ea3i ph\\\\u00e1p \\\\u0111\\\\u1ec3 gi\\\\u1ea3m l\\\\u00e3i su\\\\u1ea5t, gi\\\\u1ea3m t\\\\u1ed1i \\\\u0111a chi ph\\\\u00ed v\\\\u1eadn h\\\\u00e0nh doanh nghi\\\\u1ec7p.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">\\\\u201cTh\\\\u1eddi gian qua, d\\\\u00f9 \\\\u00edt nh\\\\u01b0ng v\\\\u1eabn c\\\\u00f3 nh\\\\u1eefng doanh nghi\\\\u1ec7p huy \\\\u0111\\\\u1ed9ng \\\\u0111\\\\u01b0\\\\u1ee3c v\\\\u1ed1n t\\\\u1eeb tr\\\\u00e1i phi\\\\u1ebfu \\\\u0111\\\\u1ec3 kinh doanh. Sau m\\\\u1ed9t th\\\\u1eddi gian d\\\\u00e0i khi c\\\\u00f3 s\\\\u1ef1 ki\\\\u1ec1m gi\\\\u1eef d\\\\u00f2ng v\\\\u1ed1n, s\\\\u1ed1 ng\\\\u01b0\\\\u1eddi d\\\\u00f9ng \\\\u0111\\\\u00f2n b\\\\u1ea9y t\\\\u00edn d\\\\u1ee5ng r\\\\u1eddi kh\\\\u1ecfi th\\\\u1ecb tr\\\\u01b0\\\\u1eddng nhi\\\\u1ec1u, n\\\\u00ean hi\\\\u1ec7n t\\\\u1ea1i c\\\\u01a1 b\\\\u1ea3n ch\\\\u1ec9 c\\\\u00f2n nh\\\\u1eefng nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 tr\\\\u01b0\\\\u1eddng v\\\\u1ed1n, c\\\\u00f3 ti\\\\u1ec1m l\\\\u1ef1c th\\\\u1eadt, n\\\\u00ean khi g\\\\u1ea7n \\\\u0111\\\\u1ebfn th\\\\u1eddi h\\\\u1ea1n tr\\\\u1ea3 n\\\\u1ee3 s\\\\u1ebd ti\\\\u1ebfn h\\\\u00e0nh mua l\\\\u1ea1i \\\\u0111\\\\u1ec3 t\\\\u1ea5t to\\\\u00e1n. Ngo\\\\u00e0i ra, \\\\u0111\\\\u00e2y l\\\\u00e0 l\\\\u0129nh v\\\\u1ef1c n\\\\u00f3ng, \\\\u0111\\\\u01b0\\\\u1ee3c \\\\u0111\\\\u1ec1 c\\\\u1eadp \\\\u0111\\\\u1ebfn nhi\\\\u1ec1u v\\\\u00e0 v\\\\u1edbi vi\\\\u1ec7c si\\\\u1ebft tr\\\\u00e1i phi\\\\u1ebfu, c\\\\u00e1c doanh nghi\\\\u1ec7p b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n g\\\\u1eb7p kh\\\\u00f3 trong kinh doanh khi\\\\u1ebfn nhi\\\\u1ec1u nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 c\\\\u00f3 t\\\\u00e2m l\\\\u00fd chung l\\\\u00e0 ch\\\\u1ec9 c\\\\u1ea7n l\\\\u1ea5y l\\\\u1ea1i \\\\u0111\\\\u01b0\\\\u1ee3c ti\\\\u1ec1n g\\\\u1ed1c, b\\\\u1ea3o to\\\\u00e0n v\\\\u1ed1n \\\\u0111\\\\u00e3 l\\\\u00e0 r\\\\u1ea5t t\\\\u1ed1t thay v\\\\u00ec mong \\\\u0111\\\\u1ee3i nh\\\\u1eadn \\\\u0111\\\\u01b0\\\\u1ee3c c\\\\u00e1c l\\\\u00e3i su\\\\u1ea5t cao nh\\\\u01b0 tr\\\\u01b0\\\\u1edbc\\\\u201d, \\\\u00f4ng Th\\\\u1ecbnh cho bi\\\\u1ebft.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">Theo \\\\u00f4ng Th\\\\u1ecbnh, hi\\\\u1ec7n th\\\\u1ecb tr\\\\u01b0\\\\u1eddng \\\\u0111ang ph\\\\u1ea3n \\\\u00e1nh kh\\\\u00e1 r\\\\u00f5 th\\\\u1ef1c t\\\\u1ebf, \\\\u201cai kh\\\\u00f3 th\\\\u00ec v\\\\u1eabn kh\\\\u00f3\\\\u201d, ai c\\\\u00f3 d\\\\u00f2ng ti\\\\u1ec1n v\\\\u1eabn c\\\\u00f3 d\\\\u00f2ng ti\\\\u1ec1n. Doanh nghi\\\\u1ec7p mua l\\\\u1ea1i \\\\u0111\\\\u01b0\\\\u1ee3c c\\\\u00e1c l\\\\u00f4 tr\\\\u00e1i phi\\\\u1ebfu s\\\\u1eafp \\\\u0111\\\\u00e1o h\\\\u1ea1n kh\\\\u00f4ng ch\\\\u1ec9 cho th\\\\u1ea5y t\\\\u00ecnh h\\\\u00ecnh kinh doanh \\\\u1ed5n \\\\u0111\\\\u1ecbnh, m\\\\u00e0 c\\\\u00f2n gi\\\\u00fap gi\\\\u1ea3m chi ph\\\\u00ed v\\\\u1eadn h\\\\u00e0nh, tr\\\\u00e1nh \\\\u0111\\\\u01b0\\\\u1ee3c v\\\\u1ee1 n\\\\u1ee3 tr\\\\u00e1i phi\\\\u1ebfu trong t\\\\u01b0\\\\u01a1ng lai khi kh\\\\u00f4ng c\\\\u00f3 kh\\\\u1ea3 n\\\\u0103ng thanh to\\\\u00e1n khi \\\\u0111\\\\u00e1o h\\\\u1ea1n.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><strong>Gi\\\\u1ea3i ph\\\\u00e1p d\\\\u00f2ng ti\\\\u1ec1n n\\\\u00e0o hi\\\\u1ec7u qu\\\\u1ea3?<\\\\\\/strong><\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">S\\\\u1ed1 li\\\\u1ec7u t\\\\u1eeb FiinGroup c\\\\u0169ng cho th\\\\u1ea5y, gi\\\\u00e1 tr\\\\u1ecb \\\\u0111\\\\u00e1o h\\\\u1ea1n c\\\\u1ee7a tr\\\\u00e1i phi\\\\u1ebfu b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n v\\\\u00e0o cu\\\\u1ed1i n\\\\u0103m 2022 s\\\\u1ebd \\\\u0111\\\\u1ea1t kho\\\\u1ea3ng 37.000 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng, trong \\\\u0111\\\\u00f3 c\\\\u00e1c doanh nghi\\\\u1ec7p ch\\\\u01b0a ni\\\\u00eam y\\\\u1ebft chi\\\\u1ebfm ph\\\\u1ea7n l\\\\u1edbn v\\\\u1edbi 84% t\\\\u1ed5ng gi\\\\u00e1 tr\\\\u1ecb so v\\\\u1edbi con s\\\\u1ed1 16% c\\\\u1ee7a c\\\\u00e1c doanh nghi\\\\u1ec7p ni\\\\u00eam y\\\\u1ebft. H\\\\u01a1n th\\\\u1ebf, \\\\u00e1p l\\\\u1ef1c tr\\\\u1ea3 n\\\\u1ee3 ti\\\\u1ebfp t\\\\u1ee5c gia t\\\\u0103ng m\\\\u1ea1nh trong giai \\\\u0111o\\\\u1ea1n 2023 \\\\u2013 2024, vi\\\\u1ec7c \\\\u0111\\\\u1ea3m b\\\\u1ea3o ngu\\\\u1ed3n v\\\\u1ed1n \\\\u0111\\\\u1ea3o n\\\\u1ee3 \\\\u0111\\\\u00e3 v\\\\u00e0 s\\\\u1ebd tr\\\\u1edf th\\\\u00e0nh v\\\\u1ea5n \\\\u0111\\\\u1ec1 c\\\\u1ea5p thi\\\\u1ebft.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">Theo FiinGroup, th\\\\u1ecb tr\\\\u01b0\\\\u1eddng \\\\u0111\\\\u1ecba \\\\u1ed1c \\\\u0111ang ch\\\\u1ee9ng ki\\\\u1ebfn kho\\\\u1ea3ng th\\\\u1eddi gian tr\\\\u1ea7m l\\\\u1eafng v\\\\u1ec1 thanh kho\\\\u1ea3n, l\\\\u00e0m cho v\\\\u00f2ng quay h\\\\u00e0ng t\\\\u1ed3n kho c\\\\u1ee7a c\\\\u00e1c doanh nghi\\\\u1ec7p b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n ni\\\\u00eam y\\\\u1ebft t\\\\u0103ng l\\\\u00ean \\\\u1edf m\\\\u1ee9c r\\\\u1ea5t cao: 1.497 ng\\\\u00e0y. T\\\\u1ee9c v\\\\u1edbi t\\\\u1ed1c \\\\u0111\\\\u1ed9 tri\\\\u1ec3n khai v\\\\u00e0 b\\\\u00e1n h\\\\u00e0ng nh\\\\u01b0 di\\\\u1ec5n ra trong qu\\\\u00fd II v\\\\u1eeba qua th\\\\u00ec ph\\\\u1ea3i m\\\\u1ea5t h\\\\u01a1n 4 n\\\\u0103m m\\\\u1edbi gi\\\\u1ea3i ph\\\\u00f3ng l\\\\u01b0\\\\u1ee3ng h\\\\u00e0ng t\\\\u1ed3n kho n\\\\u00e0y. \\\\u0110\\\\u00e2y l\\\\u00e0 m\\\\u1ee9c cao \\\\u0111\\\\u00e1ng b\\\\u00e1o \\\\u0111\\\\u1ed9ng cho c\\\\u00e1c doanh nghi\\\\u1ec7p b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n trong b\\\\u1ed1i c\\\\u1ea3nh hi\\\\u1ec7n nay.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">\\\\u0110i\\\\u1ec1u n\\\\u00e0y tr\\\\u1edf n\\\\u00ean quan tr\\\\u1ecdng trong b\\\\u1ed1i c\\\\u1ea3nh c\\\\u00e1c doanh nghi\\\\u1ec7p b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n ni\\\\u00eam y\\\\u1ebft ch\\\\u1ee9ng ki\\\\u1ebfn doanh thu thu\\\\u1ea7n gi\\\\u1ea3m 49% v\\\\u00e0 l\\\\u1ee3i nhu\\\\u1eadn sau thu\\\\u1ebf gi\\\\u1ea3m 72,5% trong qu\\\\u00fd II\\\\\\/2022 v\\\\u00e0 d\\\\u1ef1 ki\\\\u1ebfn 2022 \\\\u0111i ngang (v\\\\u1edbi m\\\\u1ee9c l\\\\u1ee3i nhu\\\\u1eadn sau thu\\\\u1ebf d\\\\u1ef1 ki\\\\u1ebfn t\\\\u0103ng ch\\\\u1ec9 2%).<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">Nh\\\\u00f3m nghi\\\\u00ean c\\\\u1ee9u c\\\\u1ee7a FiinGroup cho r\\\\u1eb1ng, \\\\u0111\\\\u1ec3 th\\\\u00edch \\\\u1ee9ng v\\\\u1edbi b\\\\u1ed1i c\\\\u1ea3nh m\\\\u1edbi n\\\\u00e0y, c\\\\u00e1c doanh nghi\\\\u1ec7p \\\\u0111\\\\u1ecba \\\\u1ed1c c\\\\u1ea7n m\\\\u1edf r\\\\u1ed9ng k\\\\u00eanh v\\\\u1ed1n t\\\\u1eeb kh\\\\u00e1ch h\\\\u00e0ng, \\\\u0111\\\\u1ed1i t\\\\u00e1c v\\\\u00e0 ch\\\\u1ee7 \\\\u0111\\\\u1ed9ng minh b\\\\u1ea1ch h\\\\u1ed3 s\\\\u01a1 t\\\\u00edn d\\\\u1ee5ng tr\\\\u00ean th\\\\u1ecb tr\\\\u01b0\\\\u1eddng v\\\\u1ed1n.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">C\\\\u1ee5 th\\\\u1ec3, doanh nghi\\\\u1ec7p c\\\\u1ea7n t\\\\u1eadn d\\\\u1ee5ng k\\\\u00eanh v\\\\u1ed1n t\\\\u1eeb kh\\\\u00e1ch h\\\\u00e0ng qua vi\\\\u1ec7c n\\\\u1ed7 l\\\\u1ef1c ho\\\\u00e0n thi\\\\u1ec7n c\\\\u00e1c th\\\\u1ee7 t\\\\u1ee5c ph\\\\u00e1p l\\\\u00fd v\\\\u00e0 ti\\\\u1ebfn \\\\u0111\\\\u1ed9 tri\\\\u1ec3n khai d\\\\u1ef1 \\\\u00e1n \\\\u0111\\\\u1ec3 c\\\\u00f3 th\\\\u1ec3 m\\\\u1edf b\\\\u00e1n v\\\\u00e0 nh\\\\u1eadn c\\\\u00e1c kho\\\\u1ea3n ti\\\\u1ec1n tr\\\\u1ea3 tr\\\\u01b0\\\\u1edbc t\\\\u1eeb kh\\\\u00e1ch h\\\\u00e0ng (nh\\\\u1ea5t l\\\\u00e0 kh\\\\u00e1ch h\\\\u00e0ng c\\\\u00e1 nh\\\\u00e2n); C\\\\u00f3 ph\\\\u01b0\\\\u01a1ng \\\\u00e1n t\\\\u00e0i ch\\\\u00ednh h\\\\u1ea5p d\\\\u1eabn nh\\\\u1eb1m \\\\u0111\\\\u1ea9y m\\\\u1ea1nh ti\\\\u1ebfn \\\\u0111\\\\u1ed9 thu ti\\\\u1ec1n tr\\\\u1ea3 tr\\\\u01b0\\\\u1edbc t\\\\u1eeb kh\\\\u00e1ch h\\\\u00e0ng; T\\\\u1eadn d\\\\u1ee5ng k\\\\u00eanh v\\\\u1ed1n t\\\\u1eeb \\\\u0111\\\\u1ed1i t\\\\u00e1c h\\\\u1ee3p t\\\\u00e1c kinh doanh v\\\\u00e0 nh\\\\u00e0 cung c\\\\u1ea5p (v\\\\u1ed1n l\\\\u01b0u \\\\u0111\\\\u1ed9ng).<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">Trong khi \\\\u0111\\\\u00f3, vi\\\\u1ec7c x\\\\u00e2y d\\\\u1ef1ng v\\\\u00e0 c\\\\u1ea3i thi\\\\u1ec7n h\\\\u1ed3 s\\\\u01a1 t\\\\u00edn d\\\\u1ee5ng tr\\\\u00ean th\\\\u1ecb tr\\\\u01b0\\\\u1eddng v\\\\u1ed1n \\\\u0111\\\\u01b0\\\\u1ee3c xem l\\\\u00e0 gi\\\\u1ea3i ph\\\\u00e1p c\\\\u0103n c\\\\u01a1 h\\\\u01b0\\\\u1edbng \\\\u0111\\\\u1ebfn m\\\\u1ed9t chi\\\\u1ebfn l\\\\u01b0\\\\u1ee3c v\\\\u1ed1n t\\\\u1ed1i \\\\u01b0u thay v\\\\u00ec khi c\\\\u00f3 nhu c\\\\u1ea7u huy \\\\u0111\\\\u1ed9ng v\\\\u1ed1n m\\\\u1edbi th\\\\u1ef1c hi\\\\u1ec7n. C\\\\u00f9ng v\\\\u1edbi \\\\u0111\\\\u00f3 l\\\\u00e0 vi\\\\u1ec7c ch\\\\u1ee7 \\\\u0111\\\\u1ed9ng xem x\\\\u00e9t th\\\\u1ef1c hi\\\\u1ec7n x\\\\u1ebfp h\\\\u1ea1ng t\\\\u00edn nhi\\\\u1ec7m, minh b\\\\u1ea1ch th\\\\u00f4ng tin v\\\\u00e0 r\\\\u1ee7i ro \\\\u0111\\\\u1ebfn th\\\\u1ecb tr\\\\u01b0\\\\u1eddng trong n\\\\u01b0\\\\u1edbc v\\\\u00e0 qu\\\\u1ed1c t\\\\u1ebf.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">V\\\\u00e0 cu\\\\u1ed1i c\\\\u00f9ng l\\\\u00e0 \\\\u0111\\\\u1ea9y m\\\\u1ea1nh k\\\\u00eanh tr\\\\u00e1i phi\\\\u1ebfu ch\\\\u00e0o b\\\\u00e1n ra c\\\\u00f4ng ch\\\\u00fang.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">C\\\\u0169ng b\\\\u00ecnh lu\\\\u1eadn v\\\\u1ec1 c\\\\u00e2u chuy\\\\u1ec7n \\\\u0111\\\\u1ea3o v\\\\u1ed1n c\\\\u1ee7a c\\\\u00e1c doanh nghi\\\\u1ec7p \\\\u0111\\\\u1ecba \\\\u1ed1c, theo \\\\u00f4ng Trung Ki\\\\u00ean, nh\\\\u00e0 s\\\\u00e1ng l\\\\u1eadp C\\\\u00f4ng ty Qu\\\\u1ea3n l\\\\u00fd t\\\\u00e0i s\\\\u1ea3n Vietnam Holdings Inc, vi\\\\u1ec7c \\\\u0111\\\\u1ea3o v\\\\u1ed1n c\\\\u1ee7a c\\\\u00e1c doanh nghi\\\\u1ec7p l\\\\u00e0 \\\\u0111i\\\\u1ec1u d\\\\u1ec5 hi\\\\u1ec3u. V\\\\u1edbi c\\\\u00e1c l\\\\u00f4 tr\\\\u00e1i phi\\\\u1ebfu s\\\\u1eafp \\\\u0111\\\\u00e1o h\\\\u1ea1n th\\\\u00ec doanh nghi\\\\u1ec7p s\\\\u1ebd ph\\\\u1ea3i t\\\\u1ea5t to\\\\u00e1n cho nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 \\\\u0111\\\\u1ec3 gi\\\\u1eef ni\\\\u1ec1m tin th\\\\u1ecb tr\\\\u01b0\\\\u1eddng, c\\\\u0169ng l\\\\u00e0 \\\\u0111\\\\u1ec3 tr\\\\u00e1nh c\\\\u00e1c v\\\\u1ea5n \\\\u0111\\\\u1ec1 v\\\\u1ec1 ph\\\\u00e1p l\\\\u00fd n\\\\u1ebfu kh\\\\u00f4ng th\\\\u1ef1c hi\\\\u1ec7n \\\\u0111\\\\u00fang cam k\\\\u1ebft.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">\\\\u00d4ng Ki\\\\u00ean cho r\\\\u1eb1ng, trong b\\\\u1ed1i c\\\\u1ea3nh hi\\\\u1ec7n t\\\\u1ea1i, khi tr\\\\u00e1i phi\\\\u1ebfu doanh nghi\\\\u1ec7p kh\\\\u00f4ng c\\\\u00f2n h\\\\u1ea5p d\\\\u1eabn nh\\\\u01b0 tr\\\\u01b0\\\\u1edbc th\\\\u00ec c\\\\u00f3 4 gi\\\\u1ea3i ph\\\\u00e1p m\\\\u00e0 c\\\\u00e1c doanh nghi\\\\u1ec7p \\\\u0111\\\\u1ecba \\\\u1ed1c c\\\\u00f3 th\\\\u1ec3 h\\\\u01b0\\\\u1edbng \\\\u0111\\\\u1ebfn \\\\u0111\\\\u1ec3 t\\\\u00ecm ki\\\\u1ebfm cho m\\\\u00ecnh ngu\\\\u1ed3n v\\\\u1ed1n trung, d\\\\u00e0i h\\\\u1ea1n. \\\\u0110\\\\u00f3 l\\\\u00e0 ph\\\\u00e1t h\\\\u00e0nh c\\\\u1ed5 phi\\\\u1ebfu tr\\\\u00ean th\\\\u1ecb tr\\\\u01b0\\\\u1eddng ch\\\\u1ee9ng kho\\\\u00e1n; t\\\\u00ecm ki\\\\u1ebfm c\\\\u00e1c \\\\u0111\\\\u1ed1i t\\\\u00e1c chi\\\\u1ebfn l\\\\u01b0\\\\u1ee3c \\\\u0111\\\\u1ec3 c\\\\u00f3 th\\\\u00eam d\\\\u00f2ng ti\\\\u1ec1n, v\\\\u1ed1n kinh doanh; b\\\\u00e1n b\\\\u1edbt t\\\\u00e0i s\\\\u1ea3n, d\\\\u1ef1 \\\\u00e1n kh\\\\u00f4ng \\\\u01b0u ti\\\\u00ean \\\\u0111\\\\u1ec3 t\\\\u1eadp trung cho c\\\\u00e1c d\\\\u1ef1 \\\\u00e1n \\\\u01b0u ti\\\\u00ean; ph\\\\u00e1t h\\\\u00e0nh tr\\\\u00e1i phi\\\\u1ebfu qu\\\\u1ed1c t\\\\u1ebf. Ri\\\\u00eang v\\\\u1edbi nh\\\\u00f3m doanh nghi\\\\u1ec7p \\\\u0111\\\\u1ecba \\\\u1ed1c ch\\\\u01b0a ni\\\\u00eam y\\\\u1ebft, s\\\\u1ebd c\\\\u1ea7n n\\\\u1ed7 l\\\\u1ef1c nhi\\\\u1ec1u \\\\u0111\\\\u1ec3 c\\\\u00f3 th\\\\u1ec3 \\\\u0111\\\\u01b0a doanh nghi\\\\u1ec7p ni\\\\u00eam y\\\\u1ebft tr\\\\u00ean s\\\\u00e0n ch\\\\u1ee9ng kho\\\\u00e1n \\\\u0111\\\\u1ec3 c\\\\u00f3 \\\\u0111\\\\u01b0\\\\u1ee3c k\\\\u00eanh huy \\\\u0111\\\\u1ed9ng v\\\\u1ed1n.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">V\\\\u1edbi c\\\\u00e1i nh\\\\u00ecn l\\\\u1ea1c quan th\\\\u1eadn tr\\\\u1ecdng, \\\\u00f4ng Ki\\\\u00ean cho bi\\\\u1ebft th\\\\u00eam r\\\\u1eb1ng, n\\\\u0103m 2022 c\\\\u00f3 th\\\\u1ec3 v\\\\u1eabn l\\\\u00e0 n\\\\u0103m \\\\u201cd\\\\u1ecdn d\\\\u1eb9p\\\\u201d l\\\\u1ea1i th\\\\u1ecb tr\\\\u01b0\\\\u1eddng tr\\\\u00e1i phi\\\\u1ebfu sau ba n\\\\u0103m b\\\\u00f9ng n\\\\u1ed5 t\\\\u1eeb 2017 \\\\u2013 2019. Do \\\\u0111\\\\u00f3, nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 kh\\\\u00f4ng n\\\\u00ean k\\\\u1ef3 v\\\\u1ecdng qu\\\\u00e1 nhi\\\\u1ec1u v\\\\u00e0o s\\\\u1ef1 ph\\\\u1ee5c h\\\\u1ed3i m\\\\u1ea1nh m\\\\u1ebd c\\\\u1ee7a th\\\\u1ecb tr\\\\u01b0\\\\u1eddng tr\\\\u00e1i phi\\\\u1ebfu doanh nghi\\\\u1ec7p trong n\\\\u0103m 2022 v\\\\u00e0 k\\\\u1ec3 c\\\\u1ea3 n\\\\u0103m 2023.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">\\\\u201cTh\\\\u1ecb tr\\\\u01b0\\\\u1eddng tr\\\\u00e1i phi\\\\u1ebfu doanh nghi\\\\u1ec7p h\\\\u1ed3i ph\\\\u1ee5c hay kh\\\\u00f4ng ph\\\\u1ee5 thu\\\\u1ed9c v\\\\u00e0o \\\\u00fd ch\\\\u00ed c\\\\u1ee7a ch\\\\u00ednh s\\\\u00e1ch, m\\\\u00e0 theo quan s\\\\u00e1t c\\\\u1ee7a t\\\\u00f4i th\\\\u00ec ch\\\\u00fang ta \\\\u0111ang kh\\\\u00f4ng \\\\u01b0u ti\\\\u00ean \\\\u0111i\\\\u1ec1u n\\\\u00e0y. Hi\\\\u1ec7n c\\\\u00e1c t\\\\u1ed5 ch\\\\u1ee9c t\\\\u00edn d\\\\u1ee5ng kh\\\\u00f4ng c\\\\u00f2n \\\\u0111\\\\u01b0\\\\u1ee3c mua tr\\\\u00e1i phi\\\\u1ebfu doanh nghi\\\\u1ec7p, trong khi \\\\u0111\\\\u00e2y m\\\\u1edbi l\\\\u00e0 c\\\\u00e1c kh\\\\u00e1ch h\\\\u00e0ng ch\\\\u00ednh. Do \\\\u0111\\\\u00f3, k\\\\u1ec3 c\\\\u1ea3 vi\\\\u1ec7c doanh nghi\\\\u1ec7p c\\\\u00f3 ph\\\\u00e1t h\\\\u00e0nh \\\\u0111\\\\u01b0\\\\u1ee3c tr\\\\u00e1i phi\\\\u1ebfu th\\\\u00ec thanh kho\\\\u1ea3n c\\\\u00f3 th\\\\u1ec3 c\\\\u0169ng kh\\\\u00f4ng cao, b\\\\u1edfi \\\\u1edf th\\\\u1ecb tr\\\\u01b0\\\\u1eddng n\\\\u00e0y th\\\\u00ec nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 c\\\\u00e1 nh\\\\u00e2n chi\\\\u1ebfm s\\\\u1ed1 l\\\\u01b0\\\\u1ee3ng kh\\\\u00f4ng \\\\u0111\\\\u00e1ng k\\\\u1ec3\\\\u201d, \\\\u00f4ng Ki\\\\u00ean n\\\\u00f3i.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">C\\\\u00f2n theo \\\\u00f4ng Th\\\\u1ecbnh, tr\\\\u01b0\\\\u1edbc \\\\u00e1p l\\\\u1ef1c \\\\u0111\\\\u00e1o h\\\\u1ea1n, c\\\\u00e1c doanh nghi\\\\u1ec7p \\\\u0111\\\\u1ecba \\\\u1ed1c c\\\\u1ea7n c\\\\u00e2n \\\\u0111\\\\u1ed1i d\\\\u00f2ng ti\\\\u1ec1n v\\\\u00e0 c\\\\u00f3 gi\\\\u1ea3i ph\\\\u00e1p ph\\\\u00f9 h\\\\u1ee3p, \\\\u201cs\\\\u1eeda m\\\\u00ecnh\\\\u201d \\\\u0111\\\\u1ec3 huy \\\\u0111\\\\u1ed9ng \\\\u0111\\\\u01b0\\\\u1ee3c v\\\\u1ed1n t\\\\u1eeb tr\\\\u00e1i phi\\\\u1ebfu b\\\\u1eb1ng c\\\\u00e1ch tho\\\\u1ea3 m\\\\u00e3n c\\\\u00e1c quy \\\\u0111\\\\u1ecbnh v\\\\u00ec \\\\u0111\\\\u00e2y v\\\\u1eabn l\\\\u00e0 k\\\\u00eanh d\\\\u1eabn v\\\\u1ed1n quan tr\\\\u1ecdng.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\">V\\\\u1edbi c\\\\u00e1c nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0, theo \\\\u00f4ng Th\\\\u1ecbnh, nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 mu\\\\u1ed1n tham gia th\\\\u1ecb tr\\\\u01b0\\\\u1eddng tr\\\\u00e1i phi\\\\u1ebfu doanh nghi\\\\u1ec7p th\\\\u00ec n\\\\u00ean t\\\\u1eadp trung quan s\\\\u00e1t c\\\\u00e1c ch\\\\u1ec9 s\\\\u1ed1 t\\\\u00e0i ch\\\\u00ednh c\\\\u1ee7a doanh nghi\\\\u1ec7p, b\\\\u1edfi \\\\u0111\\\\u00e2y l\\\\u00e0 y\\\\u1ebfu t\\\\u1ed1 quan tr\\\\u1ecdng cho th\\\\u1ea5y kh\\\\u1ea3 n\\\\u0103ng tr\\\\u1ea3 n\\\\u1ee3 c\\\\u1ee7a b\\\\u00ean ph\\\\u00e1t h\\\\u00e0nh.<\\\\\\/p><p style=\\\\\\\"text-align:justify;\\\\\\\"><a href=\\\\\\\"https:\\\\\\/\\\\\\/bds.tinnhanhchungkhoan.vn\\\\\\/bat-dong-san\\\\\\/thay-gi-tu-viec-cac-doanh-nghiep-dia-oc-mua-lai-trai-phieu-truoc-han-305452.html\\\\\\\">Theo Th\\\\u00e0nh Nguy\\\\u1ec5n \\\\\\/ \\\\u0110\\\\u1ea7u t\\\\u01b0 ch\\\\u1ee9ng kho\\\\u00e1n<\\\\\\/a><\\\\\\/p>\\\"},\\\"brief\\\":{\\\"vi\\\":\\\"\\\\u00c1p l\\\\u1ef1c \\\\u0111\\\\u00e1o h\\\\u1ea1n tr\\\\u00e1i phi\\\\u1ebfu \\\\u0111ang khi\\\\u1ebfn c\\\\u00e1c doanh nghi\\\\u1ec7p \\\\u0111\\\\u1ecba \\\\u1ed1c s\\\\u1ed1t s\\\\u1eafng t\\\\u00ednh k\\\\u1ebf \\\\u0111\\\\u1ec3 kh\\\\u00f4ng b\\\\u1ecb tu\\\\u00fdt c\\\\u00f2i do m\\\\u1ea5t kh\\\\u1ea3 n\\\\u0103ng thanh to\\\\u00e1n cho c\\\\u00e1c tr\\\\u00e1i ch\\\\u1ee7.\\\"},\\\"seo_title\\\":\\\"\\\",\\\"seo_keyword\\\":\\\"tr\\\\u00e1i phi\\\\u1ebfu doanh nghi\\\\u1ec7p, th\\\\u1ecb tr\\\\u01b0\\\\u1eddng tr\\\\u00e1i phi\\\\u1ebfu, \\\\u0111\\\\u00e1o h\\\\u1ea1n tr\\\\u00e1i phi\\\\u1ebfu\\\",\\\"seo_description\\\":\\\"\\\",\\\"refer\\\":null}\"', 'https://biz9.vn/upload/advertisement/shutterstock-166947962-1392.jpg', '', 'active', 'Tuệ Minh', '', 'thay-gi-tu-viec-cac-doanh-nghiep-dia-oc-mua-lai-trai-phieu-truoc-han', 0, 0, 0, 1, 0, 13, 0, '2022-10-03 15:41:58', NULL, ',1,', NULL, NULL, 'open', '', 'trái phiếu doanh nghiệp, thị trường trái phiếu, đáo hạn trái phiếu', '', NULL, 3, 1, '2022-09-29 08:21:29', '2022-10-13 11:17:29'),
(611, 1, 'post', 'Thời điểm thị trường bất động sản lộ diện nhà đầu tư \'đuối sức”', 'Sau thời kỳ thị trường sôi động, đến nay đã bước vào giai đoạn chững lại, theo đó nhiều nhà đầu tư dưới áp lực tài chính đã bán cắt lỗ. Tuy nhiên, dù lỗ nhưng một số nhà đầu tư vẫn tỏ ra còn may mắn vì đã bán được đất.', '<p><strong>Bán lỗ để thoát “nợ”</strong><br>&nbsp;</p><p>Năm 2021, có trong tay 1,5 tỷ đồng, anh Ngô Thành, nhà đầu tư tay ngang tại Hà Nội, bắt đầu tìm hiểu về thị trường bất động sản với mong muốn sẽ kiếm được lời.</p><p>“Thời điểm đó, bạn bè tôi nhiều người đã kiếm được tiền từ đất, thậm chí là rất nhiều và giàu lên nhanh chóng. Thời điểm đó, lãi suất gửi ngân hàng khá thấp nên tôi đã rút hết tiền tiết kiệm và bắt đầu khảo giá khắp nơi để mua”, anh Thành nói.</p><p>Sau vài tháng tìm kiếm, đến tháng 5/2021, thị trường bất động sản vẫn diễn biến sôi động, anh Thành liều vay thêm tiền mua 2 mảnh đất tại Thạch Thất, diện tích 70m2/lô với mức giá 18 triệu đồng/m2, tổng hơn 2,5 tỷ đồng, trong đó có 1 tỷ đồng là anh vay ngân hàng.</p><p>Mấy tháng đầu tiên, dù phải trả cả gốc và lãi vài chục triệu đồng mỗi tháng nhưng anh Thành vẫn cảm thấy rất thoải mái. Dần thấy mỗi tháng phải đóng vài chục triệu và đều đặn, cộng với việc đầu năm 2022 thị trường bất động sản bắt đầu chững lại rồi hạ nhiệt, lúc này anh Thành mới cảm thấy như “ngồi trên đống lửa”.</p><figure class=\"image\"><img src=\"https://cafefcdn.com/203337114487263232/2022/9/10/photo-2-16627773277121168894245.jpg\" alt=\"Thời điểm thị trường bất động sản lộ diện nhà đầu tư đuối sức” - Ảnh 1.\"></figure><p>“Các lệnh siết phân lô bán nền, kiểm soát tín dụng,... khiến thị trường bắt đầu chững lại. Khi đó, tôi thấy không ổn với việc đầu tư đất, bởi về dài hạn vẫn chưa biết sẽ có tác động gì tiếp theo. Đầu năm 2022 tôi rao bán nhưng mãi vẫn khó bán”, anh Thành nói.</p><p>Mãi đến mới đây, anh Thành đã chấp nhận cắt lỗ sâu cả 2 lô đất với mức giá 15 triệu đồng/m2, tức lỗ hơn 400 triệu đồng. “Sau hơn 1 năm đầu tư tôi phải chấp nhận cắt lỗ hơn 400 triệu đồng. Tuy nhiên, việc cắt lỗ được và giải phóng khoản nợ ngân hàng ở thời điểm này vẫn còn may. Để lâu thêm tôi sợ có thể giá xuống nữa, khó thanh khoản hơn, cộng thêm lãi ngân hàng vẫn trả đều thì thành âm nặng”, anh Thành nói.</p><p><strong>Lộ diện nhà đầu tư “tay mơ”</strong></p><p>Trong bối cảnh thị trường bất động sản đang gặp khó khăn về siết tín dụng, tụt giảm thanh khoản, lệch pha cung cầu… nhiều nhà đầu tư đang thật sự đuối sức.</p><p>Nhiều môi giới cũng phải thừa nhận trong thời gian hiện tại rất khó thanh khoản, người bán nhiều người mua gần như không có. Anh Thanh Tùng - chủ phòng giao dịch bất động sản tại Hà Nội cho biết, nhiều nhà đầu tư bất động sản dùng đòn bẩy quá lớn hiện nay đang muốn “tháo chạy” khỏi thị trường. Ngay cả một số nhà đầu tư lớn hiện cũng đã chấp nhận bán lỗ một số lô đất để cơ cấu danh mục đầu tư, chỉ giữ lại nhưng lô có vị trí đẹp và công năng sử dụng ngay.</p><p>&nbsp;</p><figure class=\"image\"><img src=\"https://cafefcdn.com/203337114487263232/2022/9/10/photo-1-1662777325340367158626.jpg\" alt=\"Thời điểm thị trường bất động sản lộ diện nhà đầu tư đuối sức” - Ảnh 2.\"></figure><p>&nbsp;</p><p>“Khi thị trường sôi động thì bỏ tiền vào khu vực nào cũng có lãi, lúc đó ai cũng là nhà đầu tư tài ba. Nhưng khi thị trường bất động sản bắt đầu sang giai đoạn mới sẽ lộ diện những nhà đầu tư tay mơ, họ là nhóm đối tượng sẽ bỏ chạy đầu tiên khi có biến động do tâm lý không vững vàng”, anh Tùng nói.</p><p>Người này nhận định, thực tế hiện tượng cắt lỗ mới chỉ diễn ra ở một bộ phận và chưa xuất hiện tình trạng \"bán tháo\" như giai đoạn 2009 - 2011. Nếu thị trường vẫn không có chuyển biến mới thì chỉ cuối năm 2022 - 2023 nhà đầu tư đang ôm đất sẽ tiếp tục gặp khó khăn.</p><p>Theo ông Phan Công Chánh, Tổng giám đốc Phú Vinh Group, câu chuyện gồng lãi với nhà đầu tư dùng đòn bẩy tài chính nhiều phụ thuộc vào nguồn thu, bài toán tài chính và thời hạn đầu tư của mỗi người. Nhà đầu cơ lướt sóng khi dùng đòn bẩy tài chính nhiều sẽ chịu rủi ro nhiều nhất.</p><p>Xu hướng cắt lỗ có thể lan rộng hay không thì hiện tại khó đưa ra dự báo chính xác. Nhưng sẽ xảy ra với những người sử dụng đòn bẩy từ 70-80% trở lên mà không có nguồn thu để gồng lãi tiếp.</p><p>Theo chuyên gia bất động sản Trần Khánh Quang, trong bối cảnh nền kinh tế 2022 rất khó đoán định thì tiêu chuẩn hàng đầu khi mang tiền đi đầu tư thời gian này là phải đảm bảo không mất vốn, mua bất cứ tài sản nào cũng phải nghĩ đến khả năng bán được (tức thu hồi vốn nhanh), sau đó mới xét đến mục tiêu lợi nhuận.</p><p><a href=\"https://toquoc.vn/thoi-diem-thi-truong-bat-dong-san-lo-dien-nha-dau-tu-duoi-suc-20220908025519123.htm\">Theo Thanh Phong / Nhịp sống kinh tế</a></p>', '\"{\\\"content\\\":{\\\"vi\\\":\\\"<p><strong>B\\\\u00e1n l\\\\u1ed7 \\\\u0111\\\\u1ec3 tho\\\\u00e1t \\\\u201cn\\\\u1ee3\\\\u201d<\\\\\\/strong><br>&nbsp;<\\\\\\/p><p>N\\\\u0103m 2021, c\\\\u00f3 trong tay 1,5 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng, anh Ng\\\\u00f4 Th\\\\u00e0nh, nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 tay ngang t\\\\u1ea1i H\\\\u00e0 N\\\\u1ed9i, b\\\\u1eaft \\\\u0111\\\\u1ea7u t\\\\u00ecm hi\\\\u1ec3u v\\\\u1ec1 th\\\\u1ecb tr\\\\u01b0\\\\u1eddng b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n v\\\\u1edbi mong mu\\\\u1ed1n s\\\\u1ebd ki\\\\u1ebfm \\\\u0111\\\\u01b0\\\\u1ee3c l\\\\u1eddi.<\\\\\\/p><p>\\\\u201cTh\\\\u1eddi \\\\u0111i\\\\u1ec3m \\\\u0111\\\\u00f3, b\\\\u1ea1n b\\\\u00e8 t\\\\u00f4i nhi\\\\u1ec1u ng\\\\u01b0\\\\u1eddi \\\\u0111\\\\u00e3 ki\\\\u1ebfm \\\\u0111\\\\u01b0\\\\u1ee3c ti\\\\u1ec1n t\\\\u1eeb \\\\u0111\\\\u1ea5t, th\\\\u1eadm ch\\\\u00ed l\\\\u00e0 r\\\\u1ea5t nhi\\\\u1ec1u v\\\\u00e0 gi\\\\u00e0u l\\\\u00ean nhanh ch\\\\u00f3ng. Th\\\\u1eddi \\\\u0111i\\\\u1ec3m \\\\u0111\\\\u00f3, l\\\\u00e3i su\\\\u1ea5t g\\\\u1eedi ng\\\\u00e2n h\\\\u00e0ng kh\\\\u00e1 th\\\\u1ea5p n\\\\u00ean t\\\\u00f4i \\\\u0111\\\\u00e3 r\\\\u00fat h\\\\u1ebft ti\\\\u1ec1n ti\\\\u1ebft ki\\\\u1ec7m v\\\\u00e0 b\\\\u1eaft \\\\u0111\\\\u1ea7u kh\\\\u1ea3o gi\\\\u00e1 kh\\\\u1eafp n\\\\u01a1i \\\\u0111\\\\u1ec3 mua\\\\u201d, anh Th\\\\u00e0nh n\\\\u00f3i.<\\\\\\/p><p>Sau v\\\\u00e0i th\\\\u00e1ng t\\\\u00ecm ki\\\\u1ebfm, \\\\u0111\\\\u1ebfn th\\\\u00e1ng 5\\\\\\/2021, th\\\\u1ecb tr\\\\u01b0\\\\u1eddng b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n v\\\\u1eabn di\\\\u1ec5n bi\\\\u1ebfn s\\\\u00f4i \\\\u0111\\\\u1ed9ng, anh Th\\\\u00e0nh li\\\\u1ec1u vay th\\\\u00eam ti\\\\u1ec1n mua 2 m\\\\u1ea3nh \\\\u0111\\\\u1ea5t t\\\\u1ea1i Th\\\\u1ea1ch Th\\\\u1ea5t, di\\\\u1ec7n t\\\\u00edch 70m2\\\\\\/l\\\\u00f4 v\\\\u1edbi m\\\\u1ee9c gi\\\\u00e1 18 tri\\\\u1ec7u \\\\u0111\\\\u1ed3ng\\\\\\/m2, t\\\\u1ed5ng h\\\\u01a1n 2,5 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng, trong \\\\u0111\\\\u00f3 c\\\\u00f3 1 t\\\\u1ef7 \\\\u0111\\\\u1ed3ng l\\\\u00e0 anh vay ng\\\\u00e2n h\\\\u00e0ng.<\\\\\\/p><p>M\\\\u1ea5y th\\\\u00e1ng \\\\u0111\\\\u1ea7u ti\\\\u00ean, d\\\\u00f9 ph\\\\u1ea3i tr\\\\u1ea3 c\\\\u1ea3 g\\\\u1ed1c v\\\\u00e0 l\\\\u00e3i v\\\\u00e0i ch\\\\u1ee5c tri\\\\u1ec7u \\\\u0111\\\\u1ed3ng m\\\\u1ed7i th\\\\u00e1ng nh\\\\u01b0ng anh Th\\\\u00e0nh v\\\\u1eabn c\\\\u1ea3m th\\\\u1ea5y r\\\\u1ea5t tho\\\\u1ea3i m\\\\u00e1i. D\\\\u1ea7n th\\\\u1ea5y m\\\\u1ed7i th\\\\u00e1ng ph\\\\u1ea3i \\\\u0111\\\\u00f3ng v\\\\u00e0i ch\\\\u1ee5c tri\\\\u1ec7u v\\\\u00e0 \\\\u0111\\\\u1ec1u \\\\u0111\\\\u1eb7n, c\\\\u1ed9ng v\\\\u1edbi vi\\\\u1ec7c \\\\u0111\\\\u1ea7u n\\\\u0103m 2022 th\\\\u1ecb tr\\\\u01b0\\\\u1eddng b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n b\\\\u1eaft \\\\u0111\\\\u1ea7u ch\\\\u1eefng l\\\\u1ea1i r\\\\u1ed3i h\\\\u1ea1 nhi\\\\u1ec7t, l\\\\u00fac n\\\\u00e0y anh Th\\\\u00e0nh m\\\\u1edbi c\\\\u1ea3m th\\\\u1ea5y nh\\\\u01b0 \\\\u201cng\\\\u1ed3i tr\\\\u00ean \\\\u0111\\\\u1ed1ng l\\\\u1eeda\\\\u201d.<\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"https:\\\\\\/\\\\\\/cafefcdn.com\\\\\\/203337114487263232\\\\\\/2022\\\\\\/9\\\\\\/10\\\\\\/photo-2-16627773277121168894245.jpg\\\\\\\" alt=\\\\\\\"Th\\\\u1eddi \\\\u0111i\\\\u1ec3m th\\\\u1ecb tr\\\\u01b0\\\\u1eddng b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n l\\\\u1ed9 di\\\\u1ec7n nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 \\\\u0111u\\\\u1ed1i s\\\\u1ee9c\\\\u201d - \\\\u1ea2nh 1.\\\\\\\"><\\\\\\/figure><p>\\\\u201cC\\\\u00e1c l\\\\u1ec7nh si\\\\u1ebft ph\\\\u00e2n l\\\\u00f4 b\\\\u00e1n n\\\\u1ec1n, ki\\\\u1ec3m so\\\\u00e1t t\\\\u00edn d\\\\u1ee5ng,... khi\\\\u1ebfn th\\\\u1ecb tr\\\\u01b0\\\\u1eddng b\\\\u1eaft \\\\u0111\\\\u1ea7u ch\\\\u1eefng l\\\\u1ea1i. Khi \\\\u0111\\\\u00f3, t\\\\u00f4i th\\\\u1ea5y kh\\\\u00f4ng \\\\u1ed5n v\\\\u1edbi vi\\\\u1ec7c \\\\u0111\\\\u1ea7u t\\\\u01b0 \\\\u0111\\\\u1ea5t, b\\\\u1edfi v\\\\u1ec1 d\\\\u00e0i h\\\\u1ea1n v\\\\u1eabn ch\\\\u01b0a bi\\\\u1ebft s\\\\u1ebd c\\\\u00f3 t\\\\u00e1c \\\\u0111\\\\u1ed9ng g\\\\u00ec ti\\\\u1ebfp theo. \\\\u0110\\\\u1ea7u n\\\\u0103m 2022 t\\\\u00f4i rao b\\\\u00e1n nh\\\\u01b0ng m\\\\u00e3i v\\\\u1eabn kh\\\\u00f3 b\\\\u00e1n\\\\u201d, anh Th\\\\u00e0nh n\\\\u00f3i.<\\\\\\/p><p>M\\\\u00e3i \\\\u0111\\\\u1ebfn m\\\\u1edbi \\\\u0111\\\\u00e2y, anh Th\\\\u00e0nh \\\\u0111\\\\u00e3 ch\\\\u1ea5p nh\\\\u1eadn c\\\\u1eaft l\\\\u1ed7 s\\\\u00e2u c\\\\u1ea3 2 l\\\\u00f4 \\\\u0111\\\\u1ea5t v\\\\u1edbi m\\\\u1ee9c gi\\\\u00e1 15 tri\\\\u1ec7u \\\\u0111\\\\u1ed3ng\\\\\\/m2, t\\\\u1ee9c l\\\\u1ed7 h\\\\u01a1n 400 tri\\\\u1ec7u \\\\u0111\\\\u1ed3ng. \\\\u201cSau h\\\\u01a1n 1 n\\\\u0103m \\\\u0111\\\\u1ea7u t\\\\u01b0 t\\\\u00f4i ph\\\\u1ea3i ch\\\\u1ea5p nh\\\\u1eadn c\\\\u1eaft l\\\\u1ed7 h\\\\u01a1n 400 tri\\\\u1ec7u \\\\u0111\\\\u1ed3ng. Tuy nhi\\\\u00ean, vi\\\\u1ec7c c\\\\u1eaft l\\\\u1ed7 \\\\u0111\\\\u01b0\\\\u1ee3c v\\\\u00e0 gi\\\\u1ea3i ph\\\\u00f3ng kho\\\\u1ea3n n\\\\u1ee3 ng\\\\u00e2n h\\\\u00e0ng \\\\u1edf th\\\\u1eddi \\\\u0111i\\\\u1ec3m n\\\\u00e0y v\\\\u1eabn c\\\\u00f2n may. \\\\u0110\\\\u1ec3 l\\\\u00e2u th\\\\u00eam t\\\\u00f4i s\\\\u1ee3 c\\\\u00f3 th\\\\u1ec3 gi\\\\u00e1 xu\\\\u1ed1ng n\\\\u1eefa, kh\\\\u00f3 thanh kho\\\\u1ea3n h\\\\u01a1n, c\\\\u1ed9ng th\\\\u00eam l\\\\u00e3i ng\\\\u00e2n h\\\\u00e0ng v\\\\u1eabn tr\\\\u1ea3 \\\\u0111\\\\u1ec1u th\\\\u00ec th\\\\u00e0nh \\\\u00e2m n\\\\u1eb7ng\\\\u201d, anh Th\\\\u00e0nh n\\\\u00f3i.<\\\\\\/p><p><strong>L\\\\u1ed9 di\\\\u1ec7n nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 \\\\u201ctay m\\\\u01a1\\\\u201d<\\\\\\/strong><\\\\\\/p><p>Trong b\\\\u1ed1i c\\\\u1ea3nh th\\\\u1ecb tr\\\\u01b0\\\\u1eddng b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n \\\\u0111ang g\\\\u1eb7p kh\\\\u00f3 kh\\\\u0103n v\\\\u1ec1 si\\\\u1ebft t\\\\u00edn d\\\\u1ee5ng, t\\\\u1ee5t gi\\\\u1ea3m thanh kho\\\\u1ea3n, l\\\\u1ec7ch pha cung c\\\\u1ea7u\\\\u2026 nhi\\\\u1ec1u nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 \\\\u0111ang th\\\\u1eadt s\\\\u1ef1 \\\\u0111u\\\\u1ed1i s\\\\u1ee9c.<\\\\\\/p><p>Nhi\\\\u1ec1u m\\\\u00f4i gi\\\\u1edbi c\\\\u0169ng ph\\\\u1ea3i th\\\\u1eeba nh\\\\u1eadn trong th\\\\u1eddi gian hi\\\\u1ec7n t\\\\u1ea1i r\\\\u1ea5t kh\\\\u00f3 thanh kho\\\\u1ea3n, ng\\\\u01b0\\\\u1eddi b\\\\u00e1n nhi\\\\u1ec1u ng\\\\u01b0\\\\u1eddi mua g\\\\u1ea7n nh\\\\u01b0 kh\\\\u00f4ng c\\\\u00f3. Anh Thanh T\\\\u00f9ng - ch\\\\u1ee7 ph\\\\u00f2ng giao d\\\\u1ecbch b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n t\\\\u1ea1i H\\\\u00e0 N\\\\u1ed9i cho bi\\\\u1ebft, nhi\\\\u1ec1u nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n d\\\\u00f9ng \\\\u0111\\\\u00f2n b\\\\u1ea9y qu\\\\u00e1 l\\\\u1edbn hi\\\\u1ec7n nay \\\\u0111ang mu\\\\u1ed1n \\\\u201cth\\\\u00e1o ch\\\\u1ea1y\\\\u201d kh\\\\u1ecfi th\\\\u1ecb tr\\\\u01b0\\\\u1eddng. Ngay c\\\\u1ea3 m\\\\u1ed9t s\\\\u1ed1 nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 l\\\\u1edbn hi\\\\u1ec7n c\\\\u0169ng \\\\u0111\\\\u00e3 ch\\\\u1ea5p nh\\\\u1eadn b\\\\u00e1n l\\\\u1ed7 m\\\\u1ed9t s\\\\u1ed1 l\\\\u00f4 \\\\u0111\\\\u1ea5t \\\\u0111\\\\u1ec3 c\\\\u01a1 c\\\\u1ea5u danh m\\\\u1ee5c \\\\u0111\\\\u1ea7u t\\\\u01b0, ch\\\\u1ec9 gi\\\\u1eef l\\\\u1ea1i nh\\\\u01b0ng l\\\\u00f4 c\\\\u00f3 v\\\\u1ecb tr\\\\u00ed \\\\u0111\\\\u1eb9p v\\\\u00e0 c\\\\u00f4ng n\\\\u0103ng s\\\\u1eed d\\\\u1ee5ng ngay.<\\\\\\/p><p>&nbsp;<\\\\\\/p><figure class=\\\\\\\"image\\\\\\\"><img src=\\\\\\\"https:\\\\\\/\\\\\\/cafefcdn.com\\\\\\/203337114487263232\\\\\\/2022\\\\\\/9\\\\\\/10\\\\\\/photo-1-1662777325340367158626.jpg\\\\\\\" alt=\\\\\\\"Th\\\\u1eddi \\\\u0111i\\\\u1ec3m th\\\\u1ecb tr\\\\u01b0\\\\u1eddng b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n l\\\\u1ed9 di\\\\u1ec7n nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 \\\\u0111u\\\\u1ed1i s\\\\u1ee9c\\\\u201d - \\\\u1ea2nh 2.\\\\\\\"><\\\\\\/figure><p>&nbsp;<\\\\\\/p><p>\\\\u201cKhi th\\\\u1ecb tr\\\\u01b0\\\\u1eddng s\\\\u00f4i \\\\u0111\\\\u1ed9ng th\\\\u00ec b\\\\u1ecf ti\\\\u1ec1n v\\\\u00e0o khu v\\\\u1ef1c n\\\\u00e0o c\\\\u0169ng c\\\\u00f3 l\\\\u00e3i, l\\\\u00fac \\\\u0111\\\\u00f3 ai c\\\\u0169ng l\\\\u00e0 nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 t\\\\u00e0i ba. Nh\\\\u01b0ng khi th\\\\u1ecb tr\\\\u01b0\\\\u1eddng b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n b\\\\u1eaft \\\\u0111\\\\u1ea7u sang giai \\\\u0111o\\\\u1ea1n m\\\\u1edbi s\\\\u1ebd l\\\\u1ed9 di\\\\u1ec7n nh\\\\u1eefng nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 tay m\\\\u01a1, h\\\\u1ecd l\\\\u00e0 nh\\\\u00f3m \\\\u0111\\\\u1ed1i t\\\\u01b0\\\\u1ee3ng s\\\\u1ebd b\\\\u1ecf ch\\\\u1ea1y \\\\u0111\\\\u1ea7u ti\\\\u00ean khi c\\\\u00f3 bi\\\\u1ebfn \\\\u0111\\\\u1ed9ng do t\\\\u00e2m l\\\\u00fd kh\\\\u00f4ng v\\\\u1eefng v\\\\u00e0ng\\\\u201d, anh T\\\\u00f9ng n\\\\u00f3i.<\\\\\\/p><p>Ng\\\\u01b0\\\\u1eddi n\\\\u00e0y nh\\\\u1eadn \\\\u0111\\\\u1ecbnh, th\\\\u1ef1c t\\\\u1ebf hi\\\\u1ec7n t\\\\u01b0\\\\u1ee3ng c\\\\u1eaft l\\\\u1ed7 m\\\\u1edbi ch\\\\u1ec9 di\\\\u1ec5n ra \\\\u1edf m\\\\u1ed9t b\\\\u1ed9 ph\\\\u1eadn v\\\\u00e0 ch\\\\u01b0a xu\\\\u1ea5t hi\\\\u1ec7n t\\\\u00ecnh tr\\\\u1ea1ng \\\\\\\"b\\\\u00e1n th\\\\u00e1o\\\\\\\" nh\\\\u01b0 giai \\\\u0111o\\\\u1ea1n 2009 - 2011. N\\\\u1ebfu th\\\\u1ecb tr\\\\u01b0\\\\u1eddng v\\\\u1eabn kh\\\\u00f4ng c\\\\u00f3 chuy\\\\u1ec3n bi\\\\u1ebfn m\\\\u1edbi th\\\\u00ec ch\\\\u1ec9 cu\\\\u1ed1i n\\\\u0103m 2022 - 2023 nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 \\\\u0111ang \\\\u00f4m \\\\u0111\\\\u1ea5t s\\\\u1ebd ti\\\\u1ebfp t\\\\u1ee5c g\\\\u1eb7p kh\\\\u00f3 kh\\\\u0103n.<\\\\\\/p><p>Theo \\\\u00f4ng Phan C\\\\u00f4ng Ch\\\\u00e1nh, T\\\\u1ed5ng gi\\\\u00e1m \\\\u0111\\\\u1ed1c Ph\\\\u00fa Vinh Group, c\\\\u00e2u chuy\\\\u1ec7n g\\\\u1ed3ng l\\\\u00e3i v\\\\u1edbi nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 d\\\\u00f9ng \\\\u0111\\\\u00f2n b\\\\u1ea9y t\\\\u00e0i ch\\\\u00ednh nhi\\\\u1ec1u ph\\\\u1ee5 thu\\\\u1ed9c v\\\\u00e0o ngu\\\\u1ed3n thu, b\\\\u00e0i to\\\\u00e1n t\\\\u00e0i ch\\\\u00ednh v\\\\u00e0 th\\\\u1eddi h\\\\u1ea1n \\\\u0111\\\\u1ea7u t\\\\u01b0 c\\\\u1ee7a m\\\\u1ed7i ng\\\\u01b0\\\\u1eddi. Nh\\\\u00e0 \\\\u0111\\\\u1ea7u c\\\\u01a1 l\\\\u01b0\\\\u1edbt s\\\\u00f3ng khi d\\\\u00f9ng \\\\u0111\\\\u00f2n b\\\\u1ea9y t\\\\u00e0i ch\\\\u00ednh nhi\\\\u1ec1u s\\\\u1ebd ch\\\\u1ecbu r\\\\u1ee7i ro nhi\\\\u1ec1u nh\\\\u1ea5t.<\\\\\\/p><p>Xu h\\\\u01b0\\\\u1edbng c\\\\u1eaft l\\\\u1ed7 c\\\\u00f3 th\\\\u1ec3 lan r\\\\u1ed9ng hay kh\\\\u00f4ng th\\\\u00ec hi\\\\u1ec7n t\\\\u1ea1i kh\\\\u00f3 \\\\u0111\\\\u01b0a ra d\\\\u1ef1 b\\\\u00e1o ch\\\\u00ednh x\\\\u00e1c. Nh\\\\u01b0ng s\\\\u1ebd x\\\\u1ea3y ra v\\\\u1edbi nh\\\\u1eefng ng\\\\u01b0\\\\u1eddi s\\\\u1eed d\\\\u1ee5ng \\\\u0111\\\\u00f2n b\\\\u1ea9y t\\\\u1eeb 70-80% tr\\\\u1edf l\\\\u00ean m\\\\u00e0 kh\\\\u00f4ng c\\\\u00f3 ngu\\\\u1ed3n thu \\\\u0111\\\\u1ec3 g\\\\u1ed3ng l\\\\u00e3i ti\\\\u1ebfp.<\\\\\\/p><p>Theo chuy\\\\u00ean gia b\\\\u1ea5t \\\\u0111\\\\u1ed9ng s\\\\u1ea3n Tr\\\\u1ea7n Kh\\\\u00e1nh Quang, trong b\\\\u1ed1i c\\\\u1ea3nh n\\\\u1ec1n kinh t\\\\u1ebf 2022 r\\\\u1ea5t kh\\\\u00f3 \\\\u0111o\\\\u00e1n \\\\u0111\\\\u1ecbnh th\\\\u00ec ti\\\\u00eau chu\\\\u1ea9n h\\\\u00e0ng \\\\u0111\\\\u1ea7u khi mang ti\\\\u1ec1n \\\\u0111i \\\\u0111\\\\u1ea7u t\\\\u01b0 th\\\\u1eddi gian n\\\\u00e0y l\\\\u00e0 ph\\\\u1ea3i \\\\u0111\\\\u1ea3m b\\\\u1ea3o kh\\\\u00f4ng m\\\\u1ea5t v\\\\u1ed1n, mua b\\\\u1ea5t c\\\\u1ee9 t\\\\u00e0i s\\\\u1ea3n n\\\\u00e0o c\\\\u0169ng ph\\\\u1ea3i ngh\\\\u0129 \\\\u0111\\\\u1ebfn kh\\\\u1ea3 n\\\\u0103ng b\\\\u00e1n \\\\u0111\\\\u01b0\\\\u1ee3c (t\\\\u1ee9c thu h\\\\u1ed3i v\\\\u1ed1n nhanh), sau \\\\u0111\\\\u00f3 m\\\\u1edbi x\\\\u00e9t \\\\u0111\\\\u1ebfn m\\\\u1ee5c ti\\\\u00eau l\\\\u1ee3i nhu\\\\u1eadn.<\\\\\\/p><p><a href=\\\\\\\"https:\\\\\\/\\\\\\/toquoc.vn\\\\\\/thoi-diem-thi-truong-bat-dong-san-lo-dien-nha-dau-tu-duoi-suc-20220908025519123.htm\\\\\\\">Theo Thanh Phong \\\\\\/ Nh\\\\u1ecbp s\\\\u1ed1ng kinh t\\\\u1ebf<\\\\\\/a><\\\\\\/p>\\\"},\\\"brief\\\":{\\\"vi\\\":\\\"Sau th\\\\u1eddi k\\\\u1ef3 th\\\\u1ecb tr\\\\u01b0\\\\u1eddng s\\\\u00f4i \\\\u0111\\\\u1ed9ng, \\\\u0111\\\\u1ebfn nay \\\\u0111\\\\u00e3 b\\\\u01b0\\\\u1edbc v\\\\u00e0o giai \\\\u0111o\\\\u1ea1n ch\\\\u1eefng l\\\\u1ea1i, theo \\\\u0111\\\\u00f3 nhi\\\\u1ec1u nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 d\\\\u01b0\\\\u1edbi \\\\u00e1p l\\\\u1ef1c t\\\\u00e0i ch\\\\u00ednh \\\\u0111\\\\u00e3 b\\\\u00e1n c\\\\u1eaft l\\\\u1ed7. Tuy nhi\\\\u00ean, d\\\\u00f9 l\\\\u1ed7 nh\\\\u01b0ng m\\\\u1ed9t s\\\\u1ed1 nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 v\\\\u1eabn t\\\\u1ecf ra c\\\\u00f2n may m\\\\u1eafn v\\\\u00ec \\\\u0111\\\\u00e3 b\\\\u00e1n \\\\u0111\\\\u01b0\\\\u1ee3c \\\\u0111\\\\u1ea5t.\\\"},\\\"seo_title\\\":\\\"\\\",\\\"seo_keyword\\\":\\\"\\\\u0111\\\\u1ea7u t\\\\u01b0 b\\\\u1ea5t \\\\u0111\\\\u1ed9ng, nh\\\\u00e0 \\\\u0111\\\\u1ea7u t\\\\u01b0 \\\\u0111u\\\\u1ed1i s\\\\u1ee9c, th\\\\u1ecb tr\\\\u01b0\\\\u1eddng \\\\u0111\\\\u1ecba \\\\u1ed1c ch\\\\u1eefng l\\\\u1ea1i\\\",\\\"seo_description\\\":\\\"\\\",\\\"refer\\\":null}\"', 'https://biz9.vn/upload/advertisement/kinh-doanh-bat-dong-san-la-gi-21.jpg', NULL, 'active', 'Tuệ Minh', NULL, 'thoi-diem-thi-truong-bat-dong-san-lo-dien-nha-dau-tu-duoi-suc', 0, 0, 1, 1, 0, 14, 0, '2022-10-03 15:41:00', NULL, ',1,', NULL, '', 'open', NULL, 'đầu tư bất động, nhà đầu tư đuối sức, thị trường địa ốc chững lại', NULL, NULL, 1, 1, '2022-09-29 08:21:29', '2023-02-03 03:27:50');
INSERT INTO `tb_cms_posts` (`id`, `taxonomy_id`, `is_type`, `title`, `brief`, `content`, `json_params`, `image`, `image_thumb`, `status`, `author`, `url_coppy`, `url_part`, `torder`, `iorder`, `news_position`, `number_like`, `number_comment`, `number_view`, `nhuanbut`, `aproved_date`, `rating`, `category`, `cms_tag`, `relation`, `comment_status`, `seo_title`, `seo_keyword`, `seo_description`, `user_id`, `admin_updated_id`, `admin_created_id`, `created_at`, `updated_at`) VALUES
(612, 1, 'post', 'TP Hồ Chí Minh: Sập sàn công trình xây dựng tại dự án The Metropole Thủ Thiêm', 'Khu thương mại dịch vụ kết hợp nhà ở cao tầng tại lô đất số 1 – 13, khu chức năng số 1, khu đô thị mới Thủ Thiêm, phường Thủ Thiêm, TP Thủ Đức đang triển khai xây dựng ở tầng cao thì bất ngờ bị sập sàn.', '<figure class=\"image\"><img src=\"/ckfinder/userfiles/The-Metropole-Thu%CC%89-Thie%CC%82m-1(1).jpeg\" />\r\n<figcaption><span style=\"background-color:rgb(255,255,255);color:rgb(51,48,46);\"><i>Dự án The Metropole Thủ Thiêm do nhà thầu Công ty Cổ phần Xây dựng CenTral (số 204/9 đường Nguyễn Văn Hưởng, phường Thảo Điền, TP Thủ Đức, TP Hồ Chí Minh xây dựng. Ảnh centralcons.vn</i></span></figcaption>\r\n</figure>\r\n\r\n<p>Cụ thể, chiều ngày 11/9/2022 trên mạng xã hội Facebook xuất hiện clip một công trình xây dựng đang đổ bê tông thì bất ngờ bị sập sàn trước sự chứng kiến của nhiều công nhân. Theo cảnh quay trong clip, công trình xây dựng này đang được thi công ở tầng cao.</p>\r\n\r\n<figure class=\"image\"><img src=\"/ckfinder/userfiles/The-Metropole-Thu%CC%89-Thie%CC%82m2(1).jpeg\" />\r\n<figcaption><span style=\"background-color:rgb(255,255,255);color:rgb(51,48,46);\"><i>Bảng thông tin dự án The Metropole Thủ Thiêm.</i></span></figcaption>\r\n</figure>\r\n\r\n<p>Được biết, nơi xảy ra sự cố sập sàn là dự án The Metropole Thủ Thiêm (Khu thương mại dịch vụ kết hợp nhà ở cao tầng tại lô đất số 1 – 13, khu chức năng số 1, khu đô thị mới Thủ Thiêm, phường Thủ Thiêm, TP Thủ Đức) do Công ty Cổ phần Quốc Lộc Phát làm chủ đầu tư, đơn vị phát triển là Sơn Kim Land (53 - 55 Nguyễn Đình Chiểu, phường 6, quận 3, TP Hồ Chí Minh). Theo quảng cáo, The Metropole Thủ Thiêm có quy mô 3 tháp, căn hộ cao cấp 24 – 28 tầng cao, giá bán căn hộ tại dự ánThe Metropole Thủ Thiêm dao động trong khoảng 4.000 – 8.000USD/m2.</p>\r\n\r\n<figure class=\"image\"><img src=\"/ckfinder/userfiles/The-Metropole-Thu%CC%89-Thie%CC%82m3.jpeg\" />\r\n<figcaption><span style=\"background-color:rgb(255,255,255);color:rgb(51,48,46);\"><i>Hình ảnh cắt từ clip về sự cố sập sàn.</i></span></figcaption>\r\n</figure>\r\n\r\n<p>Trao đổi với báo chí, đại diện nhà thầu Công ty Cổ phần Xây dựng CenTral (số 204/9 đường Nguyễn Văn Hưởng, phường Thảo Điền, TP Thủ Đức, TP Hồ Chí Minh) xác nhận có sự việc nêu trên, hiện ban giám đốc công ty đang làm việc với chủ đầu tư. PV tiếp tục đặt câu hỏi về sự cố sập sàn có gây ảnh hưởng đến tính mạng người lao đông hay không thì đại diện công ty CenTral không trả lời.</p>\r\n\r\n<blockquote>\r\n<p>Khu phức hợp Sóng Việt (tên thương mại là The Metropole Thủ Thiêm) là dự án nằm trong Khu đô thị mới Thủ Thiêm, (phường An Khánh, Quận 2, TP Hồ Chí Minh) có diện tích khu đất khoảng 7,6 ha, tổng mức đầu tư dự kiến 7.300 tỷ đồng. Chủ đầu tư là Công ty Quốc Lộc Phát với cổ đông lớn là Keppel Land (Singapore) được TP Hồ Chí Minh giao dự án này từ năm 2017. Sau đó, Keppel Land thoái vốn khỏi dự án và SonKim Land xuất hiện với vai trò nhà phát triển dự án từ giữa năm 2018.</p>\r\n\r\n<p>Tại thông báo Kết luận thanh tra về công tác quản lý Nhà nước và thực hiện pháp luật trong quy hoạch, quản lý xây dựng, đất đai tại Khu đô thị mới Thủ Thiêm số 1041/TB-TTCP ngày 26/6/2019, Thanh tra Chính phủ đã chỉ ra hàng loạt sai phạm đối với các dự án giao đất có thu tiền sử dụng đất, trong đó có dự án The Metropole Thủ Thiêm.</p>\r\n\r\n<p>Cụ thể, kết luận cũng nêu rõ, đối với các dự án giao đất có thu tiền sử dụng đất thì, các dự án Khu Phức hợp Tháp Quan Sát và Khu phức hợp Sóng Việt được UBND TP Hồ Chí Minh chỉ định nhà đầu tư nhưng không thực hiện đấu giá quyền sử dụng đất.</p>\r\n\r\n<p>Tại hai dự án này, UBND TP Hồ Chí Minh đã tính và thu tiền sử dụng đất của chủ đầu tư, trong đó việc xác định tiền sử dụng đất tại một số lô đất với đơn giá 26 triệu đồng/m2 (bằng chi phí đầu tư bình quân) là không đúng quy định. Theo đó, cần phải được xem xét, xác định lại giá đất để truy thu, tránh thiệt hại cho ngân sách Nhà nước.</p>\r\n\r\n<p>Đầu năm 2020, Sở Xây dựng TP Hồ Chí Minh có văn bản chấp thuận cho Công ty Cổ phần Quốc Lộc Phát đủ điều kiện được ký hợp đồng bán nhà ở hình thành trong tương lai. Theo đó, 456 căn hộ thuộc Chung cư cao tầng tại lô đất 1-16 thuộc dự án Khu phức hợp Sóng Việt tại Khu chức năng số 1 trong Khu đô thị mới Thủ Thiêm đã đủ điều kiện mở bán.</p>\r\n\r\n<p>Tuy nhiên, The Metropole Thủ Thiêm có tổng chi phí thực hiện ước tính khoảng 7.273 tỷ đồng, trên diện tích khoảng 75.965 m2 gồm 4 lô đất cạnh sông Sài Gòn. Khi mở bán, một số vị trí, giá cho mỗi m2 lên tới 7.900 USD. Như vậy thì con số 7.273 tỷ đồng trên hiện khó mua nổi 1 tòa tháp tại The Metropole Thủ Thiêm.</p>\r\n\r\n<p>Theo tìm hiểu, Công ty CP Quốc Lộc Phát chỉ mới bắt đầu hoạt động từ tháng 9/2014, có vốn điều lệ 1.500 tỷ đồng, trụ sở tại số 19, đường 31B, khu phố 5, phường An Phú, Quận 2, TP Hồ Chí Minh. Người đại diện pháp luật là ông Phạm Quang Hưng và Lim Kok Siang.</p>\r\n\r\n<p>Sau đó, ngày 8/10/2017, Công ty CP Quốc Lộc Phát cùng Sơn Kim Land thành lập CTCP Đầu tư TTSV - chủ đầu tư dự án The Metropole Thủ Thiêm có trụ sở tại số 30 đường số 11, Phường Thảo Điền, Quận 2, TP Hồ Chí Minh. Do ông Phạm Minh Trung làm đại diện theo pháp luật.</p>\r\n\r\n<p>Khi mở bán, một số vị trí The Metropole Thủ Thiêm có giá cho mỗi m2 lên tới 7.900 USD</p>\r\n\r\n<p>Đến giữa năm 2018, Quốc Lộc Phát cùng Sơn Kim Land đã ký kết thỏa thuận hợp tác chiến lược, khởi động Dự án The Metropole Thủ Thiêm tại Khu đô thị mới Thủ Thiêm, Quận 2, TP Hồ Chí Minh.</p>\r\n\r\n<p>Vào giữa năm 2021, mạng lưới các doanh nghiệp liên quan đến chủ đầu tư của dự án The Metropole Thủ Thiêm dần \"sáng tỏ\". Theo đó, Công ty CP Địa ốc Phúc Đạt thông báo huy động thành công 1.000 tỷ đồng trái phiếu với kỳ hạn 48 tháng. Đơn vị thu xếp phát hành lô trái phiếu này là Công ty Chứng khoán Tiên Phong (TPBS) và Ngân hàng Tiên Phong (TPBank) là bên nhận tài sản bảo đảm.</p>\r\n\r\n<p>Theo thông báo gửi HNX, Phúc Đạt Land cho biết toàn bộ số tiền thu được từ việc phát hành trái phiếu được sử dụng để mua phần vốn góp tại Công ty TNHH Gateway Berkeley. Đây là công ty nắm giữ 99,9% vốn điều lệ của Công ty TNHH Đầu tư TTSV. Trong khi đó, TTSV nắm giữ 78 triệu cổ phần của Quốc Lộc Phát. Tài sản bảo đảm của lô trái phiếu cũng là quyền sử dụng đất của Công ty Quốc Lộc Phát có diện tích 11.369 m2 (tại lô đất số 1-17) thuộc dự án phát triển Khu phức hợp Sóng Việt.</p>\r\n\r\n<p>Trên thực tế, Công ty Phúc Đạt và Gateway Berkeley, đều có mối quan hệ mật thiết với Sơn Kim Land – đơn vị đóng vai trò nhà phát triển dự án The Metropole Thủ Thiêm. Người đại diện theo pháp luật của cả Phúc Đạt Land và Gateway Berkeley hiện nay là ông Han Suk Jung, người Hàn Quốc. Ông Han là Tổng giám đốc của Sơn Kim Land đồng thời là lãnh đạo một loạt các công ty khác thuộc SonKim Group như Serenity Sky Villas, Highgate...</p>\r\n\r\n<p>&nbsp;</p>\r\n</blockquote>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style=\"text-align:right;\">Theo <span style=\"background-color:rgb(255,255,255);color:rgb(51,48,46);\"><strong>Nhất Tâm - Hà My/Doanh nghiệp Việt Nam</strong></span><a href=\"https://doanhnghiepvn.vn/kinh-te/bat-dong-san/tp-ho-chi-minh-sap-san-cong-trinh-xay-dung-tai-du-an-the-metropole-thu-thiem/20220912060513299\"><span style=\"background-color:rgb(255,255,255);color:rgb(51,48,46);\"><strong> </strong>Copy</span></a></p>', '{\"content\":{\"vi\":\"<figure class=\\\"image\\\"><img src=\\\"\\/ckfinder\\/userfiles\\/The-Metropole-Thu%CC%89-Thie%CC%82m-1(1).jpeg\\\" \\/>\\r\\n<figcaption><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,48,46);\\\"><i>D\\u1ef1 \\u00e1n The Metropole Th\\u1ee7 Thi\\u00eam do nh\\u00e0 th\\u1ea7u C\\u00f4ng ty C\\u1ed5 ph\\u1ea7n X\\u00e2y d\\u1ef1ng CenTral (s\\u1ed1 204\\/9 \\u0111\\u01b0\\u1eddng Nguy\\u1ec5n V\\u0103n H\\u01b0\\u1edfng, ph\\u01b0\\u1eddng Th\\u1ea3o \\u0110i\\u1ec1n, TP Th\\u1ee7 \\u0110\\u1ee9c, TP H\\u1ed3 Ch\\u00ed Minh x\\u00e2y d\\u1ef1ng. \\u1ea2nh centralcons.vn<\\/i><\\/span><\\/figcaption>\\r\\n<\\/figure>\\r\\n\\r\\n<p>C\\u1ee5 th\\u1ec3, chi\\u1ec1u ng\\u00e0y 11\\/9\\/2022 tr\\u00ean m\\u1ea1ng x\\u00e3 h\\u1ed9i Facebook xu\\u1ea5t hi\\u1ec7n clip m\\u1ed9t c\\u00f4ng tr\\u00ecnh x\\u00e2y d\\u1ef1ng \\u0111ang \\u0111\\u1ed5 b\\u00ea t\\u00f4ng th\\u00ec b\\u1ea5t ng\\u1edd b\\u1ecb s\\u1eadp s\\u00e0n tr\\u01b0\\u1edbc s\\u1ef1 ch\\u1ee9ng ki\\u1ebfn c\\u1ee7a nhi\\u1ec1u c\\u00f4ng nh\\u00e2n. Theo c\\u1ea3nh quay trong clip, c\\u00f4ng tr\\u00ecnh x\\u00e2y d\\u1ef1ng n\\u00e0y \\u0111ang \\u0111\\u01b0\\u1ee3c thi c\\u00f4ng \\u1edf t\\u1ea7ng cao.<\\/p>\\r\\n\\r\\n<figure class=\\\"image\\\"><img src=\\\"\\/ckfinder\\/userfiles\\/The-Metropole-Thu%CC%89-Thie%CC%82m2(1).jpeg\\\" \\/>\\r\\n<figcaption><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,48,46);\\\"><i>B\\u1ea3ng th\\u00f4ng tin d\\u1ef1 \\u00e1n The Metropole Th\\u1ee7 Thi\\u00eam.<\\/i><\\/span><\\/figcaption>\\r\\n<\\/figure>\\r\\n\\r\\n<p>\\u0110\\u01b0\\u1ee3c bi\\u1ebft, n\\u01a1i x\\u1ea3y ra s\\u1ef1 c\\u1ed1 s\\u1eadp s\\u00e0n l\\u00e0 d\\u1ef1 \\u00e1n The Metropole Th\\u1ee7 Thi\\u00eam (Khu th\\u01b0\\u01a1ng m\\u1ea1i d\\u1ecbch v\\u1ee5 k\\u1ebft h\\u1ee3p nh\\u00e0 \\u1edf cao t\\u1ea7ng t\\u1ea1i l\\u00f4 \\u0111\\u1ea5t s\\u1ed1 1 \\u2013 13, khu ch\\u1ee9c n\\u0103ng s\\u1ed1 1, khu \\u0111\\u00f4 th\\u1ecb m\\u1edbi Th\\u1ee7 Thi\\u00eam, ph\\u01b0\\u1eddng Th\\u1ee7 Thi\\u00eam, TP Th\\u1ee7 \\u0110\\u1ee9c) do C\\u00f4ng ty C\\u1ed5 ph\\u1ea7n Qu\\u1ed1c L\\u1ed9c Ph\\u00e1t l\\u00e0m ch\\u1ee7 \\u0111\\u1ea7u t\\u01b0, \\u0111\\u01a1n v\\u1ecb ph\\u00e1t tri\\u1ec3n l\\u00e0 S\\u01a1n Kim Land (53 - 55 Nguy\\u1ec5n \\u0110\\u00ecnh Chi\\u1ec3u, ph\\u01b0\\u1eddng 6, qu\\u1eadn 3, TP H\\u1ed3 Ch\\u00ed Minh). Theo qu\\u1ea3ng c\\u00e1o, The Metropole Th\\u1ee7 Thi\\u00eam c\\u00f3 quy m\\u00f4 3 th\\u00e1p, c\\u0103n h\\u1ed9 cao c\\u1ea5p 24 \\u2013 28 t\\u1ea7ng cao, gi\\u00e1 b\\u00e1n c\\u0103n h\\u1ed9 t\\u1ea1i d\\u1ef1 \\u00e1nThe Metropole Th\\u1ee7 Thi\\u00eam dao \\u0111\\u1ed9ng trong kho\\u1ea3ng 4.000 \\u2013 8.000USD\\/m2.<\\/p>\\r\\n\\r\\n<figure class=\\\"image\\\"><img src=\\\"\\/ckfinder\\/userfiles\\/The-Metropole-Thu%CC%89-Thie%CC%82m3.jpeg\\\" \\/>\\r\\n<figcaption><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,48,46);\\\"><i>H\\u00ecnh \\u1ea3nh c\\u1eaft t\\u1eeb clip v\\u1ec1 s\\u1ef1 c\\u1ed1 s\\u1eadp s\\u00e0n.<\\/i><\\/span><\\/figcaption>\\r\\n<\\/figure>\\r\\n\\r\\n<p>Trao \\u0111\\u1ed5i v\\u1edbi b\\u00e1o ch\\u00ed, \\u0111\\u1ea1i di\\u1ec7n nh\\u00e0 th\\u1ea7u C\\u00f4ng ty C\\u1ed5 ph\\u1ea7n X\\u00e2y d\\u1ef1ng CenTral (s\\u1ed1 204\\/9 \\u0111\\u01b0\\u1eddng Nguy\\u1ec5n V\\u0103n H\\u01b0\\u1edfng, ph\\u01b0\\u1eddng Th\\u1ea3o \\u0110i\\u1ec1n, TP Th\\u1ee7 \\u0110\\u1ee9c, TP H\\u1ed3 Ch\\u00ed Minh) x\\u00e1c nh\\u1eadn c\\u00f3 s\\u1ef1 vi\\u1ec7c n\\u00eau tr\\u00ean, hi\\u1ec7n ban gi\\u00e1m \\u0111\\u1ed1c c\\u00f4ng ty \\u0111ang l\\u00e0m vi\\u1ec7c v\\u1edbi ch\\u1ee7 \\u0111\\u1ea7u t\\u01b0. PV ti\\u1ebfp t\\u1ee5c \\u0111\\u1eb7t c\\u00e2u h\\u1ecfi v\\u1ec1 s\\u1ef1 c\\u1ed1 s\\u1eadp s\\u00e0n c\\u00f3 g\\u00e2y \\u1ea3nh h\\u01b0\\u1edfng \\u0111\\u1ebfn t\\u00ednh m\\u1ea1ng ng\\u01b0\\u1eddi lao \\u0111\\u00f4ng hay kh\\u00f4ng th\\u00ec \\u0111\\u1ea1i di\\u1ec7n c\\u00f4ng ty CenTral kh\\u00f4ng tr\\u1ea3 l\\u1eddi.<\\/p>\\r\\n\\r\\n<blockquote>\\r\\n<p>Khu ph\\u1ee9c h\\u1ee3p S\\u00f3ng Vi\\u1ec7t (t\\u00ean th\\u01b0\\u01a1ng m\\u1ea1i l\\u00e0 The Metropole Th\\u1ee7 Thi\\u00eam) l\\u00e0 d\\u1ef1 \\u00e1n n\\u1eb1m trong Khu \\u0111\\u00f4 th\\u1ecb m\\u1edbi Th\\u1ee7 Thi\\u00eam, (ph\\u01b0\\u1eddng An Kh\\u00e1nh, Qu\\u1eadn 2, TP H\\u1ed3 Ch\\u00ed Minh) c\\u00f3 di\\u1ec7n t\\u00edch khu \\u0111\\u1ea5t kho\\u1ea3ng 7,6 ha, t\\u1ed5ng m\\u1ee9c \\u0111\\u1ea7u t\\u01b0 d\\u1ef1 ki\\u1ebfn 7.300 t\\u1ef7 \\u0111\\u1ed3ng. Ch\\u1ee7 \\u0111\\u1ea7u t\\u01b0 l\\u00e0 C\\u00f4ng ty Qu\\u1ed1c L\\u1ed9c Ph\\u00e1t v\\u1edbi c\\u1ed5 \\u0111\\u00f4ng l\\u1edbn l\\u00e0 Keppel Land (Singapore) \\u0111\\u01b0\\u1ee3c TP H\\u1ed3 Ch\\u00ed Minh giao d\\u1ef1 \\u00e1n n\\u00e0y t\\u1eeb n\\u0103m 2017. Sau \\u0111\\u00f3, Keppel Land tho\\u00e1i v\\u1ed1n kh\\u1ecfi d\\u1ef1 \\u00e1n v\\u00e0 SonKim Land xu\\u1ea5t hi\\u1ec7n v\\u1edbi vai tr\\u00f2 nh\\u00e0 ph\\u00e1t tri\\u1ec3n d\\u1ef1 \\u00e1n t\\u1eeb gi\\u1eefa n\\u0103m 2018.<\\/p>\\r\\n\\r\\n<p>T\\u1ea1i th\\u00f4ng b\\u00e1o K\\u1ebft lu\\u1eadn thanh tra v\\u1ec1 c\\u00f4ng t\\u00e1c qu\\u1ea3n l\\u00fd Nh\\u00e0 n\\u01b0\\u1edbc v\\u00e0 th\\u1ef1c hi\\u1ec7n ph\\u00e1p lu\\u1eadt trong quy ho\\u1ea1ch, qu\\u1ea3n l\\u00fd x\\u00e2y d\\u1ef1ng, \\u0111\\u1ea5t \\u0111ai t\\u1ea1i Khu \\u0111\\u00f4 th\\u1ecb m\\u1edbi Th\\u1ee7 Thi\\u00eam s\\u1ed1 1041\\/TB-TTCP ng\\u00e0y 26\\/6\\/2019, Thanh tra Ch\\u00ednh ph\\u1ee7 \\u0111\\u00e3 ch\\u1ec9 ra h\\u00e0ng lo\\u1ea1t sai ph\\u1ea1m \\u0111\\u1ed1i v\\u1edbi c\\u00e1c d\\u1ef1 \\u00e1n giao \\u0111\\u1ea5t c\\u00f3 thu ti\\u1ec1n s\\u1eed d\\u1ee5ng \\u0111\\u1ea5t, trong \\u0111\\u00f3 c\\u00f3 d\\u1ef1 \\u00e1n The Metropole Th\\u1ee7 Thi\\u00eam.<\\/p>\\r\\n\\r\\n<p>C\\u1ee5 th\\u1ec3, k\\u1ebft lu\\u1eadn c\\u0169ng n\\u00eau r\\u00f5, \\u0111\\u1ed1i v\\u1edbi c\\u00e1c d\\u1ef1 \\u00e1n giao \\u0111\\u1ea5t c\\u00f3 thu ti\\u1ec1n s\\u1eed d\\u1ee5ng \\u0111\\u1ea5t th\\u00ec, c\\u00e1c d\\u1ef1 \\u00e1n Khu Ph\\u1ee9c h\\u1ee3p Th\\u00e1p Quan S\\u00e1t v\\u00e0 Khu ph\\u1ee9c h\\u1ee3p S\\u00f3ng Vi\\u1ec7t \\u0111\\u01b0\\u1ee3c UBND TP H\\u1ed3 Ch\\u00ed Minh ch\\u1ec9 \\u0111\\u1ecbnh nh\\u00e0 \\u0111\\u1ea7u t\\u01b0 nh\\u01b0ng kh\\u00f4ng th\\u1ef1c hi\\u1ec7n \\u0111\\u1ea5u gi\\u00e1 quy\\u1ec1n s\\u1eed d\\u1ee5ng \\u0111\\u1ea5t.<\\/p>\\r\\n\\r\\n<p>T\\u1ea1i hai d\\u1ef1 \\u00e1n n\\u00e0y, UBND TP H\\u1ed3 Ch\\u00ed Minh \\u0111\\u00e3 t\\u00ednh v\\u00e0 thu ti\\u1ec1n s\\u1eed d\\u1ee5ng \\u0111\\u1ea5t c\\u1ee7a ch\\u1ee7 \\u0111\\u1ea7u t\\u01b0, trong \\u0111\\u00f3 vi\\u1ec7c x\\u00e1c \\u0111\\u1ecbnh ti\\u1ec1n s\\u1eed d\\u1ee5ng \\u0111\\u1ea5t t\\u1ea1i m\\u1ed9t s\\u1ed1 l\\u00f4 \\u0111\\u1ea5t v\\u1edbi \\u0111\\u01a1n gi\\u00e1 26 tri\\u1ec7u \\u0111\\u1ed3ng\\/m2 (b\\u1eb1ng chi ph\\u00ed \\u0111\\u1ea7u t\\u01b0 b\\u00ecnh qu\\u00e2n) l\\u00e0 kh\\u00f4ng \\u0111\\u00fang quy \\u0111\\u1ecbnh. Theo \\u0111\\u00f3, c\\u1ea7n ph\\u1ea3i \\u0111\\u01b0\\u1ee3c xem x\\u00e9t, x\\u00e1c \\u0111\\u1ecbnh l\\u1ea1i gi\\u00e1 \\u0111\\u1ea5t \\u0111\\u1ec3 truy thu, tr\\u00e1nh thi\\u1ec7t h\\u1ea1i cho ng\\u00e2n s\\u00e1ch Nh\\u00e0 n\\u01b0\\u1edbc.<\\/p>\\r\\n\\r\\n<p>\\u0110\\u1ea7u n\\u0103m 2020, S\\u1edf X\\u00e2y d\\u1ef1ng TP H\\u1ed3 Ch\\u00ed Minh c\\u00f3 v\\u0103n b\\u1ea3n ch\\u1ea5p thu\\u1eadn cho C\\u00f4ng ty C\\u1ed5 ph\\u1ea7n Qu\\u1ed1c L\\u1ed9c Ph\\u00e1t \\u0111\\u1ee7 \\u0111i\\u1ec1u ki\\u1ec7n \\u0111\\u01b0\\u1ee3c k\\u00fd h\\u1ee3p \\u0111\\u1ed3ng b\\u00e1n nh\\u00e0 \\u1edf h\\u00ecnh th\\u00e0nh trong t\\u01b0\\u01a1ng lai. Theo \\u0111\\u00f3, 456 c\\u0103n h\\u1ed9 thu\\u1ed9c Chung c\\u01b0 cao t\\u1ea7ng t\\u1ea1i l\\u00f4 \\u0111\\u1ea5t 1-16 thu\\u1ed9c d\\u1ef1 \\u00e1n Khu ph\\u1ee9c h\\u1ee3p S\\u00f3ng Vi\\u1ec7t t\\u1ea1i Khu ch\\u1ee9c n\\u0103ng s\\u1ed1 1 trong Khu \\u0111\\u00f4 th\\u1ecb m\\u1edbi Th\\u1ee7 Thi\\u00eam \\u0111\\u00e3 \\u0111\\u1ee7 \\u0111i\\u1ec1u ki\\u1ec7n m\\u1edf b\\u00e1n.<\\/p>\\r\\n\\r\\n<p>Tuy nhi\\u00ean, The Metropole Th\\u1ee7 Thi\\u00eam c\\u00f3 t\\u1ed5ng chi ph\\u00ed th\\u1ef1c hi\\u1ec7n \\u01b0\\u1edbc t\\u00ednh kho\\u1ea3ng 7.273 t\\u1ef7 \\u0111\\u1ed3ng, tr\\u00ean di\\u1ec7n t\\u00edch kho\\u1ea3ng 75.965 m2 g\\u1ed3m 4 l\\u00f4 \\u0111\\u1ea5t c\\u1ea1nh s\\u00f4ng S\\u00e0i G\\u00f2n. Khi m\\u1edf b\\u00e1n, m\\u1ed9t s\\u1ed1 v\\u1ecb tr\\u00ed, gi\\u00e1 cho m\\u1ed7i m2 l\\u00ean t\\u1edbi 7.900 USD. Nh\\u01b0 v\\u1eady th\\u00ec con s\\u1ed1 7.273 t\\u1ef7 \\u0111\\u1ed3ng tr\\u00ean hi\\u1ec7n kh\\u00f3 mua n\\u1ed5i 1 t\\u00f2a th\\u00e1p t\\u1ea1i The Metropole Th\\u1ee7 Thi\\u00eam.<\\/p>\\r\\n\\r\\n<p>Theo t\\u00ecm hi\\u1ec3u, C\\u00f4ng ty CP Qu\\u1ed1c L\\u1ed9c Ph\\u00e1t ch\\u1ec9 m\\u1edbi b\\u1eaft \\u0111\\u1ea7u ho\\u1ea1t \\u0111\\u1ed9ng t\\u1eeb th\\u00e1ng 9\\/2014, c\\u00f3 v\\u1ed1n \\u0111i\\u1ec1u l\\u1ec7 1.500 t\\u1ef7 \\u0111\\u1ed3ng, tr\\u1ee5 s\\u1edf t\\u1ea1i s\\u1ed1 19, \\u0111\\u01b0\\u1eddng 31B, khu ph\\u1ed1 5, ph\\u01b0\\u1eddng An Ph\\u00fa, Qu\\u1eadn 2, TP H\\u1ed3 Ch\\u00ed Minh. Ng\\u01b0\\u1eddi \\u0111\\u1ea1i di\\u1ec7n ph\\u00e1p lu\\u1eadt l\\u00e0 \\u00f4ng Ph\\u1ea1m Quang H\\u01b0ng v\\u00e0 Lim Kok Siang.<\\/p>\\r\\n\\r\\n<p>Sau \\u0111\\u00f3, ng\\u00e0y 8\\/10\\/2017, C\\u00f4ng ty CP Qu\\u1ed1c L\\u1ed9c Ph\\u00e1t c\\u00f9ng S\\u01a1n Kim Land th\\u00e0nh l\\u1eadp CTCP \\u0110\\u1ea7u t\\u01b0 TTSV - ch\\u1ee7 \\u0111\\u1ea7u t\\u01b0 d\\u1ef1 \\u00e1n The Metropole Th\\u1ee7 Thi\\u00eam c\\u00f3 tr\\u1ee5 s\\u1edf t\\u1ea1i s\\u1ed1 30 \\u0111\\u01b0\\u1eddng s\\u1ed1 11, Ph\\u01b0\\u1eddng Th\\u1ea3o \\u0110i\\u1ec1n, Qu\\u1eadn 2, TP H\\u1ed3 Ch\\u00ed Minh. Do \\u00f4ng Ph\\u1ea1m Minh Trung l\\u00e0m \\u0111\\u1ea1i di\\u1ec7n theo ph\\u00e1p lu\\u1eadt.<\\/p>\\r\\n\\r\\n<p>Khi m\\u1edf b\\u00e1n, m\\u1ed9t s\\u1ed1 v\\u1ecb tr\\u00ed The Metropole Th\\u1ee7 Thi\\u00eam c\\u00f3 gi\\u00e1 cho m\\u1ed7i m2 l\\u00ean t\\u1edbi 7.900 USD<\\/p>\\r\\n\\r\\n<p>\\u0110\\u1ebfn gi\\u1eefa n\\u0103m 2018, Qu\\u1ed1c L\\u1ed9c Ph\\u00e1t c\\u00f9ng S\\u01a1n Kim Land \\u0111\\u00e3 k\\u00fd k\\u1ebft th\\u1ecfa thu\\u1eadn h\\u1ee3p t\\u00e1c chi\\u1ebfn l\\u01b0\\u1ee3c, kh\\u1edfi \\u0111\\u1ed9ng D\\u1ef1 \\u00e1n The Metropole Th\\u1ee7 Thi\\u00eam t\\u1ea1i Khu \\u0111\\u00f4 th\\u1ecb m\\u1edbi Th\\u1ee7 Thi\\u00eam, Qu\\u1eadn 2, TP H\\u1ed3 Ch\\u00ed Minh.<\\/p>\\r\\n\\r\\n<p>V\\u00e0o gi\\u1eefa n\\u0103m 2021, m\\u1ea1ng l\\u01b0\\u1edbi c\\u00e1c doanh nghi\\u1ec7p li\\u00ean quan \\u0111\\u1ebfn ch\\u1ee7 \\u0111\\u1ea7u t\\u01b0 c\\u1ee7a d\\u1ef1 \\u00e1n The Metropole Th\\u1ee7 Thi\\u00eam d\\u1ea7n \\\"s\\u00e1ng t\\u1ecf\\\". Theo \\u0111\\u00f3, C\\u00f4ng ty CP \\u0110\\u1ecba \\u1ed1c Ph\\u00fac \\u0110\\u1ea1t th\\u00f4ng b\\u00e1o huy \\u0111\\u1ed9ng th\\u00e0nh c\\u00f4ng 1.000 t\\u1ef7 \\u0111\\u1ed3ng tr\\u00e1i phi\\u1ebfu v\\u1edbi k\\u1ef3 h\\u1ea1n 48 th\\u00e1ng. \\u0110\\u01a1n v\\u1ecb thu x\\u1ebfp ph\\u00e1t h\\u00e0nh l\\u00f4 tr\\u00e1i phi\\u1ebfu n\\u00e0y l\\u00e0 C\\u00f4ng ty Ch\\u1ee9ng kho\\u00e1n Ti\\u00ean Phong (TPBS) v\\u00e0 Ng\\u00e2n h\\u00e0ng Ti\\u00ean Phong (TPBank) l\\u00e0 b\\u00ean nh\\u1eadn t\\u00e0i s\\u1ea3n b\\u1ea3o \\u0111\\u1ea3m.<\\/p>\\r\\n\\r\\n<p>Theo th\\u00f4ng b\\u00e1o g\\u1eedi HNX, Ph\\u00fac \\u0110\\u1ea1t Land cho bi\\u1ebft to\\u00e0n b\\u1ed9 s\\u1ed1 ti\\u1ec1n thu \\u0111\\u01b0\\u1ee3c t\\u1eeb vi\\u1ec7c ph\\u00e1t h\\u00e0nh tr\\u00e1i phi\\u1ebfu \\u0111\\u01b0\\u1ee3c s\\u1eed d\\u1ee5ng \\u0111\\u1ec3 mua ph\\u1ea7n v\\u1ed1n g\\u00f3p t\\u1ea1i C\\u00f4ng ty TNHH Gateway Berkeley. \\u0110\\u00e2y l\\u00e0 c\\u00f4ng ty n\\u1eafm gi\\u1eef 99,9% v\\u1ed1n \\u0111i\\u1ec1u l\\u1ec7 c\\u1ee7a C\\u00f4ng ty TNHH \\u0110\\u1ea7u t\\u01b0 TTSV. Trong khi \\u0111\\u00f3, TTSV n\\u1eafm gi\\u1eef 78 tri\\u1ec7u c\\u1ed5 ph\\u1ea7n c\\u1ee7a Qu\\u1ed1c L\\u1ed9c Ph\\u00e1t. T\\u00e0i s\\u1ea3n b\\u1ea3o \\u0111\\u1ea3m c\\u1ee7a l\\u00f4 tr\\u00e1i phi\\u1ebfu c\\u0169ng l\\u00e0 quy\\u1ec1n s\\u1eed d\\u1ee5ng \\u0111\\u1ea5t c\\u1ee7a C\\u00f4ng ty Qu\\u1ed1c L\\u1ed9c Ph\\u00e1t c\\u00f3 di\\u1ec7n t\\u00edch 11.369 m2 (t\\u1ea1i l\\u00f4 \\u0111\\u1ea5t s\\u1ed1 1-17) thu\\u1ed9c d\\u1ef1 \\u00e1n ph\\u00e1t tri\\u1ec3n Khu ph\\u1ee9c h\\u1ee3p S\\u00f3ng Vi\\u1ec7t.<\\/p>\\r\\n\\r\\n<p>Tr\\u00ean th\\u1ef1c t\\u1ebf, C\\u00f4ng ty Ph\\u00fac \\u0110\\u1ea1t v\\u00e0 Gateway Berkeley, \\u0111\\u1ec1u c\\u00f3 m\\u1ed1i quan h\\u1ec7 m\\u1eadt thi\\u1ebft v\\u1edbi S\\u01a1n Kim Land \\u2013 \\u0111\\u01a1n v\\u1ecb \\u0111\\u00f3ng vai tr\\u00f2 nh\\u00e0 ph\\u00e1t tri\\u1ec3n d\\u1ef1 \\u00e1n The Metropole Th\\u1ee7 Thi\\u00eam. Ng\\u01b0\\u1eddi \\u0111\\u1ea1i di\\u1ec7n theo ph\\u00e1p lu\\u1eadt c\\u1ee7a c\\u1ea3 Ph\\u00fac \\u0110\\u1ea1t Land v\\u00e0 Gateway Berkeley hi\\u1ec7n nay l\\u00e0 \\u00f4ng Han Suk Jung, ng\\u01b0\\u1eddi H\\u00e0n Qu\\u1ed1c. \\u00d4ng Han l\\u00e0 T\\u1ed5ng gi\\u00e1m \\u0111\\u1ed1c c\\u1ee7a S\\u01a1n Kim Land \\u0111\\u1ed3ng th\\u1eddi l\\u00e0 l\\u00e3nh \\u0111\\u1ea1o m\\u1ed9t lo\\u1ea1t c\\u00e1c c\\u00f4ng ty kh\\u00e1c thu\\u1ed9c SonKim Group nh\\u01b0 Serenity Sky Villas, Highgate...<\\/p>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n<\\/blockquote>\\r\\n\\r\\n<p>&nbsp;<\\/p>\\r\\n\\r\\n<p style=\\\"text-align:right;\\\">Theo <span style=\\\"background-color:rgb(255,255,255);color:rgb(51,48,46);\\\"><strong>Nh\\u1ea5t T\\u00e2m - H\\u00e0 My\\/Doanh nghi\\u1ec7p Vi\\u1ec7t Nam<\\/strong><\\/span><a href=\\\"https:\\/\\/doanhnghiepvn.vn\\/kinh-te\\/bat-dong-san\\/tp-ho-chi-minh-sap-san-cong-trinh-xay-dung-tai-du-an-the-metropole-thu-thiem\\/20220912060513299\\\"><span style=\\\"background-color:rgb(255,255,255);color:rgb(51,48,46);\\\"><strong> <\\/strong>Copy<\\/span><\\/a><\\/p>\"},\"seo_title\":\"TP H\\u1ed3 Ch\\u00ed Minh: S\\u00e2\\u0323p sa\\u0300n c\\u00f4ng tr\\u00ecnh x\\u00e2y d\\u1ef1ng t\\u1ea1i d\\u1ef1 \\u00e1n The Metropole Th\\u1ee7 Thi\\u00eam\",\"seo_keyword\":\"thi c\\u00f4ng d\\u1ef1 \\u00e1n The Metropole Th\\u1ee7 Thi\\u00eam,The Metropole Th\\u1ee7 Thi\\u00eam, s\\u1eadp s\\u00e0n c\\u00f4ng tr\\u00ecnh, s\\u1eadp s\\u00e0n The Metropole Th\\u1ee7 Thi\\u00eam,\",\"seo_description\":null,\"brief\":{\"vi\":\"Khu th\\u01b0\\u01a1ng m\\u1ea1i d\\u1ecbch v\\u1ee5 k\\u1ebft h\\u1ee3p nh\\u00e0 \\u1edf cao t\\u1ea7ng t\\u1ea1i l\\u00f4 \\u0111\\u1ea5t s\\u1ed1 1 \\u2013 13, khu ch\\u1ee9c n\\u0103ng s\\u1ed1 1, khu \\u0111\\u00f4 th\\u1ecb m\\u1edbi Th\\u1ee7 Thi\\u00eam, ph\\u01b0\\u1eddng Th\\u1ee7 Thi\\u00eam, TP Th\\u1ee7 \\u0110\\u1ee9c \\u0111ang tri\\u1ec3n khai x\\u00e2y d\\u1ef1ng \\u1edf t\\u1ea7ng cao th\\u00ec b\\u1ea5t ng\\u1edd b\\u1ecb s\\u1eadp s\\u00e0n.\"},\"refer\":null}', 'https://biz9.vn/upload/advertisement/The-Metropole-Thủ-Thiêm-1.jpeg', 'https://biz9.vn/upload/advertisement/The-Metropole-Thủ-Thiêm-1.jpeg', 'active', 'Nhất Tâm - Hà My', 'https://doanhnghiepvn.vn/kinh-te/bat-dong-san/tp-ho-chi-minh-sap-san-cong-trinh-xay-dung-tai-du-an-the-metropole-thu-thiem/20220912060513299', 'tp-ho-chi-minh-sap-san-cong-trinh-xay-dung-tai-du-an-the-metropole-thu-thiem', 0, 1, 1, 0, 0, 15, 0, '2022-10-03 15:41:58', NULL, ',1,4,', '', '', 'open', 'TP Hồ Chí Minh: Sập sàn công trình xây dựng tại dự án The Metropole Thủ Thiêm', 'thi công dự án The Metropole Thủ Thiêm,The Metropole Thủ Thiêm, sập sàn công trình, sập sàn The Metropole Thủ Thiêm, ', 'Khu thương mại dịch vụ kết hợp nhà ở cao tầng tại lô đất số 1 – 13, khu chức năng số 1, khu đô thị mới Thủ Thiêm, phường Thủ Thiêm, TP Thủ Đức đang triển khai xây dựng ở tầng cao thì bất ngờ bị sập sàn.', NULL, 3, 1, '2022-09-29 08:21:29', '2023-01-18 09:12:59'),
(620, 1, 'post', 'NovaGroup muốn nhận chuyển nhượng gần 95 triệu cổ phiếu NVL', 'Nếu giao dịch hoàn tất, NovaGroup sẽ nâng tỷ lệ sở hữu tại NVL lên 37,02% vốn, tương đương 721,83 triệu đơn vị.', '<p style=\"text-align:justify;\"><strong>Nếu giao dịch hoàn tất, NovaGroup&nbsp;sẽ nâng tỷ lệ sở hữu tại NVL lên 37,02% vốn, tương đương 721,83 triệu đơn vị.</strong></p><p style=\"text-align:justify;\">CTCP NovaGroup - đơn vị có liên quan đến Thành viên HĐQT Hoàng Thu Châu vừa đăng ký nhận chuyển nhượng 94,66 triệu cổ phiếu NVL của CTCP Tập đoàn Đầu tư địa ốc Nova (Novaland, NVL).</p><p style=\"text-align:justify;\">Thời gian thực hiện dự kiến là﻿ từ ngày 30/9-29/10. Nếu giao dịch hoàn tất, đơn vị này sẽ nâng tỷ lệ sở hữu tại NVL lên 37,02% vốn, tương đương 721,83 triệu đơn vị.</p><p style=\"text-align:justify;\">Ở chiều ngược lại, ﻿từ ngày 20/9-26/9, Phó Tổng Giám đốc Dương Thị Thu Thủy đã bán khớp lệnh 130.000 cổ phiếu NVL, giảm lượng nắm giữ xuống 21.631 đơn vị.</p><p style=\"text-align:justify;\">Tạm chiếu theo thị giá trung bình trong khoảng thời gian diễn ra giao dịch, ước tính vị lãnh đạo này đã thu về gần 11 tỷ đồng.</p><figure class=\"table\"><table><tbody><tr><td><figure class=\"image\"><img src=\"https://photo-cms-vietnamdaily.zadn.vn/zoom/800/uploaded/nguyenphuong/2022_09_28/novagroup-muon-nhan-chuyen-nhuong-gan-95-trieu-co-phieu-nvl.jpeg\" alt=\"NovaGroup muon nhan chuyen nhuong gan 95 trieu co phieu NVL\"></figure></td></tr><tr><td>&nbsp;</td></tr></tbody></table></figure><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\">Thông tin có liên quan, mới đây, Novaland (NVL) duyệt khoản vay 350 tỷ đồng từ HSBC﻿. Bên cạnh đó, NVL sẽ vay ngắn hạn số tiền (tối đa) 10 triệu USD - khoảng 237 tỷ đồng - từ các tổ chức The HongKong and Shanghai Banking Corporation Limited, Singapore Branch.﻿</p><p style=\"text-align:justify;\">Trước đó vào đầu tháng 8, Novaland đã công bố khoản vay 100 triệu USD (tương đương 2.350 tỷ đồng) từ Credit Opportunities III Pte. Limited, một quỹ đầu tư Singapore với tài sản đảm bảo là cổ phiếu, tài khoản ngân hàng, tài khoản chứng khoán thuộc sở hữu của bên đảm bảo (gồm Novaland, CTCP Diamond Properties, các cổ đông và công ty con, công ty liên kết khác).</p><p style=\"text-align:justify;\">Cuối tháng 7, HĐQT Novaland cũng đã phê duyệt khoản vay trung và dài hạn của công ty với số tiền vay tối đa 1.300 tỷ đồng, được cấp bởi MB Bank.</p><p style=\"text-align:justify;\"><a href=\"https://vietnamdaily.trithuccuocsong.vn/doanh-nghiep/novagroup-muon-nhan-chuyen-nhuong-gan-95-trieu-co-phieu-nvl-150458.html?fbclid=IwAR2nJbz5n1aNnYEes4-jh4OV80hVQuljmihkoQCBv2WsA3ILndTTImj0hDY\">Theo Anh Nhi / Tri thức cuộc sống</a></p>', '{\"refer\":null}', 'https://biz9.vn/upload/advertisement/novagroup-muon-nhan-chuyen-nhuong-gan-95-trieu-co-phieu-nvl.jpeg', NULL, 'active', 'Tuệ Minh', NULL, 'novagroup-muon-nhan-chuyen-nhuong-gan-95-trieu-co-phieu-nvl', 0, 0, 1, 1, 0, 1, 40000, '2022-10-03 15:41:00', NULL, ',1,', '', '', 'open', NULL, 'novaland, novagroup, nvl, cổ phiếu nvl', 'Nếu giao dịch hoàn tất, NovaGroup sẽ nâng tỷ lệ sở hữu tại NVL lên 37,02% vốn, tương đương 721,83 triệu đơn vị.', NULL, 1, 1, '2022-09-29 08:21:29', '2023-02-03 03:27:38'),
(621, 1, 'post', 'Bỏ việc ngân hàng, cô gái 28 tuổi chia sẻ cách tạo ra nhiều nguồn thu nhập', 'Mặc dù nghỉ việc tại ngân hàng, người phụ nữ 28 tuổi vẫn rất biết ơn công việc ấy đã tạo nền tảng vững chắc cho cô theo đuổi đam mê. Hiện tại thu nhập của cô đến từ nhiều nguồn đa dạng khác nhau.', '<p>Bỏ việc ngân hàng, cô gái 28 tuổi chia sẻ cách tạo ra nhiều nguồn thu nhập</p><p>Lindsay MacMillan luôn muốn trở thành một nhà văn. Người phụ nữ 28 tuổi sống tại Michigan, Mỹ, chia sẻ rằng từ khi học lớp 1, cô đã luôn mơ ước trở thành một nhà văn viết sách.</p><figure class=\"image\"><img src=\"/public/data/hinh-anh/283795477_4721498304621784_8016414162422459253_n.jpg\"></figure><p>&nbsp;</p><p>Giấc mơ của MacMillan chính thức trở thành hiện thực khi cuốn tiểu thuyết đầu tay The Heart of the Deal được xuất bản vào tháng 6/2022. Cô cho biết cuốn tiểu thuyết thứ hai sẽ được phát hành vào năm 2023.</p><figure class=\"table\"><table><tbody><tr><td><figure class=\"image\"><img src=\"https://i.ndh.vn/2022/09/28/-6097-1664373526.jpg\" alt=\"-6097-1664373526.jpg\"></figure></td></tr><tr><td>Lindsay MacMillan (bên trái) chụp cùng mẹ Amy MacMillan. Ảnh: <i>Lindsay MacMillan.</i></td></tr></tbody></table></figure><p>Mặc dù theo đuổi ước mơ viết lách, chưa đầy 6 tháng trước đó, MacMillan vẫn là Phó Giám đốc bộ phận marketing của ngân hàng đầu tư Goldman Sachs. Sau gần 6 năm gắn bó với công ty, MacMillan liên tục đạt được mức lương 6 con số.</p><p>Cô nói: \"Tôi không xuất thân từ nghệ sĩ hay nhà văn\". Sau khi hoàn thành chương trình đại học và bắt đầu tìm việc, cô tin rằng nên làm một việc gì đó thực tế tương tự như việc kinh doanh.</p><p>MacMillan đã dựa vào lựa chọn mang tính thực tế đó trong nhiều năm trước khi quyết định thực hiện bước nhảy vọt là trở thành nhà văn toàn thời gian. Cô gái 28 tuổi đã bỏ lại mức lương 6 con số, nhưng cô hy vọng sẽ sớm có thu nhập cao trở lại.</p><p><strong>\"Cảm giác thành công không đến ngay tức khắc\"</strong></p><p>MacMillan viết những bản thảo đầu tiên khi cô 18 tuổi. Tác phẩm dài 450 trang có liên quan đến biến cố gia đình, khi cha mẹ cô chia tay.</p><p>Trong thời gian theo học tại Đại học Dartmouth, nơi cô học kinh tế và học viết, MacMillan bắt đầu tìm hiểu khía cạnh kinh doanh của quyền tác giả, ví dụ như cách mời các cừa hàng mua sách của mình.</p><p>Trong những năm ngồi trên ghế nhà trường, cô đã viết thêm 2 bản thảo nữa. Cô nói: \"Có vẻ như tôi sẽ không đạt được thành công ngay lập tức nếu tôi bắt đầu luôn với việc làm nhà văn\". Cô muốn ổn định tài chính và có thêm cơ sở hỗ trợ cho sự nghiệp sau này.</p><p>Chính vì suy nghĩ đó, cô đã nhận làm việc tại ngân hàng Goldman ở New York và luôn nỗ lực hướng tới ước mơ xa hơn của mình.</p><figure class=\"table\"><table><tbody><tr><td><figure class=\"image\"><img src=\"https://i.ndh.vn/2022/09/28/-7096-1664373526.jpg\" alt=\"-7096-1664373526.jpg\"></figure></td></tr><tr><td>Ảnh:&nbsp;<i>Lindsay MacMillan.&nbsp;</i></td></tr></tbody></table></figure><p><strong>\"Công việc ban ngày không phải là đam mê\"</strong></p><p>Ban đầu, MacMillan làm việc trong bộ phận đầu tư của doanh nghiệp. Nhưng cô không thể kiểm soát lịch trình của bản thân và điều đó khiến cô cảm thấy bất ổn cả về tinh thần hay công việc viết lách.</p><p>Hai năm sau, cô chuyển sang làm mảng marketing cho doanh nghiệp. Lịch trình của cô trở nên bận rộn từ 9 giờ sáng đến 7 giờ tối. Cô còn làm việc cả cuối tuần. Cô nói: \"Công việc ban ngày không phải là đam mê của tôi, nhưng nó cũng không ngăn cản tôi theo đuổi đam mê của mình\".</p><p>MacMillan thường thức dậy sớm trước 5 giờ sáng và dành 3 tiếng để ngồi viết tại quán café gần văn phòng. Cô cũng tham dự các sự kiện về văn học và liên hệ với các hiệu sách để xây dựng mạng lưới kết nối trong lĩnh vực này.</p><p>The Heart of the Deal là bản thảo thứ 5 của cô. MacMillan bắt đầu viết bản thảo này vào năm 2019. Cô tìm thấy đối tác của mình vào tháng 10/2020 và nhận được hợp đồng sách vào tháng 6/2021. Đến cuối năm, cô đã có được hợp đồng thứ hai. Đó là khi cô bắt đầu tự hỏi bản thân rằng đã đến lúc rời Goldman hay chưa.</p><p>Cô được thăng chức ngay khi ký hợp đồng sách thứ hai. Đó là dấu mốc quan trọng vì cô đã tính toán rằng nếu có thể cân bằng cả hai công việc lâu hơn một chút nữa thì đó là sự hy sinh xứng đáng. Nhưng khi cảm thấy cán cân đó bị nghiêng nhiều về phía Goldman, cô quyết định nghỉ việc và rời công ty vào tháng 3/2022.</p><p>Công việc tại Goldman Sachs không chỉ mang lại cho MacMillan sự ổn định tài chính. Công việc ấy cho cô cơ hội để tiết kiệm tiền cho thời điểm cô muốn tạo ra bước nhảy vọt trong lĩnh vực viết lách toàn thời gian. \"Tôi đã đầu tư một nửa thu nhập của mình và chỉ sống bằng nửa còn lại\", cô nói.</p><figure class=\"table\"><table><tbody><tr><td><figure class=\"image\"><img src=\"https://i.ndh.vn/2022/09/28/-4086-1664373526.jpg\" alt=\"-4086-1664373526.jpg\"></figure></td></tr><tr><td>Ảnh: <i>Lindsay MacMillan.&nbsp;</i></td></tr></tbody></table></figure><p>MacMillan sống bằng tiền tiết kiệm từ những năm tháng làm việc tại ngân hàng. Hiện cô đang tìm cách bổ sung thu nhập mà cô kiếm được từ những tác phẩm của mình. Dưới đây là những cách mà MacMillan tạo ra nhiều nguồn thu nhập khác nhau.</p><p><strong>1. Tham gia sự kiện diễn thuyết</strong></p><p>Vào tháng 3/2022, MacMillan tham gia buổi nói chuyện TED. Buổi trò chuyện này đã trở thành bệ phóng cho cô tham gia các sự kiện hơn với nhiều chủ đề khác nhau.</p><p>Cô cho biết hiện tại cô chưa lấy tiền cho các buổi diễn thuyết. Nhưng trong mùa thu năm nay, cô sẽ lấy thù lao đối với các trường đại học và doanh nghiệp. MacMillan dự định sẽ nhận 500 USD cho mỗi buổi trò chuyện kéo dài 2 tiếng.</p><p><strong>2. Đào tạo cá nhân</strong></p><p>MacMillan cũng lên kế hoạch xây dựng một doanh nghiệp chuyên đào tạo riêng cho những người muốn theo đuổi sự nghiệp viết lách.</p><p>Cô cho biết có nhiều khóa học trực tuyến và trực tiếp dạy cách trở thành một nhà văn giỏi. Nhưng nếu mọi người muốn thực sự thành công thì còn cần phải có sự nhạy bén trong kinh doanh. Điều đó liên quan đến việc hiểu cuốn sách của mình phù hợp với vị trí nào trên kệ sách và làm sao để thuyết phục được các đối tác.</p><p>MacMillan sẽ tính phí 100 USD mỗi giờ cho việc huấn luyện cá nhân.</p><p><strong>3. Sống tiết kiệm</strong></p><p>Khi MacMillan xây dựng nhiều lĩnh vực kinh doanh với vai trò là một nhà văn, cô đã sống tiết kiệm hơn. Cô chuyển về sống cùng mẹ và giữ mức chi tiêu mỗi tháng dưới 2.000 USD.</p><p>Cô nói: \"Tôi nghĩ mọi người không biết rằng thực sự các nhà văn kiếm tiền từ tiểu thuyết ít đến thế nào. Tôi kiếm được 1 USD cho mỗi quyển sách\".</p><p>Đối với bất kỳ ai muốn theo đuổi đam mê và ước mơ của họ, MacMillan dành lời khuyên chân thành: \"Đừng bỏ rơi bản thân\". Mặc dù sẽ có lúc mọi người cảm thấy cô đơn và thành công còn rất xa vời, nhưng cô cổ vũ tất cả hãy tiếp tục cố gắng. Cô cũng nhắn nhủ rằng đừng kỳ vọng thành công sẽ đến trong một sớm một chiều vì cô đã mất cả thập kỷ mới có ngày hôm nay.</p><p><a href=\"https://ndh.vn/lam-giau/bo-viec-ngan-hang-co-gai-28-tuoi-chia-se-cach-tao-ra-nhieu-nguon-thu-nhap-1325011.html\">Theo NĐH</a></p>', '{\"refer\":null}', 'https://i.ndh.vn/2022/09/28/-6097-1664373526.jpg', NULL, 'active', 'Tuệ Minh', NULL, 'bo-viec-ngan-hang-co-gai-28-tuoi-chia-se-cach-tao-ra-nhieu-nguon-thu-nhap', 0, 0, 1, 1, 0, 8, 300000, '2022-10-03 15:41:00', NULL, ',1,2,5,', '', ',621,620,611,619,610,', 'open', 'Bỏ việc ngân hàng, cô gái 28 tuổi chia sẻ cách tạo ra nhiều nguồn thu nhập', 'Bỏ việc ngân hàng, cô gái 28 tuổi chia sẻ cách tạo ra nhiều nguồn thu nhập', 'Mặc dù nghỉ việc tại ngân hàng, người phụ nữ 28 tuổi vẫn rất biết ơn công việc ấy đã tạo nền tảng vững chắc cho cô theo đuổi đam mê. Hiện tại thu nhập của cô đến từ nhiều nguồn đa dạng khác nhau.', NULL, 1, 1, '2022-09-29 08:21:29', '2023-02-02 08:59:30'),
(625, 48, 'intro', 'Moki Mart - Niềm Tin Của Mọi Nhà', 'Về chúng tôi\r\nKính gửi Quý Khách hàng!', '<h2>Về chúng tôi</h2><p style=\"text-align:justify;\"><strong>Kính gửi Quý Khách hàng!</strong></p><p style=\"text-align:justify;\"><span style=\"background-color:rgb(255,255,255);color:rgb(116,116,116);\">Công Ty Cổ Phần Thương Mại MOKI MART</span><strong>&nbsp;</strong>là đơn vị chuyên phân phối độc quyền các sản phẩm thuốc và thực phẩm chức năng, hiện đang là Công ty Dược phẩm hàng đầu với sứ mệnh mang đến những sản phẩm chất lượng nhất, an toàn nhất dành cho người tiêu dùng, giúp người tiêu dùng có thể chăm sóc sức khỏe của mình một cách tốt nhất.</p><p style=\"text-align:justify;\">Tại website của tôi luôn có đủ tất cả các sản phẩm do <span style=\"background-color:rgb(255,255,255);color:rgb(116,116,116);\">Công Ty Cổ Phần Thương Mại MOKI MART</span>&nbsp;phân phối độc quyền tại thị trường Việt Nam với quy trình tư vấn, chăm sóc, giải đáp thắc mắc của khách hàng nhiệt thành nhất. Các chuyên gia tư vấn y khoa và đội ngũ chăm sóc khách hàng sẽ luôn sẵn sàng tư vấn và phục vụ nhu cầu trao đổi thông tin của khách hàng về sức khoẻ, bệnh lý, cũng như các dịch vụ đặt hàng, giao hàng và thanh toán.</p><p style=\"text-align:justify;\">Sứ mệnh hoạt động của&nbsp;<span style=\"background-color:rgb(255,255,255);color:rgb(116,116,116);\">Công Ty Cổ Phần Thương Mại MOKI MART</span>:</p>', NULL, NULL, NULL, 'active', NULL, NULL, 'moki-mart-niem-tin-cua-moi-nha', 1, NULL, 0, NULL, NULL, NULL, 0, '2023-02-02 15:48:52', NULL, NULL, NULL, NULL, 'open', NULL, NULL, NULL, NULL, 2, 1, '2023-02-02 08:48:52', '2024-03-26 23:05:13'),
(626, 1, 'post', 'Top 5+ kem bôi muỗi đốt cho bé an toàn, hiệu quả nhất hiện nay', 'Muỗi là loài trung gian của rất nhiều loại bệnh truyền nhiễm nguy hiểm, đặc biệt đối với trẻ nhỏ', '<p>Muỗi là loài trung gian của rất nhiều loại bệnh truyền nhiễm nguy hiểm, đặc biệt đối với trẻ nhỏ. <a href=\"https://bibomart.com.vn/xit-chong-muoi-kem-chong-muoi-cho-be.html\"><span style=\"color:rgb(0,0,255);\">Kem trị muỗi đốt</span></a> là sản phẩm cần thiết mà các bậc cha mẹ không nên bỏ qua để bảo vệ sức khỏe cho bé yêu mỗi khi đến mùa muỗi sinh sản. Trong bài viết dưới đây, <a href=\"https://bibomart.com.vn/\"><span style=\"color:rgb(0,0,255);\">Bibo Mart</span></a> sẽ gợi ý cho ba mẹ top 5 <strong>kem bôi muỗi đốt cho bé</strong> cực an toàn, hiệu quả. Mời ba mẹ đón đọc ngay!</p><p>&nbsp;</p><h2><strong>1. Trẻ bị muỗi đốt nhiều có sao không?</strong></h2><p>Muỗi là loài côn trùng ưa thích khí hậu nóng ẩm, xuất hiện rất phổ biến ở nước ta. Muỗi cái cần nguồn protein dồi dào để đẻ trứng nên thường hút máu người và động vật. Trẻ nhỏ thường dễ bị muỗi đốt hơn so với người lớn do cơ địa thường xuyên đổ mồ hôi, thân nhiệt cao hoặc do một số thói quen như không mặc quần áo dài, mặc quần áo quá tối màu hay thường xuyên chơi cạnh ao nước tù, bụi cây rậm rạp,…</p>', NULL, '/public/images/bibomart/thuoc-boi-muoi-dot.jpg', NULL, 'active', NULL, NULL, 'top-5-kem-boi-muoi-dot-cho-be-an-toan-hieu-qua-nhat-hien-nay', 1, 1, 1, NULL, NULL, NULL, 0, '2024-03-11 21:39:00', NULL, NULL, NULL, '', 'open', NULL, NULL, NULL, NULL, 2, 2, '2024-03-11 14:39:04', '2024-03-11 14:42:41'),
(627, 1, 'post', '100+ mẫu quần đùi bé trai đẹp, thời trang được ưa chuộng nhất hiện nay', 'Quần đùi bé trai là một trong những item được ưa chuộng, đặc biệt là trong thời tiết hè nắng nóng.', '<p><a href=\"https://bibomart.com.vn/quan-be-trai.html\"><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,255);\"><strong>Quần</strong></span></a><strong> đùi bé trai</strong><span style=\"background-color:rgb(255,255,255);color:rgb(10,10,10);\"> là một trong những item được ưa chuộng, đặc biệt là trong thời tiết hè nắng nóng. Quần thường có thiết kế ống ngắn, phom rộng, kết hợp cùng chất liệu thoáng mát sẽ mang đến cảm giác thoải mái, nhẹ dịu khi tiếp xúc với da bé. Trong bài viết dưới đây, </span><a href=\"https://bibomart.com.vn/\"><span style=\"background-color:rgb(255,255,255);color:rgb(0,0,255);\">Bibo Mart</span></a><span style=\"background-color:rgb(255,255,255);color:rgb(10,10,10);\"> sẽ giới thiệu đến ba mẹ những mẫu quần đùi đẹp, phù hợp để </span><a href=\"https://bibomart.com.vn/thoi-trang-be-trai.html\">bé trai</a><span style=\"background-color:rgb(255,255,255);color:rgb(10,10,10);\"> diện đi chơi đi học. Mời ba mẹ cùng tham khảo!</span></p>', NULL, '/public/images/bibomart/quan-dui-be-trai-thoi-trang-1.jpg', NULL, 'active', NULL, NULL, '100-mau-quan-dui-be-trai-dep-thoi-trang-duoc-ua-chuong-nhat-hien-nay', 1, 1, 1, NULL, NULL, NULL, 0, '2024-03-11 21:43:00', NULL, NULL, NULL, '', 'open', NULL, NULL, NULL, NULL, 2, 2, '2024-03-11 14:43:52', '2024-03-11 14:44:02');

