(15, 56, ',56,5,4,', 'Alpha golg IQ 1 900g', '0028010000067', 'alpha-golg-iq-1-900g', '293000', NULL, -1, '- Các vi chất Kẽm, Selen, Vitamin A, D3, C giúp tăng cường sức đề kháng\r\n- Hệ men vi sinh BB12, giúp hệ tiêu hóa khỏe mạnh, hấp thu tốt dưỡng chất', '<p style=\"text-align:justify;\">Dielac Alpha Gold IQ 1 là sản phẩm dinh dưỡng công thức&nbsp;được sử dụng thay thế hoàn toàn hoặc một phần bữa ăn cho trẻ không có hoặc thiếu sữa mẹ.</p><p style=\"text-align:justify;\">Trẻ sơ sinh cần khởi đầu tốt nhất với nguồn dinh dưỡng hoàn hảo. Dielac Alpha Gold IQ 1 với công thức IQ là sản phẩm&nbsp;ứng dụng thành công Lutein từ nghiên cứu của tập đoàn dinh dưỡng DSM - Thụy Sĩ, được thiết kế chuyên biệt cho trẻ từ 0-6 tháng tuổi, giúp thúc đẩy phát triển não bộ và thị giác,&nbsp;tăng cường sức đề kháng, hỗ trợ sức khỏe hệ tiêu hóa&nbsp;và đáp ứng nhu cầu dinh dưỡng đặc thù của trẻ trong giai đoạn này.</p><p style=\"text-align:center;\">&nbsp;</p><p>&nbsp;</p><p><br><i>Vinamilk - Dielac Alpha Gold IQ Mới - Đề Kháng Khoẻ, Bé Thông Minh</i><br>&nbsp;</p><figure class=\"image\"><img src=\"https://www.moby.com.vn/data/ck/images/S%E1%BB%AFa%20b%E1%BB%99t%20Vinamilk%20Dielac%20Alpha%20Gold%20IQ%201%20900g%20(0-6%20th%C3%A1ng).jpg\" alt=\"Sữa bột Vinamilk Dielac Alpha Gold IQ 1 900g (0-6 tháng)\"></figure><p><br><i>Sữa bột Vinamilk Dielac Alpha Gold IQ 1 900g (0-6 tháng)</i></p><p>&nbsp;</p><h2 style=\"text-align:justify;\"><strong>1. Đặc điểm nổi bật của sản phẩm</strong></h2><h3 style=\"text-align:justify;\"><strong>a. Hỗ trợ phát triển não bộ</strong></h3><p style=\"text-align:justify;\">- Axít Alpha-linolenic, axít Linoleic, Taurin, kết hợp với DHA (*), ARA và Lutein tạo thành hệ dưỡng chất thiết yếu cho sự phát triển của não bộ, võng mạc mắt, giúp tăng cường khả năng nhận thức của trẻ.<br>- Cholin là tiền tố tổng hợp Phosphatidylcholin và Acetylcholin, đóng vai trò quan trọng trong việc tạo cấu trúc màng tế bào thần kinh, hỗ trợ dẫn truyền xung thần kinh, giúp ghi nhớ và tăng cường khả năng học hỏi của trẻ.</p><h3 style=\"text-align:justify;\"><strong>b. Tăng cường sức đề kháng và sức khỏe hệ tiêu hóa</strong></h3><p style=\"text-align:justify;\">- Các vi chất Kẽm, Selen, Vitamin A, D3, C giúp tăng cường sức đề kháng, bảo vệ trẻ luôn khỏe mạnh, chống lại các bệnh nhiễm khuẩn khi tiếp xúc nhiều hơn với môi trường xung quanh.<br>- Chất xơ hòa tan Oligofructose (FOS) và hệ men vi sinh Bifidobacterium, BB-12TM&nbsp;giúp tăng cường hệ vi khuẩn có lợi cho đường ruột, hỗ trợ hệ tiêu hóa của trẻ khỏe mạnh, giúp nhuận tràng, từ đó hấp thu các chất dinh dưỡng tốt hơn.</p><p style=\"text-align:justify;\">BB-12TM&nbsp;là thương hiệu của Chr. Hansen A/S</p><h3 style=\"text-align:justify;\"><strong>c. Phát triển chiều cao - thể chất:</strong></h3><p style=\"text-align:justify;\">- Tỉ lệ Canxi và Phốt pho thích hợp cùng với Vitamin D3 (**), Vitamin K, Magiê giúp phát triển hệ xương và răng của trẻ chắc khỏe, phát triển tốt về chiều cao.<br>- Giàu các dưỡng chất và vitamin, khoáng chất cần thiết cho nhu cầu phát triển thể chất cho trẻ trong giai đoạn này.<br>(*) Lượng DHA trong Dielac Alpha Gold IQ 1 giúp đáp ứng theo khuyến nghị của FAO/WHO (2010).<br>(**) Đáp ứng nhu cầu dinh dưỡng khuyến nghị (DRI) mới nhất của tổ chức IOM – Mỹ.</p><h2 style=\"text-align:justify;\"><strong>2. ​Hướng dẫn sử dụng</strong></h2><p style=\"text-align:justify;\">- Rửa tay và dụng cụ pha chế thật sạch.<br>- Đun sôi dụng cụ pha chế trong khoảng 10 phút trước khi sử dụng.<br>- Đun nước sôi khoảng 5 phút và để nguội đến khoảng 50 oC.<br>- Rót nước vào dụng cụ pha chế theo lượng hướng dẫn.<br>- Cho sản phẩm theo số muỗng tương ứng với lượng nước như bảng hướng dẫn.<br>- Lắc nhẹ hoặc khuấy đều cho đến khi tan hoàn toàn. Làm nguội nhanh và kiểm tra nhiệt độ bằng cách nhỏ vài giọt lên cổ tay. Nếu thấy độ ấm vừa đủ, cho trẻ dùng ngay.</p><p style=\"text-align:justify;\"><strong>* Lưu ý:</strong></p><p style=\"text-align:justify;\">- Chỉ dùng tối đa trong vòng 1 giờ và phần dư phải đổ bỏ.<br>- Sử dụng đúng lượng như hướng dẫn. Sử dụng ít hoặc nhiều hơn có thể làm ảnh hưởng đến sức khỏe trẻ.</p><p style=\"text-align:justify;\">Lượng dùng đề nghị</p><figure class=\"image\"><img src=\"https://www.moby.com.vn/data/ck/images/S%E1%BB%AFa%20b%E1%BB%99t%20Vinamilk%20Dielac%20Alpha%20Gold%20IQ%201%20400g%20(0-6%20th%C3%A1ng).png\" alt=\"Sữa bột Vinamilk Dielac Alpha Gold IQ 1 400g (0-6 tháng)\"></figure><p style=\"text-align:center;\"><i>Lượng dùng theo bảng hướng dẫn nuôi dưỡng trẻ</i></p><h2 style=\"text-align:justify;\"><strong>3. ​Hướng dẫn bảo quản</strong></h2><p style=\"text-align:justify;\">- Đối với hộp thiếc: Đậy kín sau mỗi lần sử dụng. Để nơi thoáng mát và khô ráo. Không bảo quản trong tủ lạnh. Nên sử dụng trong vòng 4 tuần sau khi mở bao bì.<br>- Đối với hộp giấy: Gấp kín sau mỗi lần sử dụng. Để nơi thoáng mát và khô ráo. Không bảo quản trong tủ lạnh. Nên sử dụng trong vòng 4 tuần sau khi mở bao bì.</p><p style=\"text-align:justify;\"><strong>a. CHÚ Ý:</strong>&nbsp;Sữa mẹ là thức ăn tốt nhất cho sức khỏe và sự phát triển toàn diện của trẻ nhỏ. Các yếu tố chống nhiễm khuẩn, đặc biệt là kháng thể chỉ có trong sữa mẹ có tác dụng giúp trẻ phòng, chống bệnh tiêu chảy, nhiễm khuẩn đường hô hấp và một số bệnh nhiễm khuẩn khác.<br><br><strong>b. Chỉ sử dụng sản phẩm này theo chỉ dẫn của bác sĩ</strong>. Pha chế theo đúng hướng dẫn. Cho trẻ ăn bằng cốc, thìa hợp vệ sinh</p>', '<figure class=\"table\"><table><tbody><tr><td><strong>Tên sản phẩm</strong></td><td><strong>Sữa bột Vinamilk Dielac Alpha Gold IQ 1 900g (0-6 tháng)</strong></td></tr><tr><td>Thương hiệu</td><td>Vinamilk (Việt Nam)</td></tr><tr><td>Sản xuất tại</td><td>Việt Nam</td></tr><tr><td>Khối lượng</td><td>900g</td></tr><tr><td>Độ tuổi sử dụng</td><td>bé từ 0 - 6 tháng tuổi</td></tr></tbody></table></figure><p><br>&nbsp;</p>', NULL, ';0;1;', '/public/images/product/1-19.jpg', NULL, 0, NULL, 1, 1, '/public/images/sua-bot-vinamilk-dielac-alpha-gold-iq-1-900g-0-6-thang-1_1623038946.jpg;/public/images/sua-bot-vinamilk-dielac-alpha-gold-iq-1-900g-0-6-thang-2_1623038946.jpg;/public/images/sua-bot-vinamilk-dielac-alpha-gold-iq-1-900g-0-6-thang-3_1623038947.jpg', NULL, NULL, NULL, 3, 2, NULL, '2023-02-11 10:24:15', '2024-04-02 10:14:43'),
(16, 56, ',56,5,4,', 'Alpha Gold IQ 4-900G', '0028010000073', 'alpha-gold-iq-4-900g', '305000', NULL, -1, '- Đáp ứng nhu cầu dinh dưỡng khuyến nghị (DRI) của tổ chức IOM – Hoa Kỳ\r\n- Ứng dụng thành công Lutein từ nghiên cứu của tập đoàn dinh dưỡng DSM - Thụy Sĩ', '<p>ĂN TỐT</p><p>- GIúp trẻ ăn ngon miệng</p><p>- Giúp tăng cường tiêu hóa</p><p>- Hỗ trợ tăng sức đề kháng cho trẻ.</p>', NULL, NULL, ';1;', '/public/images/product/1-20.jpg', NULL, 0, NULL, 1, 1, '/public/images/sua-bot-vinamilk-dielac-alpha-gold-iq-4-900g-2-6-tuoi-1623051056.jpg;/public/images/sua-bot-vinamilk-dielac-alpha-gold-iq-4-900g-2-6-tuoi-2_1623051057.jpg;/public/images/sua-bot-vinamilk-dielac-alpha-gold-iq-4-900g-2-6-tuoi-1_1623051056.jpg', NULL, NULL, NULL, 3, 2, NULL, '2023-03-10 02:28:11', '2024-04-02 10:14:39'),
(17, 6, ',6,5,4,', 'Alpha Gold IQ 3-900G', '0028010000071', 'alpha-gold-iq-3-900g', '305000', NULL, NULL, NULL, '<p style=\"text-align:justify;\">Dielac Alpha Gold IQ 3 là sản phẩm dinh dưỡng công thức dành cho trẻ từ 1 - 2 tuổi. Sản phẩm được sử dụng bổ sung cho chế độ ăn hàng ngày của trẻ.</p><p style=\"text-align:justify;\">Giai đoạn 1 - 2 tuổi diễn ra những chuyển biến quan trọng trong sự phát triển não bộ. Lúc 2 tuổi, bộ não của trẻ đã phát triển bằng 80% bộ não của người trưởng thành và cần những dưỡng chất đặc biệt giúp hoàn chỉnh hệ thống não bộ tạo tiền đề cho sự phát triển trí tuệ, khả năng ngôn ngữ và tư duy. Trong giai đoạn này, trẻ khám phá môi trường xung quanh nhiều hơn để học hỏi tốt hơn nên cần đáp ứng dinh dưỡng đầy đủ, tăng sức đề kháng giúp trẻ khỏe mạnh.</p><p style=\"text-align:justify;\">Dielac Alpha Gold IQ 3 với công thức IQ là sản phẩm ứng dụng thành công Lutein từ nghiên cứu của tập đoàn dinh dưỡng DSM - Thụy Sĩ, đáp ứng nhu cầu dinh dưỡng đặc thù cho trẻ em Việt Nam, giúp thúc đẩy phát triển não bộ và thể chất của trẻ.</p><p style=\"text-align:center;\">&nbsp;</p><p>&nbsp;</p><p><br><i>Vinamilk - Dielac Alpha Gold IQ Mới - Đề Kháng Khoẻ, Bé Thông Minh</i><br>&nbsp;</p><figure class=\"image\"><img src=\"https://www.moby.com.vn/data/ck/images/S%E1%BB%AFa%20b%E1%BB%99t%20Vinamilk%20Dielac%20Alpha%20Gold%20IQ%203%20900g%20(1-2%20tu%E1%BB%95i).jpg\" alt=\"Sữa bột Vinamilk Dielac Alpha Gold IQ 3 900g (1-2 tuổi)\"></figure><p><br><i>Sữa bột Vinamilk Dielac Alpha Gold IQ 3 900g (1-2 tuổi)</i></p><p>&nbsp;</p><h2 style=\"text-align:justify;\"><strong>1. Đặc điểm nổi bật của sản phẩm</strong></h2><h3 style=\"text-align:justify;\"><strong>a. Hỗ trợ phát triển não bộ</strong></h3><p style=\"text-align:justify;\">- Bổ sung gấp 3 lần DHA (*), kết hợp với ARA, axít Alpha-linolenic, axít Linoleic, Taurin và Lutein tạo thành hệ dưỡng chất thiết yếu cho sự phát triển của não bộ, võng mạc mắt, giúp tăng cường khả năng nhận thức của trẻ.<br>- Cholin được bổ sung gấp đôi (*), là tiền tố tổng hợp Phosphatidylcholin và Acetylcholin, đóng vai trò quan trọng trong việc tạo cấu trúc màng tế bào thần kinh, hỗ trợ dẫn truyền xung thần kinh, giúp ghi nhớ và tăng cường khả năng học hỏi của trẻ.</p><h3 style=\"text-align:justify;\"><strong>b. Tăng sức đề kháng và sức khỏe hệ tiêu hóa</strong></h3><p style=\"text-align:justify;\">- Các vi chất Kẽm, Selen, Vitamin A, D3, C giúp tăng cường sức đề kháng, bảo vệ trẻ luôn khỏe mạnh, chống lại các bệnh nhiễm khuẩn khi tiếp xúc nhiều hơn với môi trường xung quanh.<br>- Chất xơ hòa tan Oligofructose (FOS) cùng hệ men vi sinh Bifidobacterium, BB-12TM&nbsp;và Lactobacillus rhamnosus GG, LGGTM&nbsp;giúp tăng cường hệ vi khuẩn có lợi cho đường ruột, hỗ trợ hệ tiêu hóa của trẻ khỏe mạnh, giúp nhuận tràng, từ đó hấp thu các chất dinh dưỡng tốt hơn.</p><p style=\"text-align:justify;\">BB-12TM&nbsp;là thương hiệu của Chr. Hansen A/S &amp; LGGTM&nbsp;là thương hiệu của Valio Ltd.</p><h3 style=\"text-align:justify;\"><strong>c. Phát triển chiều cao - thể chất</strong></h3><p style=\"text-align:justify;\">- Tỉ lệ Canxi và Phốt pho thích hợp cùng với Vitamin D3 (**), Vitamin K, Magiê giúp phát triển hệ xương và răng của trẻ chắc khỏe, phát triển tốt về chiều cao.<br>- Giàu các dưỡng chất và vitamin, khoáng chất cần thiết cho nhu cầu phát triển thể chất cho trẻ trong giai đoạn này.<br>(*) So với sản phẩm Dielac Alpha 3. Cùng với bữa ăn hằng ngày, sử dụng Dielac Alpha Gold IQ 3 giúp cung cấp lượng DHA theo khuyến nghị của FAO/WHO (2010).<br>(**) Đáp ứng nhu cầu dinh dưỡng khuyến nghị (DRI) mới nhất của tổ chức IOM – Mỹ.</p><h2 style=\"text-align:justify;\"><strong>2. ​Hướng dẫn sử dụng</strong></h2><p style=\"text-align:justify;\">- Đun nước sôi khoảng 5 phút, sau đó để nguội đến mức còn âm ấm (khoảng 50oC)<br>- Rót 180 ml nước vào dụng cụ pha chế<br>- Cho từ từ 6 muỗng gạt Dielac Alpha Gold IQ 3 (khoảng 34 g) vào dụng cụ pha chế<br>- Khuấy đều cho đến khi bột tan hoàn toàn<br><strong>Lưu ý:</strong><br>- Các dụng cụ pha chế phải được rửa sạch và tiệt trùng trước khi sử dụng.<br>- Chỉ dùng tối đa trong vòng 1 giờ và phần dư phải đổ bỏ. Pha đúng lượng như hướng dẫn. Sử dụng ít hoặc nhiều hơn có thể làm ảnh hưởng đến sức khỏe trẻ.</p><p style=\"text-align:justify;\">Lượng dùng đề nghị</p><figure class=\"image\"><img src=\"https://www.moby.com.vn/data/ck/images/S%E1%BB%AFa%20b%E1%BB%99t%20Vinamilk%20Dielac%20Alpha%20Gold%20IQ%203%20400g%20(1-2%20tu%E1%BB%95i).png\" alt=\"Sữa bột Vinamilk Dielac Alpha Gold IQ 3 400g (1-2 tuổi)\"></figure><p style=\"text-align:justify;\">Mỗi ngày nên uống từ 2 - 3 ly Dielac Alpha Gold IQ 3 để cơ thể trẻ được cung cấp đầy đủ chất dinh dưỡng cần thiết</p><h2 style=\"text-align:justify;\"><strong>3. Hướng dẫn bảo quản</strong></h2><p style=\"text-align:justify;\">- Đối với hộp thiếc: Đậy kín sau mỗi lần sử dụng. Để nơi thoáng mát và khô ráo. Không bảo quản trong tủ lạnh. Nên sử dụng trong vòng 4 tuần sau khi mở bao bì.<br>- Đối với hộp giấy: Gấp kín sau mỗi lần sử dụng. Để nơi thoáng mát và khô ráo. Không bảo quản trong tủ lạnh. Nên sử dụng trong vòng 4 tuần sau khi mở bao bì.</p><p style=\"text-align:justify;\"><strong>a. CHÚ Ý:&nbsp;</strong>Sữa mẹ là thức ăn tốt nhất cho sức khỏe và sự phát triển toàn diện của trẻ nhỏ. Các yếu tố chống nhiễm khuẩn, đặc biệt là kháng thể chỉ có trong sữa mẹ có tác dụng giúp trẻ phòng, chống bệnh tiêu chảy, nhiễm khuẩn đường hô hấp và một số bệnh nhiễm khuẩn khác.<br>b. Chỉ sử dụng sản phẩm này theo chỉ dẫn của bác sĩ. Pha chế theo đúng hướng dẫn. Cho trẻ ăn bằng cốc, thìa hợp vệ sinh</p>', '<p><br>&nbsp;</p><figure class=\"table\"><table><tbody><tr><td><strong>Tên sản phẩm</strong></td><td><strong>Sữa bột Vinamilk Dielac Alpha Gold IQ 3 900g (1-2 tuổi)</strong></td></tr><tr><td>Thương hiệu</td><td>Vinamilk (Việt Nam)</td></tr><tr><td>Sản xuất tại</td><td>Việt Nam</td></tr><tr><td>Khối lượng</td><td>900g</td></tr><tr><td>Độ tuổi sử dụng</td><td>bé từ 1 - 2 tuổi</td></tr></tbody></table></figure><p><br>&nbsp;</p>', NULL, ';1;', '/public/images/product/1-09.jpg', NULL, 0, NULL, 1, 1, '/public/images/sua-bot-vinamilk-dielac-alpha-gold-iq-3-900g-1-2-tuoi-1_1623049777(1).jpg;/public/images/sua-bot-vinamilk-dielac-alpha-gold-iq-3-900g-1-2-tuoi-2_1623049777.jpg;/public/images/sua-bot-vinamilk-dielac-alpha-gold-iq-3-900g-1-2-tuoi-3_1623049777.jpg', NULL, NULL, NULL, 3, 2, NULL, '2023-03-10 02:33:45', '2024-04-02 10:14:35'),
(18, 6, ',6,5,4,', 'Abbott Grow 4 900g', '211110179', 'abbott-grow-4-900g', '307000', NULL, NULL, NULL, '<p><i>\"Sữa mẹ là thức ăn tốt nhất cho sức khỏe và sự phát triển toàn diện của trẻ nhỏ\"</i></p><h2><strong>Sữa Abbott Grow 4 900g hương Vani (cho bé &gt;2 tuổi)</strong></h2><p><strong>Sữa Abbott Grow 4 900g hương Vani là dòng sữa giàu dưỡng chất, tăng cường canxi và vitamin D hỗ trợ tăng trưởng chiều cao, thể lực và sự phát triển toàn diện của bé.</strong></p><figure class=\"image\"><img src=\"https://cdn-v2.kidsplaza.vn/media/wysiwyg/SEO/Sua-cho-be/sua-abbott-grow-4-900g-huong-vani-cho-be-tren-2-tuoi.jpg\" alt=\"Sữa Abbott Grow Gold 4 900g cho bé trên 2 tuổi\"></figure><p style=\"text-align:center;\"><i>Sữa Abbott Grow 4 900g cung cấp dinh dưỡng quan trọng cho sự phát triển của trẻ</i></p><h3><strong>Thành phần sữa Abbott Grow 4 900g</strong></h3><p><a href=\"https://www.kidsplaza.vn/sua-abbott-grow.html\"><strong>Sữa Abbott Grow</strong></a><strong> 4</strong> cải tiến bổ sung lecithin và sữa tách kem (58,3%), mật bắp, sucrose, lactose, KHOÁNG CHẤT (canxi carbonat, sắt sulfat, kẽm sulfat, mangan sulfat, đồng sulfat), VITAMIN (acid ascorbic, cholin bitartrat, vitamin E acetat, niacinamid, vitamin D3, vitamin A acetat, pyridoxin hydroclorid, canxi pantothenat, thiamin hydroclorid, vitamin K1, riboflavin, acid folic, d-biotin), hương vani, dầu cá (nguồn cung cấp DHA), taurin.</p><p style=\"text-align:center;\"><i>Bảng thành phần sữa Abbott Grow 4</i></p><figure class=\"table\"><table><thead><tr><th><strong>Thành phần dinh dưỡng</strong></th><th><p style=\"text-align:center;\"><strong>Đơn vị</strong></p></th><th><strong>100g bột</strong></th><th><p style=\"text-align:center;\"><strong>100ml pha&nbsp;</strong></p><p style=\"text-align:center;\"><strong>chuẩn*</strong></p></th></tr></thead><tbody><tr><td rowspan=\"2\"><p>Năng lượng (Energy)</p><p>&nbsp;</p></td><td>kcal</td><td>427</td><td>77</td></tr><tr><td>kJ</td><td>1787</td><td>322</td></tr><tr><td>Chất đạm (Protein)</td><td>g</td><td>15,23</td><td>2,74</td></tr><tr><td>9 acid amin thiết yếu</td><td>g</td><td>6,77</td><td>1,21</td></tr><tr><td>Lysin (Lysine)</td><td>g</td><td>1,01</td><td>0,18</td></tr><tr><td>Chất béo (Fat)</td><td>g</td><td>12,80</td><td>2,30</td></tr><tr><td>DHA</td><td>mg</td><td>11,0</td><td>1,98</td></tr><tr><td>Acid Oleic (omega 9)</td><td>g</td><td>2,18</td><td>0,39</td></tr><tr><td>Bột đường (Carbohydrate)</td><td>g</td><td>62,80</td><td>11,30</td></tr><tr><td>Độ ẩm (Moisture)</td><td>g</td><td>3,00</td><td>82,50</td></tr><tr><td>Taurin (Taurine)</td><td>mg</td><td>27,8</td><td>5,0</td></tr><tr><td colspan=\"4\"><strong>Vitamin - Vitamins</strong></td></tr><tr><td rowspan=\"2\"><p>Vitamin A</p><p>&nbsp;</p></td><td>IU</td><td>833</td><td>150</td></tr><tr><td>mcg RE</td><td>250</td><td>45</td></tr><tr><td rowspan=\"2\"><p>Vitamin D3</p><p>&nbsp;</p></td><td>IU</td><td>278</td><td>50</td></tr><tr><td>mcg</td><td>6,95</td><td>1,25</td></tr><tr><td rowspan=\"2\"><p>Vitamin E</p><p>&nbsp;</p></td><td>IU</td><td>6,9</td><td>1,2</td></tr><tr><td>mg&nbsp;α-TE</td><td>4,6</td><td>0,8</td></tr><tr><td>Vitamin K1</td><td>mcg</td><td>17,0</td><td>3,1</td></tr><tr><td>Vitamin C</td><td>mg</td><td>80,0</td><td>14,4</td></tr><tr><td>Acid Folic</td><td>mcg</td><td>28</td><td>5</td></tr><tr><td>Vitamin B1</td><td>mg</td><td>0,89</td><td>0,16</td></tr><tr><td>Vitamin B2</td><td>mg</td><td>1,11</td><td>0,20</td></tr><tr><td>Vitamin B6</td><td>mg</td><td>1,17</td><td>0,21</td></tr><tr><td>Vitamin B12</td><td>mcg</td><td>1,11</td><td>0,20</td></tr><tr><td>Niacin</td><td>mg</td><td>6,67</td><td>1,20</td></tr><tr><td>Acid Pantothenic</td><td>mg</td><td>1,94</td><td>0,35</td></tr><tr><td>Biotin</td><td>mcg</td><td>13,9</td><td>2,5</td></tr><tr><td>Cholin (Choline)</td><td>mg</td><td>111,0</td><td>20,0</td></tr><tr><td colspan=\"4\"><strong>Khoáng chất - Minerals</strong></td></tr><tr><td>Natri (Sodium)</td><td>mg</td><td>172</td><td>30</td></tr><tr><td>Kali (Potassium)</td><td>mg</td><td>700</td><td>126</td></tr><tr><td>Clo (Chloride)</td><td>mg</td><td>456</td><td>82</td></tr><tr><td>Canxi (Calcium)</td><td>mg</td><td>800</td><td>144</td></tr><tr><td>Phốt pho (Phosphorus)</td><td>mg</td><td>400</td><td>72</td></tr><tr><td>Magiê (Magnesium)</td><td>mg</td><td>49,0</td><td>8,8</td></tr><tr><td>Sắt (Iron)</td><td>mg</td><td>6,94</td><td>1,25</td></tr><tr><td>Kẽm (Zinc)</td><td>mg</td><td>5,56</td><td>1,00</td></tr><tr><td>Mangan (Manganese)</td><td>mcg</td><td>750</td><td>135</td></tr><tr><td>Đồng (Copper)</td><td>mg</td><td>0,56</td><td>0,10</td></tr></tbody></table></figure><p><i>** Giá trị tối thiểu trong thời gian lưu hành phải ≥ 80% giá trị này</i></p><h3><strong>Công dụng của sữa Abbott Grow 4 với sức khỏe của trẻ</strong></h3><p><strong>Sữa Abbott GROW 4 900g</strong> với hệ dưỡng chất G-Power giàu các dưỡng chất và protein chất lượng cao, đủ 9 acid amin thiết yếu, giúp trẻ từ 2 tuổi trở lên phát triển tốt về thể chất và trí não.</p><ul><li><a href=\"https://www.kidsplaza.vn/sua-bot-cho-be.html\">Sữa bột</a> Abbott Grow 900g bổ sung cho chế độ ăn hàng ngày, giúp hỗ trợ sự phát triển toàn diện các tố chất sức khỏe cho trẻ.</li><li>Abbott Grow 4 giàu canxi, vitamin D, tỷ lệ canxi/phốt pho thích hợp theo khuyến cáo của Hoa Kỳ hỗ trợ sự phát triển xương và chiều cao.</li><li>DHA, taurin, omega 9 trong sữa Abbott Grow 4 900g hỗ trợ trẻ phát triển trí não và thị giác.</li><li>Abbott Grow 4 cải tiến có Protein chất lượng cao (đặc biệt giàu lysin) giúp trẻ tăng trưởng tốt, hỗ trợ tăng cân và phát triển khỏe mạnh.</li><li>Thành phần sữa Abbott Grow 4 có các chất chống oxy hóa như beta-caroten, vitamin A, C &amp; E giúp tăng cường sức đề kháng</li></ul><h3><strong>Độ tuổi sử dụng sữa bột Abbott grow 4</strong></h3><p>Abbott Grow 4 900g là sữa bột dành cho bé từ 2 tuổi trở lên</p><h3><strong>Hướng dẫn cách pha sữa Abbott Grow 4 900g và sử dụng</strong></h3><ul><li>Rửa sạch tay trước khi pha sữa bột Abbott Grow 4 900g.</li><li>Để có 200ml sữa Abbott GROW 4 cho 175ml nước chín để nguội vào ly (khoảng 37ºC), từ từ cho vào ly 3 muỗng gạt ngang (~ 36g) bột (muỗng có sẵn trong hộp), khuấy cho tan đều.</li><li>Uống ngay sau khi pha sữa hươu cao cổ số 4. Nếu không uống ngay, nên đậy kín cho vào tủ lạnh ở 20 -40ºC và dùng trong vòng 24 giờ.</li></ul><figure class=\"image\"><img src=\"https://cdn-v2.kidsplaza.vn/media/wysiwyg/SEO/Sua-cho-be/sua-abbott-grow-4-900g-cho-be-tren-2-tuoi-huong-vani.jpg\" alt=\"Sữa Abbott Grow Gold 4 900g cho bé trên 2 tuổi\"></figure><p style=\"text-align:center;\"><i>&nbsp;Hướng dẫn cách pha&nbsp;sữa Abbott Grow 4 trên vỏ hộp&nbsp;</i></p><p><strong>Bảo quản sữa Abbott Grow 4 900g</strong></p><ul><li>Bảo quản hộp sữa bột Abbott Grow 4 900g chưa sử dụng ở nhiệt độ phòng. Tránh ánh nắng.</li><li>Khi đã mở nắp hộp sữa Abbott Grow 4 phải được sử dụng trong vòng 3 tuần. Đậy nắp và bảo quản nơi khô mát (không cất trong tủ lạnh).</li></ul><p><strong>*Lưu ý</strong></p><p>- Không dùng lò vi sóng để hâm nóng lại sữa Abbott Grow 4.</p><p>- Dùng lượng sữa bột pha cao hơn nhiều lần lượng cho phép có thể gây ảnh hưởng không tốt cho sức khỏe của trẻ nhỏ.</p><p><strong>Hạn sử dụng sữa bột Abbott grow 4 900g</strong></p><p>Ngày sản xuất và hạn sử dụng được in dưới đáy hộp</p><p>&gt;&gt;&gt;Xem thêm: <a href=\"https://www.kidsplaza.vn/sua-cho-be-abbott-grow-4-huong-vani-1-7kg.html\"><strong>Sữa Abbott Grow 4 hương Vani 1.7kg (&gt;2 tuổi)</strong></a></p>', '<h4>&nbsp;</h4><figure class=\"table\"><table><tbody><tr><th>SKU</th><td>211110179</td></tr><tr><th>Xuất xứ</th><td>Mỹ</td></tr><tr><th>Độ tuổi</th><td>2Y+</td></tr><tr><th>Kích thước (Bao bì)</th><td>13x13x16.2cm</td></tr><tr><th>Hương vị</th><td>Vị vani</td></tr><tr><th>Khối lượng</th><td>900g</td></tr><tr><th>Bán chạy</th><td>675</td></tr></tbody></table></figure>', NULL, ';;', '/public/images/product/1-22.jpg', NULL, 0, NULL, 1, 1, '/public/images/sua-bot-abbott-grow-4-huong-vani-900g.jpg;/public/images/sua-bot-abbott-grow-4-huong-vani-900g-2.jpg;/public/images/sua-bot-abbott-grow-4-huong-vani-900g-1.jpg', NULL, NULL, NULL, 3, 2, NULL, '2023-03-10 02:42:56', '2024-04-02 10:14:30'),
(19, 6, ',6,5,4,', 'Abbott Grow 3 rẻ - 900g', '138908C', 'abbott-grow-3-re-900g', '270000', NULL, NULL, NULL, '<h2><strong>Sữa bột Abbott Grow 3 hương Vani 900g cho bé 1 - 2 tuổi</strong></h2><p>Abbott Grow 3 với hệ dưỡng chất G-Power giàu các dưỡng chất và Protein chất lượng cao, đủ 9 acid amin thiết yếu, giúp trẻ từ 1 đến 2 tuổi phát triển tốt nhất về thể chất và trí não. Sản phẩm được thiết kế dành riêng cho trẻ từ 1 đến 2 tuổi.<br>&nbsp;</p><h3><strong>Thương hiệu Abbott Hoa Kỳ</strong></h3><p>Được thành lập từ năm 1888, Abbott – công ty chăm sóc sức khỏe hàng đầu thế giới, chuyên nghiên cứu, phát triển, sản xuất và đưa ra các sản phẩm và dịch vụ chăm sóc sức khỏe có chất lượng cao trong lĩnh vực dinh dưỡng, dược phẩm, thiết bị chẩn đoán và điều trị.</p><p>Với hiểu biết sâu sắc về khoa học dinh dưỡng và các nhu cầu trong cuộc sống, Abbott luôn tiên phong trong lĩnh vực dinh dưỡng và chăm sóc sức khỏe nhằm nâng cao chất lượng cuộc sống. Các sản phẩm dinh dưỡng của Abbott dành cho trẻ em, người lớn tuổi cũng như chăm sóc sức khỏe nằm trong số các nhãn hiệu được tin cậy nhất trên thế giới.</p><h3><strong>Thành phần dinh dưỡng trong sữa Abbott Grow 3</strong></h3><p><a href=\"https://www.kidsplaza.vn/sua-abbott-grow.html\"><strong>Sữa Abbott Grow</strong></a><strong>&nbsp;số 3</strong> bao gồm các nguyên liệu sau: Sữa tách béo (45,6%), DẦU THỰC VẬT (dầu hướng dương giàu oleic, dầu đậu nành, dầu dừa), lactose, sucrose, galactooligosaccharides (GOS), KHOÁNG CHẤT (tricanxi phosphat, kali citrat, canxi carbonat, natri clorid, kali hydroxid, magiê clorid, sắt sulfat, kẽm sulfat, đồng sulfat, mangan sulfat, kali iodid), hương vani, VITAMIN (acid ascorbic, ascorbyl palmitat, cholin clorid,&nbsp;RRR- α -tocopheryl acetat, niacinamid, hỗn hợp tocopherol, canxi&nbsp;d-pantothenat, pyridoxin HCl, thiamin HCl, retinyl palmitat, acid folic, phylloquinon, riboflavin,&nbsp;β-caroten,&nbsp;d-biotin, cholecalciferol, cyanocobalamin), lecithin đậu nành, taurin, acid docosahexaenoic (DHA) từ dầu C. cohnii.</p><p style=\"text-align:center;\"><i>Bảng thành phần dinh dưỡng trong sữa Abbott Grow 3 900g</i></p><figure class=\"table\"><table><tbody><tr><td>&nbsp;</td><td><p style=\"text-align:center;\">Đơn vị</p></td><td><p>100g</p><p>bột</p></td><td><p>&nbsp;</p><p style=\"text-align:center;\">100ml</p><p style=\"text-align:center;\">pha&nbsp;</p><p style=\"text-align:center;\">chuẩn*</p></td><td>&nbsp;</td></tr><tr><td>Năng lượng (Energy)</td><td>kcal</td><td>478</td><td>72,7</td><td>-</td></tr><tr><td>Chất đạm (Protein)</td><td>g</td><td>16,42</td><td>2,50</td><td>-</td></tr><tr><td>9 acid amin thiết yếu</td><td>g</td><td>7,55</td><td>1,14</td><td>-</td></tr><tr><td>Lysin (Lysine)</td><td>g</td><td>1,33</td><td>0,20</td><td>-</td></tr><tr><td>Chất béo (Fat)</td><td>g</td><td>22,24</td><td>3,38</td><td>-</td></tr><tr><td>Acid Linoleic (omega 6)</td><td>g</td><td>3,62</td><td>0,55</td><td>-</td></tr><tr><td>Acid α - Linolenic (omega 3)</td><td>g</td><td>0,28</td><td>0,04</td><td>-</td></tr><tr><td>Acid Oleic (omega 9)</td><td>g</td><td>9,1</td><td>1,38</td><td>-</td></tr><tr><td>Acid docosahexaenoic (DHA)</td><td>mg</td><td>13,8</td><td>2,1</td><td>-</td></tr><tr><td>Bột đường (Carbohydrate)</td><td>g</td><td>52,4</td><td>7,96</td><td>-</td></tr><tr><td>GOS</td><td>g</td><td>1,6</td><td>0,24</td><td>-</td></tr><tr><td>Độ ẩm (Moisture)</td><td>g</td><td>2,30</td><td>89,3</td><td>-</td></tr><tr><td>Taurin (Taurine)</td><td>mg</td><td>34,0</td><td>5,17</td><td>-</td></tr><tr><td>Inositol</td><td>mg</td><td>19</td><td>2,9</td><td>-</td></tr><tr><td>Beta caroten</td><td>mcg</td><td>44,9</td><td>6,82</td><td>-</td></tr><tr><td>Khoáng chất - Minerals (ash)</td><td>g</td><td>5,0</td><td>0,76</td><td>&nbsp;</td></tr><tr><td>Canxi (Calcium)</td><td>mg</td><td>780</td><td>119</td><td>48,20%</td></tr><tr><td>Phốt pho (Phosphorus)</td><td>mg</td><td>520</td><td>79,0</td><td>34,93%</td></tr><tr><td>Magiê (Magnesium)</td><td>mg</td><td>58,0</td><td>8,82</td><td>27,57%</td></tr><tr><td>Natri (Sodium)</td><td>mg</td><td>250</td><td>38,0</td><td>-</td></tr><tr><td>Kali (Potassium)</td><td>mg</td><td>900</td><td>137</td><td>-</td></tr><tr><td>Clo (Chloride)</td><td>mg</td><td>600</td><td>91,2</td><td>-</td></tr><tr><td>Kẽm (Zinc)</td><td>mg</td><td>3,7</td><td>0,56</td><td>27,89%</td></tr><tr><td>Sắt (Iron)</td><td>mg</td><td>8,0</td><td>1,2</td><td>32,10%</td></tr><tr><td>Đồng (Copper)</td><td>mcg</td><td>534</td><td>81,2</td><td>-</td></tr><tr><td>Mangan (Manganese)</td><td>mcg</td><td>57</td><td>8,7</td><td>-</td></tr><tr><td>I ốt (Iodine)</td><td>mcg</td><td>150</td><td>22,8</td><td>51,50%</td></tr><tr><td>Selen (Selenium)</td><td>mcg</td><td>6,8</td><td>1,0</td><td>12,36%</td></tr><tr><td>Vitamin (Vitamins)</td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td></tr><tr><td>Vitamin A</td><td>IU</td><td>1433</td><td>217,8</td><td>33,21%</td></tr><tr><td>&nbsp;</td><td>mcg RE</td><td>430</td><td>65,3</td><td>-</td></tr><tr><td>Vitamin D3</td><td>IU</td><td>342</td><td>52,3</td><td>52,84%</td></tr><tr><td>&nbsp;</td><td>mcg</td><td>8,6</td><td>1,3</td><td>-</td></tr><tr><td>Vitamin E</td><td>IU</td><td>19,4</td><td>2,94</td><td>79,93%</td></tr><tr><td>&nbsp;</td><td><p>mg α-</p><p>TE</p></td><td>13,0</td><td>1,98</td><td>&nbsp;</td></tr><tr><td>Vitamin K1</td><td>mcg</td><td>41</td><td>6,2</td><td>97,45%</td></tr><tr><td>Vitamin C</td><td>mg</td><td>73</td><td>11</td><td>75,19%</td></tr><tr><td>Thiamin (Vitamin B1)</td><td>mg</td><td>0,84</td><td>0,13</td><td>51,91%</td></tr><tr><td>Riboflavin (Vitamin B2)</td><td>mg</td><td>1,1</td><td>0,17</td><td>67,98%</td></tr><tr><td>Vitamin B6</td><td>mg</td><td>0,87</td><td>0,13</td><td>53,77%</td></tr><tr><td>Vitamin B12</td><td>mcg</td><td>2,89</td><td>0,44</td><td>99,22%</td></tr><tr><td>Niacin</td><td>mg</td><td>8,4</td><td>1,3</td><td>43,26%</td></tr><tr><td>Acid Pantothenic</td><td>mg</td><td>3,5</td><td>0,53</td><td>-</td></tr><tr><td>Acid Folic</td><td>mcg</td><td>150</td><td>22,8</td><td>49,25%</td></tr><tr><td>Biotin</td><td>mcg</td><td>23</td><td>3,5</td><td>-</td></tr><tr><td>Cholin (Choline)</td><td>mg</td><td>67</td><td>10</td><td>-</td></tr></tbody></table></figure><p><i>** Giá trị tối thiểu trong thời gian lưu hành phải ≥ 80% giá trị này</i></p><figure class=\"image\"><img src=\"https://cdn-v2.kidsplaza.vn/media/wysiwyg/product/suabotchobe/sua-bot-abbott-grow-3-huong-vani-900g-1.jpg\" alt=\"Thành phần dinh dưỡng có trong sữa Abbott Grow 3\"></figure><p style=\"text-align:center;\"><i>Thành phần dinh dưỡng trong sữa&nbsp;Abbott Grow 3 900g</i></p><h3><strong>Công dụng của sữa Abbott Grow 3&nbsp;900g (1 - 2 tuổi) hương Vani</strong></h3><h4><strong>Abbott Grow hỗ trợ hệ tiêu hóa, hấp thu tốt giúp bé tăng cân tốt hơn</strong></h4><p>Sữa Abbott Grow tuy có lượng đạm cao, giàu lysin nhưng thành phần đạm dễ tiêu hóa, dễ hấp thu hỗ trợ bé tăng cân và phát triển tốt.</p><p>Điểm đáng chú ý ở sữa Abbott Grow đó chính là công thức sữa bổ sung men vi sinh Gos: Gos chính là nguồn thức ăn cho probiotic- vi sinh vật có ích sống trong đường ruột, và chính nhờ gos vi sinh vật có ích có điều kiện phát triển mạnh mẽ, hỗ trợ đường tiêu hóa khỏe mạnh,làm việc tốt hơn, hấp thu chất dinh đưỡng được tốt hơn.</p><h4><strong>Nâng cao hệ miễn dịch giúp bé phát triển khỏe mạnh</strong></h4><p>Công thức khoa học của sữa còn có rất nhiều chất chống oxy hóa như: Kẽm, vitamin C, vitamin E, beta- caroten hỗ trợ hệ miễn dịch, giúp tăng cường sức đề kháng phòng tránh các bệnh nhiễm khuẩn thông thường mà trẻ hay mắc phải.</p><h4><strong>Hỗ trợ phát triển chiều cao tối đa</strong></h4><p>Với thành phần Giàu canxi và Vitamin D, tỷ lệ canxi/photpho đạt chuẩn theo khuyến cáo của Châu Âu (~1.84 ) tương đương với tỷ lệ canxi/photpho có trong sữa mẹ điều này giúp cho dòng sữa này tạo ra một ưu điểm giúp trẻ phát triển chiều cao- một vấn đề mà mẹ nào cũng quan tâm và mong muốn ở con.</p><p>Ngoài ra trong thành phần sữa Abbott Grow còn có hỗn hợp chất béo không chứa dầu cọ( theo khuyến cáo thành phần dầu cọ có trong chất béo hạn chế khả năng hấp thu canxi) từ đó góp phần giúp cơ thể bé hấp thu được tối đa lượng canxi để kiến tạo ra một hệ xương răng vững chắc.</p><h4><strong>Sữa Abbott Grow phát triển trí não và tăng khả năng học hỏi ở bé</strong></h4><p>DHA, Taurin, và AA giúp phát triển não bộ và võng mạc hoàn thiện, cho mắt sáng, não bộ hoạt động hiệu quả, bổ sung Choline giúp tổng hợp. Các loại vitamin B, B1, B2, B12 hỗ trợ não bộ giúp bé tiếp thu nhanh và ghi nhớ tốt hơn. Ngoài ra kẽm và magie còn hỗ trợ khả năng chú ý và tập trung ở trẻ.</p><h3><strong>Hướng dẫn cách pha sữa Abbott Grow 3 và bảo quản sữa</strong></h3><h4><strong>Cách pha sữa Abbott Grow 3</strong></h4><p>Rửa tay và dụng cụ thật sạch trước khi pha</p><p>Chỉ dùng muỗng có sẵn trong hộp để lường</p><p>Lấy 3 muỗng gạt sữa Abbott Grow 3 pha với 180ml nước ấm (~37ºC)</p><p>Lượng pha dư hơn một lần uống phải được bảo quản trong tủ lạnh ở 20&nbsp;– 40ºC không quá 24 giờ</p><p>Khi cho trẻ uống phải dùng trong vòng 1 giờ, đổ bỏ phần còn thừa.</p><figure class=\"image\"><img src=\"https://cdn-v2.kidsplaza.vn/media/wysiwyg/product/suabotchobe/sua-bot-abbott-grow-3-huong-vani-900g-2.jpg\" alt=\"Hướng dẫn sử dụng và cách pha sữa Abbott Grow số 3\"></figure><p><i>&nbsp;Cách pha sữa Abbott Grow 3 900g 1-2 tuổi</i></p><h3><strong>Hướng dẫn bảo quản&nbsp;sữa Abbott Grow 3</strong></h3><p>Bảo quản hộp chưa sử dụng ở nhiệt độ phòng, tránh ánh nắng mặt trời trực tiếp.</p><p>Khi đã mở nắp phải được sử dụng trong vòng 3 tuần.</p><p>Đậy nắp và bảo quản nơi khô mát (không cất trong tủ lạnh)</p><p><strong>Độ tuổi sử dụng</strong></p><p>Sữa bột Abbott Grow 3 hương Vani 900g cho bé 1 - 2 tuổi</p><p><strong>Hạn sử dụng</strong></p><p>Ngày sản xuất và hạn sử dụng ở đáy hộp</p><p>Xem thêm&gt;&gt;<a href=\"https://www.kidsplaza.vn/sua-abbott-grow-4-huong-vani-900g.html\"><strong> Sữa Abbott Grow 4 hương Vani 900g (&gt;2 tuổi)</strong></a></p><p>&nbsp;</p>', '<p>&nbsp;</p><figure class=\"table\"><table><tbody><tr><th>SKU</th><td>211110177</td></tr><tr><th>Xuất xứ</th><td>Mỹ</td></tr><tr><th>Độ tuổi</th><td>1-2Y</td></tr><tr><th>Kích thước (Bao bì)</th><td>13x13x16.2cm</td></tr><tr><th>Khối lượng</th><td>900g</td></tr><tr><th>Bán chạy</th><td>1387</td></tr></tbody></table></figure>', NULL, ';0;', '/public/images/product/1-07.jpg', NULL, 0, NULL, 1, 1, '/public/images/sua-bot-abbott-grow-3-huong-vani-900g_1.jpg;/public/images/sua-bot-abbott-grow-3-huong-vani-900g-1_1.jpg;/public/images/sua-bot-abbott-grow-3-huong-vani-900g-2_1.jpg', NULL, NULL, NULL, 3, 2, NULL, '2023-03-10 02:52:27', '2024-04-02 10:14:26'),
(20, 44, ',44,5,4,', 'Colos baby 0+ 400g', 'ColosBaby Gold', 'colos-baby-0-400g', '265000', NULL, NULL, NULL, '<p>Sữa bột ColosBaby Gold 0+ là sản phẩm phù hợp với trẻ từ 0-12 tháng tuổi. Với thành phần sữa non cao cấp nhập khẩu từ Mỹ cùng với Lactium và hệ dưỡng chất đầy đủ, cân đối, sản phẩm giúp bé yêu phát triển khỏe mạnh, khôn lớn từng ngày.</p><figure class=\"image\"><img src=\"https://lh3.googleusercontent.com/rMRyGAI81r2wsP1QRi8nrG72nDo8QaL2dnQBbQe065OroTt-vXGYM3q3Zb14OXaMws9H8NpngyvMjMK8pDtPLiY8Igm0ka_MyaSLeMN-JCpcif6IDDbUzUqJI-RHagdoMFWzdtGf26AoyeqwQSVLgf9x30n0CKPFr_ETpLDm7WbsKyT4Y6DhHbrLQg\" alt=\"CBB Gold 0+_Hình 1\"></figure><p style=\"text-align:center;\">&nbsp;</p><p><strong>Ưu điểm nổi bật</strong><br>. Vitamin B, Kẽm, kích thích sự thèm ăn, tăng cảm giác ngon miệng, giúp tăng cường chuyển hóa dinh dưỡng để bé ăn ngon miệng, tiêu hóa tốt;<br>. Chất xơ hòa tan FOS giúp cân bằng hệ vi sinh đường ruột, cho hệ tiêu hóa luôn khỏe mạnh, đồng thời duy trì nhu động ruột, làm mềm phân và ngăn ngừa táo bón cho trẻ;<br>. Dinh dưỡng hợp lý, cung cấp đầy đủ chất đạm, chất béo, vitamin và khoáng chất cần thiết cho quá trình phát triển cấu trúc và chức năng của cơ thể giúp bé tăng cân khỏe mạnh;<br>. Lactium giúp đem lại cảm giác thoải mái, thư giãn, tăng cường giấc ngủ tự nhiên, ngon giấc cho bé. Việc duy trì giấc ngủ thoải mái, sâu giấc sẽ giúp bé nhanh lớn và khỏe mạnh hơn;<br>. Canxi, Magie, Phospho tham gia hình thành cấu trúc xương, giúp xương chắc khỏe;<br>. Vitamin D3 tăng cường hấp thu và sử dụng Canxi để phát triển chiều dài xương, giúp bé phát triển chiều cao vượt trội.</p><p style=\"text-align:justify;\"><span style=\"background-color:transparent;color:rgb(0,0,0);\"><strong>Tỷ lệ pha gợi ý</strong></span></p><p style=\"text-align:justify;\">&nbsp;</p><figure class=\"image\"><img src=\"https://cdn1.concung.com/storage/2023/04/1682163979-sua-colosbaby-gold-0-800g.jpg\"></figure><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p>', '<figure class=\"table\"><table><tbody><tr><td>Tên sản phẩm</td><td>Sữa Colosbaby Gold 0+</td></tr><tr><td>Thương hiệu</td><td>Vitadairy</td></tr><tr><td>Xuất xứ thương hiệu</td><td>Việt Nam</td></tr><tr><td>Trọng lượng sản phẩm</td><td>0.4</td></tr></tbody></table></figure>', NULL, ';;', '/public/images/product/1-28.jpg', NULL, 0, NULL, 1, 1, '/public/images/sua-colosbaby-gold-0-400g-0-12-thang.png;/public/images/sua-colosbaby-gold-0-400g-0-12-thang.jpg', NULL, NULL, NULL, 2, 2, NULL, '2024-03-26 08:56:56', '2024-04-02 10:14:21'),
(21, 44, ',44,5,4,', 'Colos baby 1+ 400g', 'Colos baby', 'colos-baby-1-400g', '250000', NULL, NULL, NULL, '<h2>Mô tả Sữa bột ColosBaby Bio Gold 1+ 400g (1-2 tuổi)</h2><p><strong>Sữa bột ColosBaby Bio Gold 1+ 400g</strong> - Công thức dinh dưỡng đột phá mới của VitaDairy, với <a href=\"https://shoptretho.com.vn/danh-muc/sua-non\">sữa non</a> ColosIgG 24h nhập khẩu độc quyền từ Mỹ, kết hợp 2’-FL HMO, lợi khuẩn Bifidobacterium, cùng rất nhiều dưỡng chất cao cấp đem đến cho trẻ nguồn dinh dưỡng ưu việt, giúp bé có miễn dịch khỏe, tiêu hóa tốt và phát triển vượt trội cả về thể chất và trí tuệ trong những năm tháng đầu đời.</p><figure class=\"image\"><img src=\"https://media.shoptretho.com.vn/upload/20230212/sua-bot-colosbaby-bio-gold-1-400g-1.png\" alt=\"Sữa bột ColosBaby Bio Gold 1+ 400g\"></figure><p style=\"text-align:center;\"><i>ColosBaby Bio Gold - Công thức dinh dưỡng đột phá mới của VitaDairy, với sữa non ColosIgG 24h nhập khẩu độc quyền từ Mỹ</i></p><h3>Điểm nổi bật của sữa bột ColosBaby Bio Gold 1+ 400g</h3><p><strong>Thành phần</strong></p><p>Bột sữa, dầu thực vật, sucrose, sữa non colosIgG 24h, chất xơ hòa tan (FOS), khoáng chất (Canxi, Photpho, Kali, Natri, Magie, Sắt, Kẽm, Selen), vitamin (vitamin A, vitamin D3, vitamin E, vitamin K1, vitamin C, vitamin B1, vitamin B2, vitamin B6, vitamin B12, axit pantothenic, axit folic, choline, taurine), lactium.</p><p>ColosBaby Bio Gold - Công thức dinh dưỡng đột phá mới của VitaDairy, với sữa non ColosIgG 24h nhập khẩu độc quyền từ Mỹ, kết hợp 2’-FL HMO, lợi khuẩn Bifidobacterium, cùng rất nhiều dưỡng chất cao cấp đem đến cho trẻ nguồn dinh dưỡng ưu việt, giúp bé có miễn dịch khỏe, tiêu hóa tốt và phát triển vượt trội cả về thể chất và trí tuệ trong những năm tháng đầu đời.</p><p>Tăng cường miễn dịch: Bộ 3 Miễn dịch gồm: Kháng thể IgG tự nhiên từ Sữa non ColosIgG 24h, 2\'-FL HMO và lợi khuẩn Bifidobacterium được bổ sung trong ColosBaby Bio Gold&nbsp; giúp bảo vệ bé hiệu quả.</p><p>+ Kháng thể IgG hàm lượng chuẩn khoa học&nbsp; với khả năng nhận diện và tiêu diệt trực tiếp vi khuẩn, virus, giúp tăng sức mạnh hệ miễn dịch bên trong cơ thể.</p><p>+ Oligosaccharide tự nhiên 2’-FL HMO - Prebiotics giúp nuôi dưỡng và thúc đẩy sự phát triển của hệ lợi khuẩn đường ruột ức chế vi khuẩn có hại trong đường ruột và điều hòa miễn dịch cơ thể.</p><p>+ Bifidobacterium - Probiotics là lợi khuẩn tiếp tục giúp cân bằng hệ vi sinh đường ruột tạo hàng rào cản trở vi khuẩn gây bệnh.</p><p>Với bộ 3 miễn dịch đặc biệt của ColosBaby Bio Gold bé có miễn dịch khỏe, là nền tảng để phát triển khỏe mạnh.</p><p><strong>Êm bụng, tiêu hóa tốt: </strong>Bộ 3 tiêu hóa gồm 2’-FL HMO, lợi khuẩn Bifidobacterium&nbsp; và hệ chất xơ hòa tan FOS/Inulin phát huy vai trò bảo vệ và hỗ trợ chức năng tiêu hóa hiệu quả.&nbsp; Cùng hệ vi khuẩn có lợi trong đường ruột cân bằng giúp bé hấp thu tốt chất dinh dưỡng, tiêu hóa tốt và đặc biệt không bị táo bón. không bị táo bón.</p><p><strong>Phát triển trí não</strong>: Bổ sung DHA&nbsp; từ tảo, Choline, Taurine là những dưỡng chất quan trọng cho sự hoàn thiện và phát triển não bộ, thị giác giúp bé thông minh, tăng cường nhận thức và khả năng học tập.</p><p><strong>Tăng cân khỏe mạnh:</strong> Dinh dưỡng hợp lý, cung cấp đầy đủ Protein, chất béo, Vitamin và Khoáng chất cần thiết cho quá trình phát triển cấu trúc và chức năng của cơ thể giúp bé tăng cân khỏe mạnh.</p><p><strong>Ngủ ngoan, cao lớn</strong>: Lactium dưỡng chất đặc biệt của quá trình thủy phân Casein sữa giúp đem lại cảm giác thoải mái, thư giãn và giấc ngủ tự nhiên, ngon giấc cho bé. Canxi, Phospho, Magie với hàm lượng và tỷ lệ tối ưu, Vitamin D3 hỗ trợ quá trình hấp thu Canxi hiệu quả giúp xây dựng hệ xương chắc khỏe và phát triển chiều cao vượt trội.&nbsp;</p><p><strong>Hướng dẫn pha</strong></p><p>. Pha 6 muỗng gạt (tương đương 51g) với 195ml nước chín ấm (40-50 độ C) được 1 ly khoảng 234ml.</p><p>. Cho trẻ uống 2-3 ly mỗi ngày hoặc theo hướng dẫn của cán bộ y tế.</p><p>. Sản phẩm sau khi pha nên sử dụng hết trong vòng 1 giờ. Không cho trẻ ăn lại phần thừa của bữa trước.</p><p><a href=\"https://shoptretho.com.vn/thuong-hieu/vitadairy\">Thương hiệu : VitaDairy</a></p><blockquote><p>&nbsp;</p></blockquote>', NULL, NULL, ';1;', '/public/images/product/1-30.jpg', NULL, 0, NULL, 1, 1, '', NULL, NULL, NULL, 2, 2, NULL, '2024-03-26 09:01:46', '2024-04-02 10:14:15'),
(22, 44, ',44,5,4,', 'Colos gain số 0 - 900g', 'Colos Gain', 'colos-gain-so-0-900g', '375000', NULL, NULL, NULL, '<p style=\"text-align:justify;\">﻿<strong>﻿Sữa Colos Gain 0+</strong> với công thức dinh dưỡng khoa học bổ sung sữa non Colos IgG 24h độc quyền từ Mỹ, cùng hệ vitamin và khoáng chất đa dạng giúp bé tiêu hóa và hấp thu tốt, tăng cân khỏe mạnh và tăng cường miễn dịch. Sản phẩm phù hợp với trẻtư từ 0-12 tháng tuổi.</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><br>&nbsp;</p><p style=\"text-align:center;\">&nbsp;</p><figure class=\"image\"><img src=\"https://cdn1.concung.com/storage/2022/09/1663149567.png\"></figure><p style=\"text-align:justify;\"><strong>Ưu điểm nổi bật</strong><br>. Colos Gain được bổ sung sữa non ColosIgG24h - sữa non thu trong 24h đầu tiên, được VitaDairy nhập khẩu độc quyền từ Mỹ giúp cung cấp kháng thể IgG. Đây là kháng thể mạnh nhất trong cơ thể có khả năng gắn kết và tiêu diệt yếu tố gây bệnh giúp trẻ hạn chế ốm vặt, phòng ngừa nhiễm khuẩn hô hấp, tiêu hoá;<br>. Lysine, Vitamin B, giúp bé ăn ngon miệng, giảm biếng ăn, FOS/Inulin - chất xơ hòa tan giúp cân bằng tiêu hóa và ngừa táo bón;<br>. DHA, Taurine, Choline giúp bổ sung dưỡng chất cho hoạt động và sự phát triển của trí não và thị giác;<br>. Canxi, Photpho, Vitamin D3 giúp xương chắc khỏe và phát triển chiều cao.</p><p style=\"text-align:justify;\"><br><strong>Tỷ lệ pha gợi ý&nbsp;</strong></p><p style=\"text-align:justify;\">. Từ 0 đến 1 tháng: số lượng pha 2 muỗng với lượng nước 60ml, cho bé ăn 7-8 lần trên 24 giờ.</p><p style=\"text-align:justify;\">. Từ 1 đến 2 tháng: số lượng pha 3 muỗng với lượng nước 90ml, cho bé ăn 7-7 lần trên 24 giờ.</p><p style=\"text-align:justify;\">. Từ 2 đến 4 tháng: số lượng pha 4 muỗng với lượng nước 120ml, cho bé ăn 5-6 lần trên 24 giờ.</p><p style=\"text-align:justify;\">. Từ 4 đến 6 tháng: số lượng pha 5 muỗng với lượng nước 150ml, cho bé ăn 4-5 lần trên 24 giờ.</p><p style=\"text-align:justify;\">. Trên 6 tháng: số lượng pha 6 muỗng với lượng nước 180ml, cho bé ăn 3-4 lần trên 24 giờ.</p><p style=\"text-align:justify;\"><br>&nbsp;</p><p style=\"text-align:justify;\"><strong>Lưu ý:&nbsp;</strong></p><p style=\"text-align:justify;\">. 1 muỗng gạt (tương đương với 4.6g) pha với 30ml nước chín ấm (50 độ C).&nbsp;</p><p style=\"text-align:justify;\">. Trường hợp trẻ nhẹ cân cần tăng cường dinh dưỡng hoặc cải thiện cân nặng tốt hơn, tham khảo ý kiến bác sĩ với cách pha như sau: 1 muỗng gạt(tương đương với 4.6g) pha với 25ml nước chín ấm (50 độ C) đậm độ năng lượng đạt 0.8kcal/ml</p><p style=\"text-align:justify;\">&nbsp;</p><p style=\"text-align:justify;\"><strong>Thành phần</strong></p><p style=\"text-align:justify;\">Sữa bột(25-40%), Dầu thực vật, Sucrose,Sữa non ColosIgG 24h , Maltodextrin, Chất xơ hòa tan (FOS/Inulin),Whey Protein, Khoáng chất (Canxi Carbonat, Magie Oxit, Sắt (III), Pyrophotphat, Kẽm Sulphat, Đồng Sulphat,Kali Iodid, Mangan Sulphat,Natri Selenit),Chất béo chuỗi trung bình(MCT), L-Lysine, Vitamin (Vitamin A, Vitamin D3, Vitamin E, Vitamin K1, Natri Ascorbat, Vitamin B1, Vitamin B2, Vitamin B6, Vitamin B12,Canxi D-Pantothenat, Axit Folic, Niacin, Biotin,Inositol, L-Carnitine, Taurine), Dầu cá(giàu DHA),Arachidonic acid (ARA),Choline Bitartrate, 2\'Fucosyllactose(2\'-FL HMO).</p><p style=\"text-align:justify;\"><br>&nbsp;</p><p>&nbsp;</p><p><span style=\"background-color:rgb(255,255,255);color:rgb(103,104,108);\">Xem thêm</span></p><h4>Đánh Giá</h4>', '<figure class=\"table\"><table><tbody><tr><td>Tên sản phẩm</td><td>Sữa Colos Gain 0+</td></tr><tr><td>Thương hiệu</td><td>Vitadairy</td></tr><tr><td>Xuất xứ thương hiệu</td><td>Việt Nam</td></tr><tr><td>Trọng lượng sản phẩm</td><td>0.8</td></tr></tbody></table></figure>', NULL, ';1;', '/public/images/product/1-33.jpg', NULL, 0, NULL, 1, 1, '/public/images/sua-colos-gain-0-800g-0-12-thang.jpg;/public/images/sua-colos-gain-0-800g-0-12-thang%20(1).jpg;/public/images/sua-colos-gain-0-800g-0-12-thang%20(2).jpg', NULL, NULL, NULL, 2, 2, NULL, '2024-03-26 09:03:55', '2024-04-02 10:14:10'),
(23, 6, ',6,5,4,', 'Sữa Abbott Grow số 3 900g', '5fs343', 'sua-abbott-grow-so-3-900g', '315000', NULL, NULL, NULL, '<p style=\"text-align:justify;\">Giai đoạn từ 1 đến 2 tuổi, trẻ phát triển rất nhanh cả về chiều cao, trí não và sức đề kháng. Do đó, việc bổ sung đầy đủ dưỡng chất và protein đóng vai trò rất quan trọng giúp trẻ phát triển tốt, và là nền tảng cho sức vóc của trẻ lúc trưởng thành. Đến từ thương hiệu Abbott Hoa Kỳ, <strong>sữa Abbott Grow số 3</strong> có chứa hệ dưỡng chất G-Power cung cấp hơn 26 dưỡng chất cùng 9 acid amin thiết yếu và protein chất lượng cao sẽ hỗ trợ quá trình phát triển toàn diện của trẻ cả về chiều cao, cân nặng lẫn trí não trong giai đoạn này.</p><figure class=\"image\"><img src=\"https://media.bibomart.net/file/ProductAttribute/4-1-2023-1857b16d598.jpg\" alt=\"\"></figure><p style=\"text-align:center;\"><i>Sữa Abbott Grow số 3</i></p><h3><strong>Đặc điểm nổi bật của sản phẩm</strong><br>&nbsp;</h3><p style=\"text-align:justify;\"><i><strong>Hỗ trợ tăng cân và phát triển khỏe mạnh</strong></i><br><br>- Sữa Abbott Grow số 3 giàu dưỡng chất với 14 loại vitamin cùng các vi khoáng chất thiết yếu, cung cấp đủ 9 acid amin và protein chất lượng cao bổ sung cho chế độ ăn hàng ngày của bé mang đến nguồn năng lượng dồi dào giúp bé tự do, thỏa thích thực hiện và tham gia các hoạt động vui chơi, khám phá, đồng thời hỗ trợ đắc lực cho quá trình phát triển toàn diện của trẻ.<br><br>- Protein chất lượng cao (đặc biệt giàu lysin) giúp trẻ tăng trưởng tốt, hỗ trợ tăng cân và phát triển khỏe mạnh.<br><br><i><strong>Tăng trưởng tốt về chiều cao</strong></i><br><br>Abbott Grow số 3 giàu Canxi và Phốt pho với tỷ lệ Canxi/Phốt pho theo khuyến cáo của Châu Âu và Hoa Kỳ cùng với hỗn hợp chất béo thực vật không chứa dầu cọ và nguồn vitamin D hỗ trợ hấp thu Canxi cho xương chắc khỏe và giúp phát triển chiều cao của trẻ.<br><br><i><strong>Phát triển não bộ và thị giác</strong></i><br><br>Bổ sung DHA, Taurin, Cholin, các acid béo omega 3, 6 &amp; 9 cùng các vi chất (sắt, kẽm, i-ốt và đồng) giúp phát triển tốt não bộ và thị giác. Đây đều là các vi chất quan trọng hỗ trợ cho sự học hỏi, khám phá, tư duy và nhận thức của bé trong giai đoạn này.<br><br><i><strong>Tăng cường miễn dịch và tiêu hóa</strong></i><br><br>Grow 3 bổ sung hệ chất xơ GOS giúp tăng cường sức khỏe đường tiêu hóa. Đồng thời, sự xuất hiện của beta-caroten và các chất chống oxy hóa (vitamin A, C, E) trong thành phần dinh dưỡng giúp bé tăng cường sức đề kháng.</p><figure class=\"image\"><img src=\"https://media.bibomart.net/file/ProductAttribute/4-1-2023-1857b18a0dd.jpg\" alt=\"\"></figure><p style=\"text-align:justify;\"><strong>Hướng dẫn sử dụng sản phẩm</strong><br><br>- Rửa sạch dụng cụ pha, cốc, thìa,... với xà phòng. Tráng lại với nước rồi đun sôi tất cả trong 5 phút. Chuẩn bị sạch nơi pha.<br><br>- Đun sôi nước dùng để pha trong 5 phút rồi để nguội.<br><br>- Cho chính xác lượng nước cần pha vào bình đã tiệt trùng.<br><br>- Múc Abbott Grow 3 bằng muỗng lường và gạt bằng. Mỗi muỗng Abbott Grow 3 pha với 60ml nước ấm trong bình.<br><br>- Khuấy hoặc lắc cho hòa tan hoàn toàn.<br><br>- Thử nhiệt độ rồi cho bé dùng.&nbsp;<br><br>- Chỉ dùng muỗng có sẵn trong hộp để lường. Lượng pha dư hơn một lần uống phải được bảo quản trong tủ lạnh ở 2 - 4 độ C không quá 24 giờ. Khi cho trẻ uống phải dùng trong vòng 1 giờ, đổ bỏ phần còn thừa.</p>', NULL, NULL, ';0;', '/public/images/product/1-07.jpg', NULL, 0, NULL, 1, 1, NULL, NULL, NULL, NULL, 2, 2, NULL, '2024-03-29 22:41:37', '2024-04-02 10:14:03');
