le=\"text-align:justify;\"><strong>Hướng dẫn sử dụng sản phẩm</strong></h3><p style=\"text-align:justify;\"><i><strong>Hướng dẫn pha </strong></i><a href=\"https://bibomart.com.vn/sua-bot-cac-loai.html\"><i><strong>sữa</strong></i></a><i><strong>:</strong></i><strong>&nbsp;</strong>1 thìa = 5g bột.</p><p style=\"text-align:justify;\"><i>Lưu ý:</i>&nbsp;1 thìa bột cho vào 30 ml nước sẽ được khoảng 34 ml sữa công thức.</p><p style=\"text-align:justify;\">- Bước 1: Rửa sạch tay và dùng máy tiệt trùng hoặc nước sôi để tiệt trùng các dụng cụ pha sữa.</p><p style=\"text-align:justify;\">- Bước 2: Dùng nước sôi để nguội tầm 40 độ C.</p><p style=\"text-align:justify;\">- Bước 3: Cho nước vào bình sữa trước theo đúng lượng sữa của bé.</p><p style=\"text-align:justify;\">- Bước 4: Dùng muỗng đã có sẵn trong hộp để đong sữa cho bé .</p><p style=\"text-align:justify;\">- Bước 5:&nbsp; Tỷ lệ bột sữa Aptamil&nbsp;Essensis&nbsp;và nước: 1 thìa sữa gạt ngang pha với 30ml nước</p><p style=\"text-align:justify;\"><i><strong>Lượng dùng khuyến nghị cho bé:</strong></i></p><figure class=\"image\"><img src=\"https://media.bibomart.net/file/ProductAttribute/18-4-2023-187924d6417.jpg\" alt=\"\"></figure><h3 style=\"text-align:justify;\"><strong>Hướng dẫn bảo quản sản phẩm</strong></h3><p style=\"text-align:justify;\">- Bảo quản ở nơi khô mát.</p><p style=\"text-align:justify;\">- Sử dụng theo ngày trên đáy lon.</p><p style=\"text-align:justify;\">- Sau khi mở, giữ kín lon và sử dụng hàm lượng sữa trong vòng 4 tuần.</p>', NULL, NULL, ';1;2;', '/public/images/product/1-13.jpg', NULL, 0, NULL, 1, 1, NULL, NULL, NULL, NULL, 2, 2, NULL, '2024-03-29 22:48:25', '2024-04-06 09:35:51');
