(29, 72, ',72,5,4,', 'Sữa Kidbuild Baby (0-12 tháng tuổi) 800g', 'Kidbuild', 'sua-kidbuild-baby-0-12-thang-tuoi-800g', '460000', NULL, 21, NULL, '<figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><p>&nbsp;</p><p>Tăng cường miễn dịch &amp; sức đề kháng, phát triển não bộ, thị giác, hỗ trợ hệ tiêu hóa, hấp thu giúp nuôi dưỡng hệ vi khuẩn có lợi trong đường ruột, hỗ trợ chức năng tiêu hóa, hạn chế táo bón.</p>', NULL, NULL, ';;', '/public/images/s%E1%BB%AFa-01(1).jpg', NULL, 0, NULL, 1, 1, NULL, NULL, NULL, NULL, 2, 2, NULL, '2024-04-10 22:42:05', '2024-04-10 22:42:05');
