INSERT INTO `tb_products` (`id`, `taxonomy_id`, `category`, `title`, `masanpham`, `alias`, `gia`, `giakm`, `quantity`, `mota`, `chitiet`, `diemban`, `giayto`, `hienthi`, `image`, `image_thumb`, `view`, `iorder`, `tinhtrang`, `status`, `image_list`, `meta_title`, `meta_keyword`, `meta_description`, `admin_created_id`, `admin_updated_id`, `json_params`, `created_at`, `updated_at`) VALUES
(37, 72, ',72,5,4,', 'Sữa Kidbuild Sure (Dành cho người trưởng thành, người cần phục hồi cơ thể, người sau phẫu thuật) - 800g', 'Kidbuild', 'sua-kidbuild-sure-danh-cho-nguoi-truong-thanh-nguoi-can-phuc-hoi-co-the-nguoi-sau-phau-thuat-800g', '450000', NULL, 20, NULL, '<figure class=\"image\"><img src=\"data:image/png;base64,\"></figure><p><span style=\"background-color:rgb(255,255,255);color:rgb(5,5,5);\">Sữa Kidbuild Sure - Công thức dinh dưỡng tiên tiến cao năng lượng, tăng cường các vi chất dinh dưỡng giúp bồi bổ và tăng cường sức khỏe. TĂNG CƯỜNG MIỄN DỊCH, PHỤC HỒI THỂ LỰC Sản phẩm cung cấp nguồn năng lượng cao ( 1Kcal/ml ) bù đắp năng lượng thiếu hụt, giúp người cao tuổi, người ốm bệnh nhanh chóng phục hồi. Bổ sung Vitamin C, Kẽm, Selen giúp tăng cường miễn dịch, tăng sức đề kháng, bảo vệ cơ thể trước các tác nhân gây bệnh. TỐT CHO TIM MẠCH, TRÍ NÃO MUFA, PUFA: Hệ chất béo không no có tác dụng kiểm soát mỡ máu, giúp giảm nguy cơ các bệnh tim mạch như xơ vữa mạch, huyết áp, giúp tăng cường sức khỏe tim mạch. Choline có tác dụng tăng cường trí nhớ của người già, phòng chống bệnh Alzheimer, Vitamin A giúp ngăn ngừa thoái hóa tế bào vòng mạc, bảo vệ thị lực. CHO HỆ XƯƠNG CHẮC KHỎE: Tăng cường Canxi, Photpho, Magie đảm bảo nhu cầu khoáng chất cần thiết cho cơ thể, ngăn ngừa loãng xương, xốp xương. Bổ sung MK-7, Vitamin D3 hỗ trợ hấp thu canxi, giúp bảo vệ cấu trúc xương chắc khỏe. HỖ TRỢ TIÊU HOÁ, HẤP THU DINH DƯỠNG Chất xơ hòa tan (FOS/Inulin) giúp tăng sinh lợi khuẩn đường ruột, ổn định tiêu hóa, hạn chế tình trạng táo bón. Lysine, Vitamin nhóm B hỗ trợ khả năng hấp thu và chuyển hóa dinh dưỡng, giúp ăn ngon miệng tiêu hóa tốt. Công dụng: Kidbuild Sure là sản phẩm dinh dưỡng dùng để thay thế bữa ăn phụ, bổ sung năng lượng, chất đạm và các vi chất dinh dưỡng, giúp bồi bổ và tăng cường sức khỏe. Đối tượng sử dụng: người trưởng thành và người cao tuổi, đặc biệt thích hợp cho người cần bổ sung năng lượng, người ốm yếu, ăn uống kém, người cần phục hồi sau ốm bệnh hoặc sau phẫu thuật.</span></p>', NULL, NULL, ';;', '/public/images/s%E1%BB%AFa-04.jpg', NULL, 0, NULL, 1, 1, NULL, NULL, NULL, NULL, 2, 2, NULL, '2024-04-10 23:00:43', '2024-04-10 23:00:43');
